(1, '952adfac-0d4c-11e7-80b6-4376a32b3f45', 23, NULL, 108, 'Мастер-прораб', '2017-03-20', 'ПГС', '[B]', 'Российская Федерация', '2017-03-20', ' ', 4, 45000, ' ', '<p>Активная жизненная позиция, нацеленность на результат.</p><p>&nbsp;Профессиональные навыки и знания: Опытный пользователь ПК (Office, 1С Предприятие, AutoKad).</p>', 'Полная занятость', ' ', '3babdf30-0d4a-11e7-80b6-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(2, '41708f50-0d50-11e7-80b6-4376a32b3f45', 23, NULL, 108, 'Производитель работ', '2017-03-20', 'ПГС', '[B]', 'Российская Федерация', '2017-03-20', ' ', 4, 45000, ' ', '<p>Активная жизненная позиция, нацеленность на результат.</p><p>&nbsp;Профессиональные навыки и знания: Опытный пользователь ПК (Office, 1С Предприятие, AutoKad).</p>', 'Полная занятость', ' ', '3babdf30-0d4a-11e7-80b6-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(3, '510de7a0-0d50-11e7-80b6-4376a32b3f45', 23, NULL, 108, 'Мастер СМР', '2017-03-20', 'ПГС', '[B]', 'Российская Федерация', '2017-03-20', ' ', 4, 45000, ' ', '<p>Активная жизненная позиция, нацеленность на результат.</p><p>&nbsp;Профессиональные навыки и знания: Опытный пользователь ПК (Office, 1С Предприятие, AutoKad).</p>', 'Полная занятость', ' ', '3babdf30-0d4a-11e7-80b6-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(4, 'b09770f5-80bc-11e5-8d54-833b590698f7', 77, NULL, 115, 'водитель кат.всд.', '2018-01-29', ' ', ' ', 'Российская Федерация', '2015-11-02', ' ', 0, 40000, ' ', ' ', 'Полная занятость', ' ', 'a86b7d70-80b9-11e5-8d54-833b590698f7', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(5, 'c69b5e79-3d5e-11e6-ab49-736ab11edb0c', 16, NULL, 128, 'начальник лаборатории неразрушающего контроля', '2017-07-05', 'технологический', '[B]', 'Российская Федерация', '2017-12-01', ' ', 20, 80000, '<p>продвинутый пользователь, знание специализированных программ Word, Excel, IC &laquo;Галактика&raquo;. владение оборудованием неразрушающего контроля (РК; УК; МК; ММПМ)</p>', '<p>Личностные качества &ndash; честность, возможность принимать самостоятельно важные решения, устойчивость к стрессам, наблюдательность, умение найти подход к людям, умение держать себя в руках.</p>', 'Полная занятость', 'Да', '25bb8f20-0aeb-11e6-a218-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>аттестован на 2-й уровень по ренгеногаммаграфическому, ультразвуковому, визуальному и измерительному, магнитопорошковому, электрическому контролю методу контроля проникающими веществами и методу магнитной памяти металла. Обучен на дозиметриста, радиационную безопасность, обеспечение метрологического производства, контроль качества внешней изоляции, обращение с производственными отходами. Специалист сварочного производства 3-го уровня</p>'),
(6, 'f7cb8b66-3d62-11e6-ab49-736ab11edb0c', 16, NULL, 108, 'инженер по строительному контролю и сварке', '2017-08-27', 'технологический', '[B]', 'Российская Федерация', '2018-02-02', ' ', 19, 80000, '<p>продвинутый пользователь, знание специализированных программ Word, Excel, IC &laquo;Галактика&raquo;. владение оборудованием неразрушающего контроля (РК; УК; МК; ММПМ)</p>', '<p>честность, возможность принимать самостоятельно важные решения, устойчивость к стрессам, наблюдательность, умение найти подход к людям, умение держать себя в руках.</p>', 'Полная занятость', 'Да', '25bb8f20-0aeb-11e6-a218-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>аттестован на 2-й уровень по ренгеногаммаграфическому, ультразвуковому, визуальному и измерительному, магнитопорошковому, электрическому контролю методу контроля проникающими веществами и методу магнитной памяти металла. Обучен на дозиметриста, радиационную безопасность, обеспечение метрологического производства, контроль качества внешней изоляции, обращение с производственными отходами. Специалист сварочного производства 3-го уровня</p>'),
(7, '092786d8-3d67-11e6-ab49-736ab11edb0c', 16, NULL, 128, 'Инженер по сварке', '2017-07-05', 'технологический', '[B]', 'Российская Федерация', '2017-12-01', ' ', 19, 80000, '<p>продвинутый пользователь, знание специализированных программ Word, Excel, IC &laquo;Галактика&raquo;. владение оборудованием неразрушающего контроля (РК; УК; МК; ММПМ). знание современного сварочного производства и нормативной документации.</p>', '<p>честность, возможность принимать самостоятельно важные решения, устойчивость к стрессам, наблюдательность, умение найти подход к людям, умение держать себя в руках.</p>', 'Полная занятость', 'Да', '25bb8f20-0aeb-11e6-a218-4376a32b3f45', 'Готов к переобучению', '<p>Неоднократно совмещал свою работу с работой&nbsp;инженера по сварке в его отсутствии</p>', 'Готов к командировкам', '<p>&nbsp;аттестован на 2-й уровень по ренгеногаммаграфическому, ультразвуковому, визуальному и измерительному, магнитопорошковому, электрическому контролю методу контроля проникающими веществами и методу магнитной памяти металла. Обучен на дозиметриста, радиационную безопасность, обеспечение метрологического производства, контроль качества внешней изоляции, обращение с производственными отходами. Специалист сварочного производства 3-го уровня</p><p>&nbsp;</p>'),
