(17, '8d86581f-3b5c-11e5-b22a-9370902ea73e', 77, NULL, 100, 'Ассистент менеджера по персоналу', '2017-07-28', 'ЦО 1678', '[B]', 'Российская Федерация', '2015-08-11', ' ', 4, 30000, ' ', ' ', 'Полная занятость', ' ', 'd86dd110-3b56-11e5-b22a-9370902ea73e', 'Готов к переобучению', '<p>Горю желанием развиваться в сфере HR.</p><p>Учусь заочно по специальности Управление персоналом. Учусь на бюджете на 3 курсе в РГСУ(Российский государственный социальный университет).</p><p>Сессия 3 недели раз в полгода.</p><p>&nbsp;</p><p>В свободное время:</p><p>Тренируюсь в зале</p><p>Подрабатываю, в основном мелким ремонтом электроники.</p>', 'Готов к командировкам', ' '),
