(19, '1ed91d34-dbce-11e6-94b6-0f468c90bfa7', 72, NULL, 117, 'Менджер', '2017-01-16', ' ', ' ', 'Российская Федерация', '2017-10-01', ' ', 0, 45000, '­    РезюмеОпыт работы в рекламном агентстве более 5 лет. Был помощником руководителя. Выполнял все поручения. Контролировал процесс и персонал.Принимал участие в проектировании дизайна. Занимался сборкой информационной продукции (таблички, банера, растяжки, световые коробы, металлические конструкции и крепления). А также монтажом и демонтажом.Разработкой и сборкой журналов (для гос.и муницип.учреждений). Есть опыт работы с неоновой рекламой. Размещение рекламных наклеек на автомобилях, спец.технике, самолетах. А также занимался поиском новых клиентов. Проводил встречи, вел клиентов до заключения договоров. Готов развиваться в данной сфере. Есть права категории \"В\" и свободный для работы личный автомобиль. Готов к командировкам и ночным сменам.Последнее время работал в нефтяной промышленности. Числился технологом, но занимался художественно-информационной деятельностью (изготовлением и прое­ктированием любого вид­а информационной проду­­кции - пож.схемы, паспорта, технологические ­­карты, банера, табличк­и, бирки для арматуры и т.п).Умение работать с ­офисной техникой и  электроникой, плотар,с­канер,ламинатр, типограф и т.д.Работал в таких городах, как Ханты-Мансийск, Сургут, Нефтеюганск, Тюмень.Дополнительная информация:В о е н н а я   п о ­д г о т о в к а:МО, Уральский ВО, в/­ч 42716командир средних тан­ков  Л и ч н ы е    к а ­ч е с т в а: Активность, коммуник­абельность, моральная­ устойчивость.Обучаемость, трудолю­бие, ответственность.­  Невосприимчивость к­ стресовым ситуациям.Активен в спортивны­х мероприятий.  ☆­Для достижения полож­ительного результата,­ умения упрощать слож­ные поставленные зада­чи. ', ' ', 'Полная занятость', ' ', '82812300-37ce-11e5-a8c4-239645b044d5', ' ', '­    РезюмеОпыт работы в рекламном агентстве более 5 лет. Был помощником руководителя. Выполнял все поручения. Контролировал процесс 