(20, 'cc052336-6f7e-11e6-bef1-4376a32b3f45', 77, NULL, 127, 'юрист, спеицалист', '2017-02-17', 'юриспруденция', ' ', 'Российская Федерация', '2016-09-01', ' ', 0, 35000, '<p>опытный пользователь ПК, MS Office, консультант+, Гарант, навыки работы с офисной техникой.</p>', '<p>ответственность, коммуникабельность, внимательность, пунктуальность, честность, усидчивость, исполнительность, порядочность, устойчивость к стрессам, трудолюбивость</p>', 'Полная занятость', 'Нет', 'ac4640b0-6f79-11e6-bef1-4376a32b3f45', 'Готов к переобучению', ' ', ' ', ' '),
(21, 'bf4cb8d8-ad98-11e7-a988-ef76bd2a03c1', 77, NULL, 113, 'Химик-аналитик', '2017-10-10', 'Автоматизированных систем', '[B]', 'Российская Федерация', '2017-10-10', ' ', 4, 50000, '<p>Желаю развивать и совершенствовать полученные знания и опыт, полиглот, свободно общаюсь на английском языке и соблюдаю его грамматику. Обдуманно и сосредоточенно подхожу к решению задач.&nbsp;Всегда доброжелательна и честна, не притворяюсь другими людьми, приветлива и с чувством юмора. Уважаю личное пространство и ищу того же взамен.</p>', '<p>Я много читаю, путешествую, занимаюсь волонтерской деятельностью. Люблю чистоту, аккуратность и порядок, имею аналитическое и творческое мышление.&nbsp;</p>', 'Полная занятость', ' ', 'ff582ab0-ad95-11e7-a988-ef76bd2a03c1', ' ', ' ', 'Готов к командировкам', ' '),
