(30, '672a94be-0b16-11e8-ad4f-736ab11edb0c', 59, NULL, 112, 'консультант', '2018-02-06', 'АНО «Пермский открытый институт конверсии кадров»', ' ', 'Российская Федерация', '2018-02-06', ' ', 8, 28000, ' ', '<p><strong>- </strong>прогнозирование развития событий;</p><p>- принятие решений в условиях неопределенности;</p><p>- построение систем взаимодействия;</p><p>- выявление и предотвращение/исправление системных ошибок.</p>', 'Полная занятость', ' ', '09a32cc0-ff1e-11e7-9855-0f468c90bfa7', 'Готов к переобучению', '<p>Увлечения: айкидо, горы.</p>', ' ', '<p>- референт государственной гражданской службы Пермского края 1 класса;</p><p>- включен в кадровый резерв Министерства промышленности, предпринимательства и торговли Пермского края на ведущую группу должностей категории &laquo;Руководители&raquo; (письмо № СЭД-03-01-12-305 от 22.08.2016);</p><p>- включен в кадровый резерв Администрации губернатора Пермского края на ведущую группу должностей категории &laquo;Специалисты&raquo; (письмо № СЭД-01-77-37/25 от 12.07.2016).</p>'),
