(60, 'e8ec96ed-0ffa-11e8-b17c-037acc02728d', 61, NULL, 100, 'Специалист по кадрам, бухгалтер - кассир', '2018-02-12', 'Сельскохозяйственные машины', '[B]', 'Российская Федерация', '2018-02-12', ' ', 25, 30000, '<ul><li>навыки работы с программными продуктами в 1С: Предприятие &ndash; 1С 8.3; Управление торговлей 1С 8.3;</li><li>умение вести кадровый учет с применением программы 1С: Зарплата Управление персоналом 8.3.;</li><li>работа с денежной наличностью;</li><li>ведение кассовых операций;</li><li>знание структуры бизнес - плана и умение разрабатывать бизнес <strong>&ndash;</strong> план с&nbsp;помощью программы Project Expert 7;</li><li>знание методов экономического анализа коммерческой организации и&nbsp;умение проводить анализ с помощью программы &laquo;Финансовый аналитик&raquo;;</li><li>знание налоговой системы РФ, специальных режимов налогообложения, умение оптимизировать систему налогообложения конкретной организацией;</li><li>умение заполнять налоговые декларации;</li><li>знание и умение применять современные информационные технологии сборов, накопления и систематизации информации для принятия управленческих решений;</li><li>знание современных систем управления коммерческой организацией и&nbsp;умение выполнять управленческие функции в коммерческой организации (планирование, организация и контроль);</li><li>знание основ правового регулирования деятельности коммерческих организаций и требований экономической безопасности.</li></ul>', '<p>ответственность, порядочность, аккуратность, внимательность, усидчивость, легко обучаемая, умение работать с большими объемами информации.</p>', 'Полная занятость', 'Нет', '12352a20-0fed-11e8-b17c-037acc02728d', 'Готов к переобучению', '<ul><li>владение компьютером на уровне уверенного пользователя (работа в различных конфигурациях программы 1С; Финансовый аналитик; Налогоплательщик ЮЛ; СУФД online;&nbsp; программы Microsoft Word; Microsoft Excel &ndash; построение диаграмм, сводных таблиц; PowerPoint &ndash; создание электронных презентаций;&nbsp; ) .</li><li>опыт работы с оргтехникой (ксерокс, факс, принтер).</li></ul>', 'Готов к командировкам', ' '),
