(65, '096ea7bc-9d54-11e7-b7a1-ef76bd2a03c1', 77, NULL, 112, 'Специалист', '2017-09-19', 'Лингвистики', '[B]', 'Российская Федерация', '2017-09-20', ' ', 3, 25000, '<p>Целеустремлена, легко и быстро обучаема, пунктуальна, обладаю высокой стрессоустойчивостью.&nbsp;Мною проводилось обучение и адаптация в коллективе новых сотрудников, а также курирование стажеров, направленных на&nbsp;прохождение практики.&nbsp;Внимательно отслеживала сроки сдачи документации. На время&nbsp;отсутствия руководителя выполняла его работу: посещала&nbsp;совещания, вела полную отчетность по офису (мониторинги,&nbsp;укомплектованность техникой и ее состояние, наличие бытовых&nbsp;принадлежностей для офиса).&nbsp;</p>', '<p>Доброжелательна и ответственна, обладаю гибким мышлением, что помогает легко создавать и поддерживать контакты с людьми. Объективно оцениваю свои силы и возможности, принимаю самостоятельные решения и несу за них ответственность.</p>', 'Полная занятость', ' ', 'ec3c9520-9d4f-11e7-b7a1-ef76bd2a03c1', 'Готов к переобучению', '<p>Проводила экскурсию по Москве и московскому метро для немецких туристов. Участвовала в постановке детского спектакля на иностранном языке.</p>', 'Готов к командировкам', ' '),
