(71, 'ee8f0f36-4f5b-11e6-b83f-736ab11edb0c', 64, NULL, 109, 'директор ( зам. директора )  Готов обсуждать  все вакансии', '2016-10-13', 'МУЦ Министерства труда Соц. развития Сар. области, г. Балаково', '[B, C]', 'Российская Федерация', '2017-10-18', ' ', 28, 40000, '<p>&nbsp;Руководитель</p><p>Умею работать в команде&nbsp;</p><p>Опыт работы Государственной и Муниципальной работы есть.</p><p>Опыт ведения переговоров на уровне первых лиц есть.</p><p>Обладаю организаторскими способностями.</p><p>Могу провести аудит по условиям труда в организациях.</p><p>&nbsp;</p>', '<p>Порядочность в работе, коммуникабельность, внимательность к порученному делу.</p><p>Ответственность, целеустремленность, способность к обучению.</p><p>Способность оперативно реагировать и принимать правильные решения в сложной обстановке.</p><p>&nbsp;</p>', 'Полная занятость', 'Да', 'c54149a0-4f5a-11e6-b83f-736ab11edb0c', 'Готов к переобучению', '<p><span style=\"text-decoration: underline;\">&nbsp;</span></p><p><strong>&nbsp;</strong></p>', 'Готов к командировкам', '<p><strong>Классный чин (квалификационный разряд, </strong>Младший муниципальный советник 2 &ndash;класса от 14.05.2002г. Референт государственной и гражданской службы РФ 3 класса. Приказ Рос труда от 19.12.2006 № 11990- рк, Присвоен классный чин Советник государственной гражданской службы РФ 3 &ndash;класса .Приказ Рос труда от 30.04.09г</p><p>Грамоты за труд</p><p>Губернатора Саратовской обл.</p><p>-Уполномоченного по правам человека&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; в Саратовской обл.</p><p>-Руководителя ГИТ в Саратовской обл.</p><p>-Главы администрации</p>'),
