(81, '781c3ca4-7bbd-11e5-b25e-0163a9ae3d01', 78, NULL, 112, 'Специалист отдела мониторинга и развития', '2017-07-27', 'гуманитарный', ' ', 'Российская Федерация', '2015-10-27', ' ', 8, 30000, '<p>активность, стресcоустойчивость, ориентация на результат, коммуникабельность.</p>', '<p>Общительна и вежлива в общении с людьми, неконфликтна, ответственно отношусь к выполнению должностных обязанностей. Умею работать с большим объемом информации, ответственно подхожу к каждому делу, есть желание работать и получать новый опыт.</p>', 'Полная занятость', ' ', 'bd7ddd60-7a6b-11e5-b17c-239645b044d5', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(82, '1ea1ce2b-e943-11e6-8228-736ab11edb0c', 74, NULL, 111, 'Техник', '2017-02-02', 'Информационные технологии', ' ', 'Российская Федерация', '2017-02-08', ' ', 20, 20000, '<p>Уверенный пользователь ПК, навыки межличностного делового общения, творческий подход к рабочему процессу.</p>', '<p>- высокая работоспособность;</p><p>- коммуникабельность;</p><p>- желание работать с людьми;</p><p>- целеустремленность;</p><p>- стрессоустойчивость;</p><p>- многофункциональность.</p>', 'Полная занятость', ' ', 'a147c6b0-b87c-11e6-9346-736ab11edb0c', ' ', ' ', ' ', ' '),
(83, '959fb749-cc15-11e5-9f53-0163a9ae3d01', 77, NULL, 112, 'Помощник юриста', '2018-02-15', 'Юридический', '[B, C]', 'Российская Федерация', '2016-02-11', ' ', 1, 20000, '<p>Грамотная устная и письменная речь, знание общих правил делового письма, опытный пользователь MS Office&nbsp;(Консультант плюс, Гарант). Работа с&nbsp;нормативно-правовыми документами. Проверка документов на&nbsp;соответствие законодательству РФ.</p><p>&nbsp;</p>', '<p>Коммуникабельность, стрессоустойчивость,&nbsp;внимательность, ответственность, аккуратность, нацеленность на результат, исполнительность,</p><p>Веду здоровый и активный образ жизни, без вредных привычек.&nbsp;Заинтересована в работе на долгосрочную перспективу</p>', 'Полная занятость', 'Нет', '62563550-cc13-11e5-9f53-0163a9ae3d01', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Военный билет. Признан ограниченно годным к военной службе \"В\". Воинское звание - Рядовой.</p>'),
(84, '3de9454a-c425-11e5-b14c-239645b044d5', 91, NULL, 128, 'слесарь по ремонту автомобилей', '2017-07-05', 'Техническое училище № 2 г. Смиленск', '[B]', 'Российская Федерация', '2016-01-27', ' ', 3, 60000, '<p>добросовестный, трудолюбив</p>', '<p>ответственный</p>', 'Полная занятость', 'Да', '96e461f0-c422-11e5-b14c-239645b044d5', 'Готов к переобучению', '<p>мастер спорта по боксу</p>', 'Готов к командировкам', '<p>удостоверение \"стернового-моториста\"от 2004г.</p>'),
(85, '04e41c56-058f-11e7-a179-4376a32b3f45', 78, NULL, 127, 'Помощник юриста', '2017-03-10', 'Юридический', '[B]', 'Российская Федерация', '2017-03-10', ' ', 0, 15000, ' ', '<p>Активность, трудолюбивость, мобильность,пунктуальность, ответственность</p>', 'Полная занятость', 'Нет', '8b5f4540-ede1-11e6-8f09-4376a32b3f45', 'Готов к переобучению', '<p>Проиходила производственную практику в Балтийской таможни</p>', 'Не готов к командировкам', ' '),
(86, '075371eb-a5f1-11e7-8442-ef76bd2a03c1', 2, NULL, 108, 'электромонтер', '2017-09-30', 'Электроэнергетический', '[B]', 'Российская Федерация', '2017-09-30', ' ', 0, 60000, '<p>Компьютером, оргтехникой и программным обеспечением владею на уровне уверенного пользователя.</p>', '<p>Военный билет имеется.</p><p>В 2011 году присвоено звание кандидата в мастера спорта России по настольному теннису.</p><p>Награжден многочисленными грамотами муниципального и республиканского уровней по настольному теннису, шахматам, шашкам, футболу.</p><p>Энергичен, организован, коммуникабелен, требователен к себе и другим.</p>', 'Полная занятость', 'Да', '4c764120-a5ed-11e7-8442-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(87, '3e74e420-780f-11e7-b350-ef76bd2a03c1', 72, NULL, 126, 'Бухгалтер', '2017-08-03', 'Экономический', '[B]', 'Российская Федерация', '2017-08-03', ' ', 13, 20000, ' ', '<p>Высокая работоспособность, внимательность, стрессоустойчивость, ответственность, усидчивость, самоорганизованность; Уверенный пользователь ПК,</p><p>знания основ БУ, знания 1С., умение работать в Excel, Word, Outlook, Контур, информационной базе Гарант, Консультант.</p>', 'Полная занятость', 'Нет', '5e455b30-7806-11e7-b350-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(88, '55365cb5-bbf0-11e6-ae50-4376a32b3f45', 61, NULL, 128, 'экономист', '2016-12-06', 'СОШ 19/20', '[B, C]', 'Российская Федерация', '2017-05-18', ' ', 12, 55000, '<p>уверенный пользователь ПК (как пример: с 0 рабочее место тендерного трейдера),</p><p>офисные программы MS Word, Excel, PowerBI, Power Point</p><p>1С 8 УПП; 1С ЗУП 3.0 ;</p><p>активно пользуюсь работающими базами данных и создаю свои MS Access</p><p>укрепил и расширил знания технической документации: ГОСТ, ТУ, чертежи КЖИ и др. (вадею на уровне среднего специалиста ПТО);</p><p>развиваю управленческие навыки, что позволяет, с места рядового сотрудника или сотрудника среднего звена или руководителя, видеть полноту сложившейся (складывающейся) ситуации;</p><p>Профтест _ Университет СИНЕРГИЯ:&nbsp;http://synergy.ru/proftest?result=121845#</p>', '<p>предыдущий опыт научил быстро ориентироваться в ситуации, анализировать её и принимать решения</p><p>высоко мотивирован, т.к. работа и есть мотиватор - ранее это называли \"трудоголик\"</p><p>готов обучаться новому, передовому и предать свой опыт:</p><p>- в настоящее время заканчиваю обучение в Школе руководителя (ИБДА РАНХиГС),</p><p>- с 1 февраля 2017 - повышение квалификаци&nbsp;в Школе финансового директора (iMA)</p><p>развил способность преодолевать трудности и выходить из \"зоны комфорта\"</p><p>английский язык - регулярно учу</p><p>хобби - велосипед</p>', 'Полная занятость', 'Да', '2db4b380-9ec2-11e6-af05-0f468c90bfa7', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>военный билет АК 1073541</p><p>Сертификат</p><p>№ ШР-196234, выдан 13 февраля 2017 (http://school.gd.ru/Certificate.aspx?id=af79db8e-08dc-479c-a08c-5a6928c8939e)</p>'),
(89, '7c27fc9e-c6e3-11e6-8872-ef76bd2a03c1', 61, NULL, 97, 'начальник отдела маркетинга / продаж / сбыта', '2016-12-20', 'СОШ 19/20', '[B, C]', 'Российская Федерация', '2017-02-14', ' ', 12, 35000, '<p>уверенный пользователь ПК (как пример: с 0 рабочее место тендерного трейдера),</p><p>офисные программы MS Word, Excel, PowerBI, Power Point</p><p>1С 8 УПП; 1С ЗУП 3.0 ;</p><p>активно пользуюсь работающими базами данных и создаю свои MS Access</p><p>укрепил и расширил знания технической документации: ГОСТ, ТУ, чертежи КЖИ и др. (вадею на уровне среднего специалиста ПТО);</p><p>развиваю управленческие навыки, что позволяет, с места рядового сотрудника или сотрудника среднего звена или руководителя, видеть полноту сложившейся (складывающейся) ситуации;</p><p>Профтест _ Университет СИНЕРГИЯ:&nbsp;http://synergy.ru/proftest?result=121845#</p>', '<p>предыдущий опыт научил быстро ориентироваться в ситуации, анализировать её и принимать решения</p><p>высоко мотивирован, т.к. работа и есть мотиватор - ранее это называли \"трудоголик\"</p><p>готов обучаться новому, передовому и предать свой опыт: в настоящее время заканчиваю обучение в Школе руководителя (ИБДА РАНХиГС), а также изучаю 1С ЗУП 3.0 и 1С бух 8.3 (profbuh8.ru); с 1 февраля 2017 начинаю обучение в Школе финансового директора (iMA)</p><p>развил способность преодолевать трудности и выходить из \"зоны комфорта\"</p><p>английский язык - регулярно учу</p><p>&nbsp;хобби - велосипед</p>', 'Полная занятость', 'Да', '2db4b380-9ec2-11e6-af05-0f468c90bfa7', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>военный билет АК 1073541</p><p>Сертификат</p><span class=\"vidan_g\">№ ШР-196234, выдан 13 февраля 2017 (http://school.gd.ru/Certificate.aspx?id=af79db8e-08dc-479c-a08c-5a6928c8939e)</span>'),
