(102, 'c907ad06-d7a4-11e5-8143-7de68f1c536d', 77, NULL, 105, 'Начальник охраны', '2017-08-06', 'Международный юридический институт при Министерстве Юстиции РФ', '[B]', 'Российская Федерация', '2017-12-01', ' ', 22, 40000, '<p>Стрессоустойчивость.&nbsp;</p><p>Умение работать в коллективе.&nbsp;Способность к обучению.&nbsp;Уверенный пользователь ПК. (MS office, техническое и системное обслуживание ПК). &nbsp;Водительское удостоверение категории В, наличие личного автомобиля</p>', ' ', 'Полная занятость', 'Нет', '582e7970-d7a3-11e5-8143-7de68f1c536d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(103, 'c5c7e146-e50b-11e5-85ae-037acc02728d', 77, NULL, 127, 'Помощник юриста', '2017-08-04', 'Гражданское право', '[B]', 'Российская Федерация', '2017-12-01', ' ', 22, 30000, ' ', '<p>Стрессоустойчивость.&nbsp;Умение работать в коллективе.&nbsp;Способность к обучению.&nbsp;Уверенный пользователь ПК. (MS office, техническое и системное обслуживание ПК).</p>', 'Полная занятость', 'Нет', '582e7970-d7a3-11e5-8143-7de68f1c536d', 'Готов к переобучению', '<p>После завершения карьеры по линии МВД стремлюсь заниматься интересным делом в соответствии с квалификацией.</p>', 'Готов к командировкам', ' '),
(104, 'a7df67f9-9850-11e5-b140-0163a9ae3d01', 71, NULL, 126, 'Секретарь, помощник руководителя', '2016-10-13', 'ФГБОУ ВПО \"ТГПУ им. Л.Н. Толстого\"', ' ', 'Российская Федерация', '2018-01-23', ' ', 3, 23000, '<p>Грамотная, решительная, целеустремленная, легко обучаемая, имею организаторские способности, многозадачность на высоком уровне, умею расставлять приоритеты в рабочем процессе, аккуратна и внимательна в работе с документами, эффективна в командной работе</p>', '<p>Ответственная, пунктуальная, стрессоустойчивая, неконфликтная, тактичная, коммуникабельная</p>', 'Полная занятость', 'Да', '15430420-984f-11e5-b140-0163a9ae3d01', 'Готов к переобучению', '<p>Тактична в профессиональных взаимоотношениях с людьми. Проявляю внимательность и скрупулезность при работе с документами. Имею ответственный подход к трудовому процессу, креативная, доброжелательная, неконфликтная, веду здоровый образ жизни. Умею вести деловую переписку , составлять деловые письма. Способна анализировать,изучать и оптимизировать рабочий процесс, а также эффективно расставлять приоритеты. Свободно владею офисной техникой и компьютером, а также основными компьютерными программами (Word, Excel, Power Paint, Outlook). Всегда готова к обучению, повышению квалификации и развитию профессиональных навыков. Свободно ориентируюсь в больших потоках информации, а также систематизирую и классифицирую её. &nbsp;Могу успешно осуществлять планирование и руководство. Имею опыт в организации культурных &nbsp;массовых мероприятий.</p>', 'Готов к командировкам', ' '),
(105, 'f673cce9-ebbd-11e7-a184-9122a281f90e', 38, NULL, 112, 'Менеджер, секретарь', '2017-12-28', 'Бизнес и управление', '[B]', 'Российская Федерация', '2017-12-29', ' ', 0, 15000, 'Коммуникабельная', 'Общительная, стрессоустойчивая', 'Полная занятость', ' ', '46e0c290-eb9c-11e7-86b0-037acc02728d', 'Готов к переобучению', ' ', ' ', ' '),
