(112, 'c4ee8828-41f1-11e7-9948-037acc02728d', 72, NULL, 126, 'специалист по работе с клиентами, бухгалтер-кассир, оператор', '2017-05-26', 'Бухгалтерский учет, анализ, аудит', ' ', 'Российская Федерация', '2017-09-01', ' ', 4, 20000, '<p>Знаю офисные программы, легко обучаюсь, уверенно владею ПК и офисной техникой.</p>', '<p>Внимательность, ответственность, аккуратность, коммуникабельность</p>', 'Полная занятость', ' ', '3741c7e0-bf8d-11e5-9eda-0163a9ae3d01', ' ', ' ', ' ', ' '),
