(114, '8df0aff3-8e92-11e7-9696-4376a32b3f45', 26, NULL, 125, 'Преподаватель физической культуры', '2017-09-01', 'ДОУ', '[B]', 'Российская Федерация', '2017-09-04', ' ', 4, 30000, '<p>-Кандидат в мастера спорта по армейскому рукопашному бою;</p><p>- призер республиканских соревнований по Тхэквондо &laquo;ИТФ&raquo;, &laquo;ГТФ&raquo;;</p><p>- призер городских соревнований по Воздушному Эквилибру;</p><p>- имеют опыт преподавания современных, народных и национальных танцев (цыганские, кавказские, восточные, танец живота), так же ЛФК, стретчинг, аэробики,&nbsp; и других фитнесс программ.&nbsp;</p>', '<p>Деловые качества: &nbsp;&nbsp;&nbsp; <strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Способность к принятию решений, требовательность к себе и к окружающим, стремление к организации четкого и сбалансированного рабочего процесса.</p><p>&nbsp;Личные качества: &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Активный образ жизни, дисциплинированность коммуникабельность, пунктуальность и организованность. Обучаемость, саморазвитие, амбициозность и стрессоустойчивость.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'Полная занятость', 'Да', '6e2a6f20-529c-11e7-9a55-037acc02728d', 'Готов к переобучению', '<p>Как преподаватель физической культуры:</p><p>-умение планировать&sbquo; организовывать групповые и индивидуальные занятия;</p><p>-владение методикой преподавания волейбола&sbquo; баскетбола&sbquo; футбола, легкой атлетики&sbquo; гимнастики&sbquo; лыжной подготовки;</p><p>- умение работать со школьниками и студентами, относящимися к специальным медицинским группам;</p><p>-организация спортивно-массовых мероприятий.&nbsp; - Знание педагогики и психологии;&nbsp; - Умение работать в команде;&nbsp; - Индивидуальный подход к ученикам;&nbsp; - Знание основ спортивной медицины; - Использование современных методик проведений физкультурно-оздоровительной работы;</p>', 'Готов к командировкам', ' '),
(115, 'b3092d1d-3535-11e5-b22a-9370902ea73e', 11, NULL, 112, 'специалист', '2017-06-15', '«Санкт-Петербургский государственный университет сервиса и экономики»', ' ', 'Российская Федерация', '2015-07-29', ' ', 5, 22000, ' ', '<p>Настойчивость в достижении требуемых результатов, способность работать в высоком темпе, стрессоустойчивость, исполнительность, легкообучаемость, ответственность, дисциплинированность, пунктуальность, ориентированность на развитие.</p>', 'Полная занятость', ' ', '642f3340-3532-11e5-b22a-9370902ea73e', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(116, 'b5cb04cb-b331-11e7-8d40-736ab11edb0c', 65, NULL, 112, 'Начальник отдела', '2017-10-17', 'Механико-радиотехнический', '[B]', 'Российская Федерация', '2017-12-08', ' ', 6, 60000, '<p>Опыт руководства коллективом.</p><p>Владение компьютером: уверенный пользователь. Знание офисных программ MS Office (Exсel, Word), работа в интернете в различных браузерах (Opera, Internet Explorer, Mozilla Firefox), работа с электронной почтой (Outlook Express).</p>', '<p>Ответственность, инициативность, целеустремленность.</p>', 'Полная занятость', ' ', 'd3110df0-982d-11e7-b169-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
