(119, '222d48a4-9d01-11e6-89b1-736ab11edb0c', 56, NULL, 123, 'Инженер - технолог', '2016-10-28', 'Аэрокосмический', '[B]', 'Российская Федерация', '2016-10-28', ' ', 6, 20000, '<p>Умение читать и создавать чертежи, навыки работы с измерительным инструментом, умение разрабатывать техноогический процесс и технологические карты.</p>', '<p>Ответсвенная, комуникабельная, общительная, целеустремнленная, готова к обучению.</p>', 'Полная занятость', 'Нет', 'a3ab0f80-9cfb-11e6-89b1-736ab11edb0c', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
