(123, 'b42c9cb7-7961-11e6-a940-4376a32b3f45', 42, NULL, 126, 'секретарь', '2017-02-09', 'Экономический', ' ', 'Российская Федерация', '2017-02-09', ' ', 12, 15000, ' ', '<p>Уверенный пользователь ПК; знание программ 1С Бухгалтерия; владение оргтехникой и средствами связи: принтер,ксерокс,факс,телефон; знание делового этикета,делопроизводства; умение работать с большим объемом информации.</p><p>Ответственная, работоспособная, инициативная, общительная, спосона к быстрому обучению, направленна на результат, исполнительна, пунктуальна, стремлюсь к профессиональному росту, умение работать в команде.</p>', 'Полная занятость', 'Нет', '4fc954a0-795e-11e6-a940-4376a32b3f45', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(124, '00033d1c-7594-11e5-8f00-833b590698f7', 24, NULL, 105, 'Начальник отдела охраны труда/специалист по ОТиПб', '2017-05-12', 'МТД', ' ', 'Российская Федерация', '2018-01-22', ' ', 5, 35000, ' ', '<p>Аналитические способности; инициативность; коммуникабельность; креативность; лидерство;логическое мышление; мотивация; напористость; находчивость; оптимизм; организаторские способности; отзывчивость; ответственность; решительность; смелость; способность к риску;способность к самостоятельному принятию решений; стратегическое мышление; стремление к нововведениям; стремление к самореализации и успеху; стрессоустойчивость; требовательность;уверенность в себе; целеустремленность; энергичность; эрудиция; последовательность действий.</p>', 'Полная занятость', 'Да', '4571ecf0-7591-11e5-8f00-833b590698f7', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
