(129, 'e974b649-07d8-11e7-b313-4376a32b3f45', 50, NULL, 125, 'Зам .директора школы по безопасности', '2017-03-13', '«Военная академия Ракетных войск стратегического назначения имени Петра Великого» Министерства обороны Российской Федерации', ' ', 'Российская Федерация', '2017-03-13', ' ', 25, 60000, ' ', ' ', 'Полная занятость', 'Нет', '40032340-07d7-11e7-b313-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(130, '7e12b2b0-3518-11e5-b22a-9370902ea73e', 77, NULL, 128, 'Инженер-технолог машиностроительного профиля', '2018-02-15', '«Тюменский государственный нефтегазовый университет» (ТюмГНГУ)', '[B]', 'Российская Федерация', '2015-07-28', ' ', 0, 20000, ' ', ' ', 'Полная занятость', ' ', '0dea96d0-343f-11e5-b22a-9370902ea73e', 'Готов к переобучению', ' ', ' ', ' '),
(131, '9e662650-3518-11e5-b22a-9370902ea73e', 77, NULL, 128, 'Станочник широкого профиля', '2017-01-11', '«Тюменский государственный нефтегазовый университет» (ТюмГНГУ)', '[B]', 'Российская Федерация', '2015-07-28', ' ', 0, 20000, ' ', ' ', 'Полная занятость', ' ', '0dea96d0-343f-11e5-b22a-9370902ea73e', 'Готов к переобучению', ' ', ' ', ' '),
(132, '6cbd87fb-6858-11e6-b094-037acc02728d', 34, NULL, 125, 'Секретарь', '2017-06-22', 'Общеюридический', '[B]', 'Российская Федерация', '2016-08-22', ' ', 5, 10000, '<p>Ответственная,легкообучаемая, доброжелательная, стрессоустойчивая, коммуникабельная, пунктуальная. Стремлюсь повысить свои навыки и знания.</p>', '<p>Легко и быстро нахожу общий язык с людьми. Усидчивость - мое призвание!&nbsp;<strong>За время работы в разных организациях поняла, что мое призвание &laquo;работа с документами&raquo;. В этой сфере работаю с удовольствием и стараюсь полностью отдать себя.</strong></p>', 'Полная занятость', 'Нет', 'd3c55cc0-6853-11e6-b094-037acc02728d', 'Готов к переобучению', '<p>Хорошо владею многими компьютерными программами такими как: Photoshope, MS Office, Abbyy FineReader, Photolab, Nero, Skype, Outlook, Notes Lotus, Visio, Solar Winds (прогр. для работы со схемами). Готова к освоению новых программ. Машинопись 200 уд/мин.. Офисное оборудование (принтер, сканер, плоттер, ламинатор, сшиватель, факс, копировальные аппараты), работа в Интернете, электронная почта.</p>', 'Готов к командировкам', ' '),
(133, 'a1a40168-28d3-11e7-bdb6-037acc02728d', 66, NULL, 121, 'Специалист информационных технологий', '2017-04-24', '«Уральский государственный технический университет - УПИ имени первого Президента России Б.Н.Ельцина»', '[B]', 'Российская Федерация', '2017-04-24', ' ', 24, 25000, '<p>отличаюсь комплекстным подходом к рассмотрению ситуации, способен &nbsp;к &nbsp;самообучению, оцениваю свой труд строже, чем другие, умею работать в команде, действую по плану, умею управлять временем.&nbsp;</p>', '<p>обучаемость, вежливость, надежность. неконфликтность. оптимизм.&nbsp;</p>', 'Полная занятость', 'Нет', '7bbbbfe0-28d0-11e7-bdb6-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(134, '1c945370-28d4-11e7-bdb6-037acc02728d', 66, NULL, 121, 'Программист', '2017-04-24', '«Уральский государственный технический университет - УПИ имени первого Президента России Б.Н.Ельцина»', '[B]', 'Российская Федерация', '2017-04-24', ' ', 24, 25000, '<p>отличаюсь комплекстным подходом к рассмотрению ситуации, способен &nbsp;к &nbsp;самообучению, оцениваю свой труд строже, чем другие, умею работать в команде, действую по плану, умею управлять временем.&nbsp;</p>', '<p>обучаемость, вежливость, надежность. неконфликтность. оптимизм.&nbsp;</p>', 'Полная занятость', 'Нет', '7bbbbfe0-28d0-11e7-bdb6-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(135, '7c45a0e6-956d-11e5-b140-0163a9ae3d01', 24, NULL, 97, 'оператор электронно-вычислительных машин', '2017-06-28', ' ', ' ', 'Российская Федерация', '2015-11-28', ' ', 0, 18000, ' ', ' ', 'Полная занятость', 'Нет', '40ee2420-91cd-11e5-9eaf-239645b044d5', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(136, 'c54dc3e3-bfa0-11e7-8db2-e37b4be0b9ed', 63, NULL, 109, 'Заместитель генерального директора по правовым вопросам/Руководитель юридической службы', '2017-11-02', 'Юридический', '[B]', 'Российская Федерация', '2017-11-02', ' ', 16, 150000, '<p>- ведение переговоров на различных уровнях; - ведение дел в арбитражных судах и судах общей юрисдикции; - комплекс работ по юридическому сопровождению деятельности организации: гражданское, трудовое, корпоративное право, внешнеэкономическая деятельность, таможенное право, земельное, налоговое и административное законодательство; - разработка и бюджетирование новых проектов (start-up), систематизация деятельности, постановка целей и задач; - разработка и введение нормативно-методологических документов.</p>', '<p>- управленческие навыки, аналитический склад ума, работоспособность, добропорядочность, организованность; - умение ставить цели и расставлять приоритеты; _умение работать в команде, в режиме многозадачности;&nbsp; - опытный пользователь: офисные приложения (М.Word, Exel, Visio, PowerPoint), Правовые системы &laquo;Гарант&raquo;, &laquo;Консультант +&raquo;, &laquo;Кодекс&raquo;, 1С: Предприятие.</p>', 'Полная занятость', 'Да', '321bf5b0-bf0e-11e7-a133-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(137, 'a6d7fc9d-0b1d-11e8-ad4f-736ab11edb0c', 66, NULL, 99, 'Бухгалтер', '2018-02-06', 'Экономика труда', ' ', 'Российская Федерация', '2018-02-06', ' ', 8, 15000, '<p>Знание положений и инструкций ЦБ РФ, увереный пользователь ПК, навыки проведения инвентаризации, быстрое принятие верного решения, преодоление возможных препятствий, проведение экономического анализа на основании больших объемов данных.</p>', '<p>Ответственность, исполнительность, усидчивость, лояльность, энергичность, обучаемость, аккуратность, скрупулезность, ответственность, пунктуальность, внимательность к мелочам.</p>', 'Полная занятость', ' ', '7730f290-0b17-11e8-ad4f-736ab11edb0c', 'Готов к переобучению', '<p>Не курю, прав нет.</p>', 'Готов к командировкам', '<p>Сертификаты о прохождении обучения тренингов на тему \"Эффективное управление\"&nbsp;</p>'),
(138, 'aafae1e8-f3dd-11e7-9855-0f468c90bfa7', 50, NULL, 128, 'Технолог, помощник технолога, инженер-химик', '2018-01-07', 'Институт иновационных технологий и биоиндустрии продуктов питания', ' ', 'Российская Федерация', '2018-02-12', ' ', 0, 50000, ' ', '<p>Ответственность, пунктуальность, трудолюбие</p>', 'Полная занятость', 'Нет', '26d1f1d0-f3db-11e7-a184-9122a281f90e', ' ', '<p>В настоящее время я учусь в магистратуре МГУПП (очное отделение). В связи с чем ищу работу со сменным графиком. Диплом бакалавра (МГУПП, 2017) - технология производства продуктов из растительного сырья ( кафедра технологии сахаристых, бродильных производств, виноделие). Магистратура (год окончания 2019) - высокотехнологичные производства пищевых продуктов функционального и специализированного назначения.</p>', ' ', ' '),
(139, '33ffddea-79ca-11e6-8eb1-037acc02728d', 70, NULL, 110, 'Оператор по добыче нефти и газа', '2017-08-17', 'Томский политехнический техникум', '[B]', 'Российская Федерация', '2016-09-14', ' ', 0, 15000, ' ', '<p><strong>Дисциплинирован, ответственный, умение работать в команде, целеустремлен, коммуникабельный</strong></p>', 'Полная занятость', 'Нет', 'a8affc50-79c6-11e6-8eb1-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Эффективное поведение на рынке труда, выдана 30.04.2016 регистрационный №15/16 от 30.04.2016</p><p>&nbsp;</p>'),
(140, '93997c00-d3e1-11e5-80c3-55093e4ed5e1', 21, NULL, 99, 'Бухгалтер, Экономист', '2017-07-14', 'Экономический', '[B]', 'Российская Федерация', '2016-02-16', ' ', 0, 15000, ' ', ' ', 'Полная занятость', ' ', '4c36a170-d3dd-11e5-80c3-55093e4ed5e1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(141, 'a5f74ff6-d613-11e6-8441-4376a32b3f45', 78, NULL, 128, 'Слесарь', '2017-01-09', 'СПб ГБ ПОУ ЭМТ жд транс. им. А.С. Суханова', ' ', 'Российская Федерация', '2017-01-09', ' ', 0, 38000, ' ', ' ', 'Полная занятость', ' ', '4358d770-d612-11e6-8441-4376a32b3f45', ' ', ' ', ' ', ' '),
(142, 'b1eaaf39-dc0a-11e6-bd4f-ef76bd2a03c1', 77, NULL, 108, 'Специалист входного контроля', '2017-01-16', 'Экономика и управление', '[B, C]', 'Российская Федерация', '2018-01-01', ' ', 4, 50000, '<p>- знание технологий складского хозяйства;- навыки организации учёта, складирования и отпуска ТМЦ;- опыт проведения и прохождения инвентаризаций;- знание товарно-сопроводительных документов;- навыки работы с терминалом сбора данных;- опыт работы с системой адресного хранения;- знание правил погрузки и выгрузки товаров, их расстановки и укладки на складе, а также правил обращения с товаром в зависимости от его категории;- опыт работы на складе с большой номенклатурой;- уверенный пользователь ПК, отличные знания MS Office, 1C.- аккуратный, ответственный.</p>', '<p>Интересы: путешествия, занятия спортом, отдых с семьей.Веду активный и здоровый образ жизни, изучаю английский язык.Честный, открытый, оптимистичный, обладаю аналитическим мышлением.Стремлюсь к дальнейшему профессиональному развитию в области складской логистики. Готов к новым интересным проектам и задачам, к работе, связанной с командировками. Нравится открывать для себя новые города и знакомства с профессионалами своего дела: это все вызывает позитивный настрой и плодотворные результаты работы.</p>', 'Полная занятость', 'Да', 'db519450-dc06-11e6-bd4f-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(143, '688d1480-7a65-11e5-b25e-0163a9ae3d01', 77, NULL, 121, 'Инженер', '2016-11-23', '«Кемеровский государственный университет»', '[B]', 'Российская Федерация', '2015-10-25', ' ', 11, 80000, '<p>Организаторские способности, активная жизненная позиция, знание делового этикета и дипломатичность, ответственность, способность выполнять работу в срок, стрессоустойчивость.</p>', '<p>Работа с проектной документацией, схемами, чертежами и документацией заводов-изготовителей.</p><p>Наладка КИПиА оборудования и эксплуатация.</p><p>На уровне программиста: владение ПК; 1С7.7, 1С8.х, SQL (под 1С 7.7, 1С8.х), компьютерная сеть и сетевое оборудование, Сервер 2003, сервер 2008, настройка видеосервера, видеонаблюдение (CCTV), контроль доступа (СКУД), беспроводная связь до 100 км, радиолинейка, навигация и контроль автотранспорта (наряд заказ, ГСМ, путевые листы),&nbsp; KerioWinRouteFirewall, KerioConnect (почтовый сервер), программный комплекс Directum.</p><p>Руководство и управление персоналом по всей территории России (интернациональный коллектив).</p><p>Составление консолидированной отчетности.</p><p>Знание бухгалтерской документации, отчетности;</p><p>Ведение переговоров, заключение договоров;</p><p>Деловая переписка;</p><p>Развитие направления деятельности от функции до отдела.</p>', 'Полная занятость', ' ', '9bd4f0f0-7970-11e5-b25e-0163a9ae3d01', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(144, '8ca321bb-a411-11e7-b0ef-ef76bd2a03c1', 16, NULL, 100, 'Инспектор отдела кадров', '2017-09-28', '«Камская государственная инженерно-экономическая академия»', '[B]', 'Российская Федерация', '2017-09-28', ' ', 10, 20000, '<p>Уверенный пользователь ПК: MS Word, MS Excel, MS PowerPoint, Internett, БД 1С 8</p>', '<p>Исполнительна, коммуникабельна, быстро обучаема</p>', 'Полная занятость', 'Нет', '33348550-a3a9-11e7-9e1a-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
