(171, 'd09751d8-c3ba-11e6-b3f6-037acc02728d', 77, NULL, 121, 'Менеджер', '2016-12-16', 'менеджмента и социально-информационных технологий', '[B]', 'Российская Федерация', '2016-12-19', ' ', 1, 30000, ' ', '<p>Внимательность&sbquo; ответственность&sbquo; аккуратность, усидчивость, умение быстро адаптироваться в новом коллективе, стрессоустойчивость, исполнительность, обучаемость.</p>', 'Полная занятость', 'Нет', '0ffde940-281d-11e6-95c2-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(172, '4521e4b7-222d-11e5-98aa-9370902ea73e', 22, NULL, 109, 'Руководитель обособленного подразделения', '2017-06-11', 'юридический', '[A, B, C, D, E]', 'Российская Федерация', '2017-12-01', ' ', 9, 150000, '<p>Функционал общий:</p><p>- организация деятельности &ldquo;с нуля&rdquo;, расчет бюджета; определение штата, набор, управление коллективом;</p><p>- реализация и расширение услуг, работ, видов деятельности;</p><p>- повышение эффективности деятельности структурных подразделений;</p><p>- самостоятельная разработка и внедрение ЛНА, положений, правил, и т.д.;</p><p>- информационные технологии: обучение сотрудников работе с различными, в т.ч. специализированными программами;</p><p>- обеспечение &ldquo;налоговой безопасности&rdquo; организации.</p><p>&nbsp;</p><p>Функционал специализированный:</p><p>- опыт решения всего спектра &ldquo;Северных&rdquo; вопросов (организация производственной деятельности на месторождениях нефтегазовой отрасли и ее &ldquo;бюрократическое обоснование&rdquo;);</p><p>- опыт организации строительства объектов повышенной опасности;</p><p>- опыт работы на рабочих должностях в период получения образования (оператор НГДО, водитель);</p><p>- в 2017 г. пройдена трехмесячная стажировка по организации строительных работ на нефтегазовых месторождениях в соответствии с международными стандартами компании Chevroil на Тенгизском месторождении (Каспий) РК.</p>', '<p>&nbsp;<span style=\"font-family: Times New Roman,serif;\"><span style=\"font-size: medium;\">Целеустремленность, настойчивость; способность принимать ответственные решения и проявлять разумную инициативу.</span></span></p>', 'Полная занятость', 'Да', 'efa2a520-222b-11e5-98aa-9370902ea73e', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(173, 'dca5249d-0a4d-11e8-8956-037acc02728d', 33, NULL, 115, 'Специалист по работе с таможней', '2018-02-05', 'Юридический институт', ' ', 'Российская Федерация', '2018-02-06', ' ', 0, 15000, '<p><strong>Ключевые навыки</strong></p><p>Таможенное законодательство, подбор кодов Товарной номенклатуры внешнеэкономической деятельности (ЕТН ВЭД ТС), расчет таможенных платежей, налогов, работа с таможенными декларациями, товаросопроводительными документами (инвойс, CMR, ТТН, упаковочные листы), таможенные процедуры, ИНКОТЕРМС-2010, организаторские навыки, деловое общение, работа с оргтехникой, <strong>&nbsp;&nbsp;&nbsp; </strong>Trade marketing, анализ мировых финансовых рынков, доверительное управление инвестиционными портфелями. Имеется понимание функционирования экономической, инвестиционной и банковской сред, работа в команде.</p>', '<p>&nbsp;</p><p><strong>Персональные качества</strong></p><p>Ответственность, амбициозность, коммуникабельность, обучаемость, любознательность, нацеленность на результат, активная жизненная позиция, отсутствие вредных привычек, стрессоустойчивость, пунктуальность, желание расти профессионально и развиваться</p>', 'Полная занятость', 'Да', 'b6d13c10-e3aa-11e6-8b55-4376a32b3f45', 'Готов к переобучению', '<p>Мои хобби. Изучение мировых фондовых площадок, а также специализируюсь на торговле акциямина рынке ММВБ с 2015 г. на реальном брокерском счете.&nbsp;Трейдинг изучаю по книгам А. Элдера. Определенной торговой стратегии нет. Увлекаюсь чтением книг в основном финансовой направленности и по бизнесу, первые два года в университете увлекался психологией. Занимаюсь самообразованием, интересуюсь банковским делом.Персональные качества. Ответственность, амбициозность, коммуникабельность, обучаемость, любознательность, нацеленность на результат, активная жизненная позиция, отсутствие вредных привычек, стрессоустойчивость, пунктуальность, желание расти профессионально и развиваться</p>', 'Готов к командировкам', ' '),
(174, '50a5672b-7b52-11e5-b17c-239645b044d5', 74, NULL, 127, 'Юрист', '2017-07-19', 'Уральская академия государственной службы', '[B]', 'Российская Федерация', '2017-12-01', ' ', 15, 25000, '<p>Высокий профессиональный &nbsp;уровень, опыт работы.</p>', '<p>Целеустремленность, высокая работоспособность, способность к обучению, стрессоустойчивость, неконфликтность</p>', 'Полная занятость', ' ', 'e6379a10-7b4d-11e5-b17c-239645b044d5', ' ', ' ', 'Готов к командировкам', ' '),
