(194, 'abb4eca0-82e9-11e5-a923-239645b044d5', 22, NULL, 121, 'Программист', '2017-03-21', 'технический', '[B]', 'Российская Федерация', '2016-09-17', ' ', 2, 15000, '<ul><li>Хорошее знание \"железа\" и программ.</li><li>ОС &ndash; Windows XP, Vista, 7, 8 (продвинутый пользователь).</li><li>Adobe Photoshop, Corel Draw, 3ds Max (доп. курсы).</li></ul>', '<ul><li>аналитический склад ума;</li><li>стрессоустойчивость;</li><li>пунктуальность;</li><li>ответственность;</li><li>усидчивость;</li><li>без вредных привычек;</li></ul>', 'Полная занятость', 'Нет', '1dfd86d0-7315-11e5-b25e-0163a9ae3d01', 'Готов к переобучению', ' ', ' ', ' '),
(195, 'eabfc8c4-3037-11e5-b22a-9370902ea73e', 77, NULL, NULL, 'Курьер', '2018-02-15', ' ', '[B]', 'Российская Федерация', '2015-07-23', ' ', 0, 15000, ' ', ' ', 'Временная', ' ', '61f0e560-3037-11e5-b22a-9370902ea73e', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(196, 'e2565a89-e22b-11e6-9e1a-ef76bd2a03c1', 64, NULL, 126, 'помощник инженера', '2017-01-24', 'водоснабжение и водоотведение', ' ', 'Российская Федерация', '2017-02-02', ' ', 4, 15000, '<p class=\"tm7\"><span class=\"tm8\">Уверенный пользователь ПК, умение работать с оргтехникой, высокая скорость печати, владение компьютерными программами </span><span class=\"tm8\">Microsoft</span> <span class=\"tm8\">Office</span><span class=\"tm8\">, A</span><span class=\"tm8\">utoCAD</span><span class=\"tm8\">, </span><span class=\"tm8\">Internet </span><span class=\"tm8\">Explorer</span><span class=\"tm8\">, базовые знания работы с графикой (Adobe Photoshop)</span><span class=\"tm8\">.</span></p><p class=\"tm10\">&nbsp;</p>', '<p class=\"tm7\"><strong><span class=\"tm9\">Личные качества:</span></strong><span class=\"tm8\"> целеустремлённость, ответственность, обучаемость новым технологиям и методам проектирования, коммуникабельность, пунктуальность.</span></p><p class=\"tm10\">&nbsp;</p><p class=\"tm12\">&nbsp;</p>', 'Полная занятость', ' ', '602cd660-9d94-11e5-b5ef-0163a9ae3d01', 'Готов к переобучению', '<p><strong><span class=\"tm9\">Цель:</span></strong><span class=\"tm8\"> заинтересована в стабильной работе и подработке, карьерном росте. Со своей стороны сделаю всё необходимое для четкого, качественного и полноценного выполнения возложенных на меня обязанностей.</span></p>', ' ', ' '),
(197, '7548ce4a-6e55-11e6-aa79-736ab11edb0c', 75, NULL, 109, 'директор (управляющий)', '2017-06-11', 'Управление процессом перевозок', '[B]', 'Российская Федерация', '2016-08-31', ' ', 5, 55000, '<p>Ответственность, умение управлять и объединять коллектив, умение убеждать, терпеливость</p>', '<p>Дисциплинированность, коммуникабельность, позитивность, любознательность</p>', 'Полная занятость', 'Нет', 'df6500b0-68fa-11e6-9fd1-736ab11edb0c', 'Готов к переобучению', '<p>Спротивная, активная, без вредных привычек.</p>', 'Готов к командировкам', '<p>Аккредитация в области эксперта по оценке уязвимости ОТИ и ТС</p>'),
(198, 'b27ba6ac-3f49-11e7-9948-037acc02728d', 77, NULL, 108, 'Заместитель директора', '2017-05-23', 'Управление и экономика на транспорте', '[B]', 'Российская Федерация', '2017-05-23', ' ', 14, 100000, '<p>Опыт управления более 20 лет (с 1997 года);</p><p>Большой опыт управления строительными организациями численностью до 1 тыс.человек с аппаратом управления до 100 человек и оборотом более 1 млрд. рублей в год;</p><p>Опыт работы как с Российскими, так и с зарубежными Заказчиками;</p><p>Опыт разработки и успешной реализации стратегии развития бизнеса;</p><p>Положительный опыт работы в условиях жесткого контроля бюджета на строительство;</p><p>Успешный опыт ведения переговоров на уровне руководителей Компаний;</p><p>Большой опыт взаимодействия с административными и надзорными органами Государственной власти;</p>', '<p>Лидерские качества, умение убеждать и мотивировать бизнес-команду;</p><p>Умею решать сложные, на первый взгляд неразрешимые задачи;</p><p>Способен организовать и настроить коллектив на победу;</p><p>Имею аналитический склад ума;</p><p>Легко обучаем;</p><p>Коммуникабелен;</p><p>Стрессоустойчив;</p><p>Пунктуален;</p><p>Хорошее чувство юмора;</p>', 'Полная занятость', ' ', 'c800c210-3f3c-11e7-9948-037acc02728d', 'Готов к переобучению', '<p>Под моим руководством были успешно построены и введены в эксплуатацию объекты жилого и промышленного назначения;</p><p>Моими Заказчиками были: ОАО ГМК &laquo;Норильский никель&raquo;(г. Мурманск), Департамент строительства г.Москвы (период Ресина В.И.), ОАО &laquo;Моспромстройматериалы&raquo;, Аэропорта Алыкель (г. Норильск), Русская Православная Церковь, Коммерческий Банк &laquo;СМП&raquo;, Коммерческий Банк &laquo;МБТС&raquo;, Коммерческий Банк &laquo;Собинбанк&raquo;, Компания &laquo;КНАУФ ГИПС&raquo;(г. Красногорск), МТК &laquo;АвтоМОЛЛ&raquo;(г. Москва) и др.</p>', 'Готов к командировкам', '<p>2003 год, Диплом Правительства Москвы, &laquo;Стройплощадка 2003&raquo;, Финалист Конкурса</p>'),
