(214, 'b89ba048-ad4e-11e6-a209-736ab11edb0c', 24, NULL, 100, 'Специалист по кадрам', '2016-11-18', 'Математики и информатики', ' ', 'Российская Федерация', '2017-02-06', ' ', 3, 26000, '<ul><li>ответственность,</li><li>внимательность,</li><li>коммуникабельность,</li><li>тактичность,</li><li>стрессоустойчивость,</li><li>стремление к саморазвитию и высокий уровень обучаемости.</li></ul>', ' ', 'Полная занятость', 'Нет', '2184a310-ad48-11e6-a209-736ab11edb0c', ' ', '<p><strong>КЛЮЧЕВЫЕ ЗНАНИЯ И КОМПЕТЕНЦИИ</strong></p><ul><li>знание трудового законодательства и умение его анализировать;</li><li>знание правил оформления, ведения и хранения документации, связанной с кадрами и их движением;</li><li>знание систем оплаты труда, знание порядка применения надбавок и доплат к заработной плате;</li><li>умение анализировать и структурировать информацию;</li><li>умение разрабатывать формы внутренней документации;</li><li>навыки делового письма;</li><li>владение приемами проведения расчетов по оплате труда;</li><li>владение программами 1С: Зарплата и управление персоналом 8.2; Перечень Льготных Профессий, Консультант +, СБИС, MS Word, MS Excel и др.;</li><li>умение работать с офисной техникой и&nbsp; интерактивной доской.</li></ul>', 'Не готов к командировкам', ' '),
