(256, 'c99235ad-cdd5-11e7-8c61-ef76bd2a03c1', 77, NULL, 99, 'Начальник планово-экономического отдела', '2017-11-20', '«Уфимский государственный нефтяной технический университет»', '[B]', 'Российская Федерация', '2017-11-21', ' ', 12, 100000, '<p>Отличный пользователь Excel, Power Point, 1С, АСУ ГФ</p>', '<p>- Активная жизненная позиция; - Аналитический склад ума; - Целеустремленность, настойчивость; - Организаторские способности; - Способность к адаптации; - Стрессоустойчивость; - Честность и порядочность; - Позитивное мышление. </p>', 'Полная занятость', 'Нет', '63472550-cdd3-11e7-8c61-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(257, 'cd966354-9556-11e6-b44e-736ab11edb0c', 43, NULL, 108, 'Инженер-строитель', '2016-10-18', 'Строительства и архитектуры', '[B]', 'Российская Федерация', '2016-10-19', ' ', 0, 15000, '<ul><li>Весь производственный цикл (проектирование, строительство, реконструкция и техническая эксплуатация) как отдельных зданий, так и жилых комплексов целых городов.</li><li>Организационно-управленческая деятельность, такая как организация проектных и строительных работ, управление эксплуатацией объектов городского хозяйства; могу проводить исследование изделий и конструкций архитектурного назначения для объектов городского хозяйства, могу готовить территории к застройке, благоустройству; проектировать городские объекты различного назначения; выполнять реконструкцию зданий и сооружений.</li><li>Анализ чертежей и прочей технической документации. Быстро изучаю и осваиваю новое оборудование.</li></ul>', '<ul><li>Ответственный, активный, смекалистый, высокая работоспособность.</li><li>Люблю учиться и двигаться вперёд.</li><li>Довожу поставленные задачи до логического завершения.</li><li>Целеустремленный.</li></ul>', 'Полная занятость', ' ', 'efda03a0-9555-11e6-b44e-736ab11edb0c', 'Готов к переобучению', '<p>Личные достижения: Взрослый разряд по лыжным гонкам.</p>', ' ', ' '),
(258, '139fed70-cce6-11e4-8f5f-cf9c28389ff9', NULL, NULL, 100, 'инженер', '2018-02-15', 'менеджмент качества и энергосбережения', '[B]', 'Российская Федерация', '2015-03-23', ' ', 0, 50000, 'Умение организовать работу персонала, принимать верные решения, работать с большим количеством информации.', 'Ответственный, трудолюбивый, математический склад ума', 'Полная занятость', 'Да', '66c788c0-cce4-11e4-8f5f-cf9c28389ff9', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
