(272, 'ceff8f5e-15a9-11e6-ab58-736ab11edb0c', 74, NULL, 105, 'экономическая безопасность', '2017-03-27', 'Автотракторный', '[B]', 'Российская Федерация', '2017-12-25', ' ', 30, 70000, '<p>Имею большой опыт в организации работы по выявлению преступлений в сфере экономики, руководством подразделений, в том числе охранных структур. Имею опыт по контролю за закупочными процедурами крупной международной компании, контролем за расходованием денежных средств, списанием материалов и др. деятельности, связанной с активами компании.</p>', '<p>Целеустремленный, исполнительный, внимательный к окружающим, честный.</p>', 'Полная занятость', 'Да', '361b21f0-159f-11e6-ab58-736ab11edb0c', 'Не готов к переобучению', ' ', 'Готов к командировкам', ' '),
