(349, 'a6308a3b-a022-11e6-9e38-037acc02728d', 52, NULL, 108, 'Инженер', '2016-11-01', 'КГиЗОС', '[B, C]', 'Российская Федерация', '2017-05-03', ' ', 3, 30000, '<p>Ответственность -ко всему подхожу серьёзно и качественно;Целеустремленность - почти всегда достигаю желаемого конечного результата;Исполнительность - выполняю любую работу;легкая и быстрая обучаемость, желание работать.</p>', '<p>Ответственность -ко всему подхожу серьёзно и качественно;Целеустремленность - почти всегда достигаю желаемого конечного результата;Исполнительность - выполняю любую работу;легкая и быстрая обучаемость, желание работать.</p>', 'Полная занятость', 'Да', 'd7401b50-a01c-11e6-9e38-037acc02728d', 'Готов к переобучению', '<p>Нивелирная, теодолитная, мензульная и тахеометрическая съёмки. Выполнение чертежей в AutoCAD и КОМПАС, владение навыками работы пакетом Microsoft Office и Интернет. Работа с нормативной литературой в электронных системах Консультант и Кодекс. Умение работать в различных ОС. Навыки руководителя.</p>', 'Готов к командировкам', '<p>Сертификат технический английский язык, благодарность от главы Советского района</p>'),
(350, 'ba9f2d0b-8e84-11e6-8735-736ab11edb0c', 14, NULL, 117, 'Бухгалтер', '2017-01-28', 'Финансовый', '[B]', 'Российская Федерация', '2016-10-10', ' ', 10, 40000, '<p>Опытный пользователь ПК, владение программами MS Office на уровне Эксперт, уверенный пользователь 1С: Предприятие (&laquo;Зарплата, Управление персоналом&raquo;, &laquo;Торговля и Склад&raquo;, &laquo;Управление торговлей&raquo;) версии 7.7, 8.1., сертифицированный пользователь системы Консультант плюс, уверенный пользователь Storehouse версии 4.0, РБО/ИБСО, программ по дистанционному обслуживанию кредитных учреждений.</p>', '<p>Пунктуален, предусмотрителен, умею правильно распоряжаться рабочим временем, предпочитаю четкую расстановку планов, задач, коммуникабелен, неконфликтен. Вредные привычки отсутствуют.</p>', 'Полная занятость', 'Нет', 'f7645820-8e82-11e6-8735-736ab11edb0c', 'Готов к переобучению', '<p>Военнообязанный.</p>', 'Готов к командировкам', ' '),
