(361, '9998c74a-280a-11e7-a5a3-4376a32b3f45', 23, NULL, 121, 'Специалист связи', '2017-04-23', 'Институт экономики отраслей бизнеса и администрирования', '[B]', 'Российская Федерация', '2017-04-26', ' ', 6, 25000, '<p>Готова к постоянному самообучению и развитию;</p><p>Нацеленность на результат;</p><p>Организаторские способности; &nbsp;</p><p>Исполнительность, умение выполнять задачи, умение следовать инструкциям;</p><p>Тактичность, вежливость, толерантность.</p>', '<p>Дисциплинированна;</p><p>Ответственна;</p><p>Коммуникативные навыки;</p><p>Стрессоустойчивость в конфликтных и нестандартных ситуациях.</p><p>&nbsp;</p>', 'Полная занятость', ' ', 'bc1a0670-2801-11e7-a5a3-4376a32b3f45', 'Готов к переобучению', '<p>Остальную информацию готова выслать по требованию или предоставить на собеседовании.</p>', 'Готов к командировкам', ' '),
