(367, '1931a216-a4f7-11e7-9e1a-4376a32b3f45', 42, NULL, 106, 'Ищу подработку уборщицы', '2017-09-29', ' ', ' ', 'Российская Федерация', '2017-10-02', ' ', 0, 10000, ' ', ' ', 'Временная', 'Нет', '83d390c0-a4f6-11e7-9e1a-4376a32b3f45', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
