(369, '64286d80-9d13-11e7-bbbf-037acc02728d', 11, NULL, 105, 'Рядовой сотрудник полиции', '2017-09-19', 'Гимназия 1', ' ', 'Российская Федерация', '2017-09-20', ' ', 0, 25000, ' ', ' ', 'Полная занятость', ' ', 'a077a550-9d11-11e7-bbbf-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(370, '19f99c6d-376d-11e5-a8c4-239645b044d5', 18, NULL, 99, 'Администратор, оператор ПК', '2017-07-14', 'Бухгалтерский учет, анализ и аудит', ' ', 'Российская Федерация', '2015-08-24', ' ', 11, 10000, '<p>Компьютерные навыки: Работа в программах 1С, 1С: Бухгалтерия,1С:Предприятие УСН, Word, Excel.</p>', '<p>Ответственность, управленческие навыки, стремление к личностному и профессиональному росту, умение работать в команде, доброжелательность.</p>', 'Полная занятость', ' ', '746676f0-31d7-11e5-a8c4-239645b044d5', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(371, '1c448fa5-ed3e-11e7-9855-0f468c90bfa7', 50, NULL, 97, 'Менеджер', '2017-12-30', 'Лицей 111 Столярно-мебельное производство, Мастер столярно-мебельного производства', '[B]', 'Российская Федерация', '2017-12-31', ' ', 17, 60000, '<p>Качества, благодаря которым я добиваюсь&nbsp;успеха в продажах::</p><ol><li>Общительность</li><li>Эмоц.устойчивость</li><li>Энергичность</li></ol><p>В работе :</p><p>В течении рабочего стажа я занимался продажами автомобилей, декоративных материалов и услуг по их нанесению, слаботочных систем и также не боялся создавать что-то своими руками, будь то мебельное производство либо строительство.Легко обучаем, не боюсь менять специализацию. Ответственный.Нравится организовывать рабочие процессы, нацелен на максимально положительный результат и радею за процветание компании, в которой я работаю.</p><p>&nbsp;</p>', '<p>&nbsp;</p><p>&nbsp;Краткая психологическая характеристика, составленная на основе анализа 21 фактора личности:</p><p>В коллективе :</p><p>Открыт для общения, разговаривать с ним легко. Прекрасно умеет выстраивать дружеские и приятельские отношения, поэтому может вписаться в любой коллектив. С готовностью участвует в общественных мероприятиях. Это именно тот человек, который организует празднования дней рождений, участвует в подготовке корпоративов и т.д. Очень активен, энергичен и общителен. Способен успешно существовать даже во враждебном коллективе. Легко ладит с людьми, т.к. никого &laquo;не напрягает&raquo;, но и не склонен к самопожертвованию. Находит адекватную форму для выражения своих эмоций и удовлетворения своих потребностей. Чувствительный, ценит внимание, не терпит грубости. Прямолинеен, открыт, сентиментален, чем вызывает доверие и симпатию.</p>', 'Полная занятость', 'Нет', 'e5f467f0-ed3c-11e7-a184-9122a281f90e', 'Готов к переобучению', '<p>Краткая психологическая характеристика, составленная на основе анализа 21 фактора личности:</p><p>Краткая характеристика :</p><p>Любые эмоции, как положительные, так и отрицательные моментально выражаются в поведении, в жестах, в мимике. Живо интересуется всем происходящим вокруг. Фонтанирующая энергия, активность, спонтанность. На пути к цели не останавливается ни перед чем и ни перед кем. Действует мгновенно. Смелый, решительный, самоуверенный. Мало что может выбить его из колеи, о неудачах быстро забывает. Спокойный, реалистичный в отношении к жизни. Интересы, планы и привязанности постоянны. Настойчив, упорен, умеет держать себя в руках. Достаточно исполнительный, хотя и не лишен своего мнения. При определенных обстоятельствах может проявлять лидерские качества. Богатое воображение, образность мышления, оптимистичность. В меру осторожен, придерживается позиции &laquo;доверяй, но проверяй&raquo;, поэтому новые люди и ситуации могут вызывать напряжение и подозрительность. Непосредственный, естественный, гибкий в поведении.</p><p>Дата проведения анализа: 14/09/2017 Данная характеристика составлена на основе анализа 21 фактора личности, в базе которых лежат такие опросники как MBTI, MMPI, BigFive, OPQ &amp; K21pF v5. сервисом по автоматическому подбору эффективных сотрудников &ndash; HR-sniper.ru Валидность оценки данного теста: 84%, коэффициент Альфа-Кронбаха &ndash; 0,79</p>', 'Готов к командировкам', ' '),
(372, '1f49f067-6f59-11e5-a367-833b590698f7', 46, NULL, 97, 'Мерчендайзер,продавец-консультант,экспедитор', '2016-10-15', 'ТТО', '[B]', 'Российская Федерация', '2015-10-11', ' ', 0, 15000, ' ', ' ', 'Полная занятость', ' ', '395a4a30-6f55-11e5-a367-833b590698f7', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(373, 'a2902cd4-6fb9-11e7-ad9d-4376a32b3f45', 74, NULL, 99, 'Экономист', '2017-07-23', 'ГОУ ВПО «Челябинский государственный университет»', ' ', 'Российская Федерация', '2017-07-24', ' ', 10, 40000, '<p>Умение быстро и самостоятельно принимать решения;</p><p>Умение работать в команде;</p><p>Свободно владею персональным компьютером как пользователь (MS Office (Word, Excel) 2003, 2007, 2010, 2013, 2016, 1C: Торговля и склад, Internet, ИНФИН).</p>', '<p>Высокая работоспособность;</p><p>Аналитический склад ума;</p><p>Порядочность;Ответственность;</p><p>Внимателен к мелочам;</p>', 'Полная занятость', 'Да', '54dae430-6fb3-11e7-ad9d-4376a32b3f45', 'Готов к переобучению', '<p>Проходил обучение по ведению переговоров, работе с возражениями, постановке и достижению целей проводимых ООО &laquo;ЭВЭНКС &ndash; Южный&raquo;, ООО &laquo;Ригли&raquo; и ООО &laquo;ХЕЙНЕКЕН ЛО-ГИСТИК &ndash; Ч&raquo; в период работы на данных предприятиях.</p>', 'Готов к командировкам', ' '),
(374, '253dee60-7144-11e7-ad9d-4376a32b3f45', 74, NULL, 97, 'Специалист отдела снабжения', '2017-07-25', 'ГОУ ВПО «Челябинский государственный университет»', ' ', 'Российская Федерация', '2017-07-26', ' ', 10, 40000, '<p>Умение быстро и самостоятельно принимать решения;</p><p>Умение работать в команде;</p><p>Свободно владею персональным компьютером как пользователь (MS Office (Word, Excel) 2003, 2007, 2010, 2013, 2016, 1C: Торговля и склад, Internet, ИНФИН).</p>', '<p>Высокая работоспособность;</p><p>Аналитический склад ума;</p><p>Порядочность;Ответственность;</p><p>Внимателен к мелочам;</p>', 'Полная занятость', 'Да', '54dae430-6fb3-11e7-ad9d-4376a32b3f45', 'Готов к переобучению', '<p>Проходил обучение по ведению переговоров, работе с возражениями, постановке и достижению целей проводимых ООО &laquo;ЭВЭНКС &ndash; Южный&raquo;, ООО &laquo;Ригли&raquo; и ООО &laquo;ХЕЙНЕКЕН ЛО-ГИСТИК &ndash; Ч&raquo; в период работы на данных предприятиях.</p>', 'Готов к командировкам', ' '),
(375, 'c9fa31e7-915e-11e7-a5a7-037acc02728d', 59, NULL, 105, 'следователь ,мвд , юрист', '2017-09-04', 'право и правохранительная деятельность', ' ', 'Российская Федерация', '2017-09-05', ' ', 0, 20000, '<p>умение анализировать документы;</p><p>умение быстро принимать решения.</p><p>&nbsp;</p>', '<p>стрессоустойчивость, пунктуальность,</p><p>умение искать выход из тупиковых ситуаций, внимание к деталям, трудолюбие,</p><p>&nbsp;</p>', 'Полная занятость', ' ', '28432610-9067-11e7-9383-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(376, '7facde78-f66a-11e5-b72a-037acc02728d', 91, NULL, 128, 'Инженер', '2016-10-20', 'Саратовское высшее военно-инженерное училище', '[B, C]', 'Российская Федерация', '2016-03-30', ' ', 2, 18000, ' ', '<p>Организованность, коммуникабельность, внимательность, стрессоустойчивость, амбициозность, умение работать в команде, ответственность, порядочность, желание работать на результат, умение работать с большими объемами информации, аналитический склад ума, активная жизненная позиция.</p>', 'Полная занятость', 'Нет', 'f10231c0-f669-11e5-b72a-037acc02728d', 'Не готов к переобучению', ' ', 'Готов к командировкам', ' '),
(377, 'a9d98cba-d2b1-11e6-9a07-037acc02728d', 23, NULL, 97, 'Продавец-кассир', '2017-01-04', 'Финансы', ' ', 'Российская Федерация', '2017-01-07', ' ', 26, 27000, '<p>Всегда нацелена на результат, даже если он требует повышенных затрат (как времени, так и сил). Целеустремленная. Действительно не люблю оставлять на завтра то, что можно сделать сегодня.</p><p>Технический уровень работы с компьютером - уверенный пользователь.</p>', '<p>Хорошо отношусь к монотонной работе, стрессоустойчива. Общение с людьми никогда не отталкивало. Придерживаюсь позиции мягкого общения. В своей сфере работы всегда чувствую себя уверенно.Трений в коллективах, в которых я работала, никогда не было.</p>', 'Полная занятость', 'Нет', '07415ce0-d2b0-11e6-9a07-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
