(379, 'a810dae6-e2d0-11e5-bc70-4376a32b3f45', 25, NULL, 108, 'Электромонтер по ремонту и обслуживанию электрооборудования', '2017-08-27', 'Государственное образовательное учреждение начального профессионального образования «Профессиональное училище №27» г. Дальнереченска', '[A, B, C]', 'Российская Федерация', '2016-03-09', ' ', 5, 20000, ' ', '<p>Порядочный, внимательный, усидчивый, ответственный, осторожный, бдительный, легко обучаем. Общительный, коммуникабельный, без вредных привычек. Имею аналитический склад ума, высокую работоспособность, целеустремлённость, дисциплинированность, аккуратность, исполнительность, умею работать в команде, готов к дальнейшему обучению и получению новых знаний.</p>', 'Полная занятость', 'Нет', '48ba3a60-e2cf-11e5-bc70-4376a32b3f45', 'Готов к переобучению', ' ', ' ', ' '),
