(424, '1377587c-055f-11e7-9035-ef76bd2a03c1', 91, NULL, 108, 'Строительство', '2017-03-10', 'МЭПП', '[B, C]', 'Российская Федерация', '2017-03-10', ' ', 13, 60000, '<p>Знание \"Гранд Сметы\", владение навыками проектирования в \"АвтоКад\", знание всех этапов по монтажу и наладке оборудование, администрирование, документо оборот, знание компьютора, знание электромонтажных работ на ТП, РП, КЛ 10, КЛ 0.4 кВ, ВЛ. Знание приемо - сдаточно документации по СМР. Читение любых проектов. Знание работ по монтаже по разделам отопление, водоснабженние, вентиляция, канализация, систем видео наблюдение, пожарно-охранной сигнализации, локальные сети. Полный контроль по строительным работам согласно СНиП. Ведение технической документации.</p>', '<p>Уравновешеный, трудоголик, ответственный, общительность, работа с персоналом, подбор персонала.</p>', 'Полная занятость', 'Нет', '8a1fc470-055b-11e7-9035-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Удостоверение по электробезопасности 5 группа, квалификация по дайвингу \"Dive Master\", удостоверение на управлние маломерным водным транспортом.&nbsp;</p>'),
(425, 'b2043830-ed5a-11e7-92a5-e37b4be0b9ed', 73, NULL, 128, 'инженер', '2017-12-30', 'Энергетический', '[B]', 'Российская Федерация', '2018-01-01', ' ', 10, 55000, '<p>1. Планирования работы и организации процесса труда.</p><p>2. Знание системы&nbsp;электроснабжения, водоснабжения, пароснабжения, газоснабжения, вентиляции, систем опасных производственный объектов (ОПО).</p><p>3. Работы с энергоснабжающими организаиям.</p><p>4. Практический опыт контроля за установкой и проведением пусконаладочных работ инженерных систем.</p><p>5. Умение создавать систему техничского обслуживания оборудования и контроля за поддержанием оборудования в технически исправном состоянии.</p>', '<p>1. ответственность и дисциплинированность&nbsp;</p><p>2. умение легко устанавливать контакт</p><p>3.&nbsp;креативность и творческий подход к работе&nbsp;</p><p>4.&nbsp;умение оперативно принимать решения и нести ответственность за них</p>', 'Полная занятость', 'Нет', 'fc9d50d0-ed59-11e7-92a5-e37b4be0b9ed', ' ', '<p>Обучение по электробезоасности 1000 В и выше, аттестация по промыщленной безопасности в сферах: общие требования, паровые котельные, сосуды под давлением, газоснабжение.</p>', 'Готов к командировкам', ' '),
