(576, '0b7d16f7-53b6-11e7-94b6-0f468c90bfa7', 77, NULL, 125, 'Преподаватель физической культуры', '2017-06-18', 'Педагогическое образование', ' ', 'Российская Федерация', '2017-06-18', ' ', 0, 40000, 'Любовь к детям, стремление к самосовершенствованию', 'Пунктуальность, организованность, ответственность', 'Полная занятость', 'Нет', 'e81ad980-53b1-11e7-b7b8-037acc02728d', ' ', ' ', ' ', ' '),
(577, '89bd5dbf-7a1c-11e5-b25e-0163a9ae3d01', 24, NULL, 125, 'Учитель (преподаватель) истории', '2017-06-23', 'Исторический', '[B]', 'Российская Федерация', '2015-11-06', ' ', 7, 10000, '<p>Знание современных ФГОС и умение применить имеющиеся знания на практике. Умение находить общий язык с разными возрастными группами учащихся. Помощь уащимся в понимании предмета, а не зазубривании оного.</p><p>&nbsp;</p><p>Разряды:</p><p>ПДО - 9 разряд</p><p>Учитель - 8 разряд</p><p>Старший вожатый - II категория</p>', '<p>Высокая работоспособность, стремление к профессиональному росту, новым знаниям и саморазвитию. Амбициозность в разумных пределах. Логическое мышление, умение планировать свою рабочую деятельность. Честность, ответственность, коммуникабельность. Быстрая обучаемость. Стремление к рационализации деятельности.</p>', 'Полная занятость', 'Да', 'ba1b6400-7a14-11e5-b25e-0163a9ae3d01', 'Готов к переобучению', '<p>Имеются собственные готовые проекты, целью которых является разнообразить и приукрасить воспитательный процесс образовательного учреждения. Многие&nbsp;проекты уже были реализованы в воспитательных планах МБОУ Гимназии №7, а также в планах воспитательной работы Управления образования г.Красноярска, где имели успех и признание как со стороны учащихся, так и со стороны педагогического и административного состава.</p><p>&nbsp;</p><p>P.S. готов поделиться готовыми проектами и идеями&nbsp;с другими регионами России :)))</p>', 'Готов к командировкам', ' '),
(578, '34d21961-7a1e-11e5-b25e-0163a9ae3d01', 24, NULL, 125, 'Педагог-организатор', '2017-06-23', 'Исторический', '[B]', 'Российская Федерация', '2015-11-06', ' ', 7, 10000, '<p>Знание современных ФГОС и умение применить имеющиеся знания на практике. Умение находить общий язык с разными возрастными группами учащихся. Помощь уащимся в понимании предмета, а не зазубривании оного.</p><p>&nbsp;</p><p>Разряды:</p><p>ПДО - 9 разряд</p><p>Учитель - 8 разряд</p><p>Старший вожатый - II категория</p>', '<p>Высокая работоспособность, стремление к профессиональному росту, новым знаниям и саморазвитию. Амбициозность в разумных пределах. Логическое мышление, умение планировать свою рабочую деятельность. Честность, ответственность, коммуникабельность. Быстрая обучаемость. Стремление к рационализации деятельности.</p>', 'Полная занятость', 'Да', 'ba1b6400-7a14-11e5-b25e-0163a9ae3d01', 'Готов к переобучению', '<p>Имеются собственные готовые проекты, целью которых является разнообразить и приукрасить воспитательный процесс образовательного учреждения. Многие&nbsp;проекты уже были реализованы в воспитательных планах МБОУ Гимназии №7, а также в планах воспитательной работы Управления образования г.Красноярска, где имели успех и признание как со стороны учащихся, так и со стороны педагогического и административного состава.</p>', 'Готов к командировкам', ' '),
