(585, '1cc6079b-774f-11e5-b25e-0163a9ae3d01', 58, NULL, 97, 'менеджер', '2017-06-29', 'менеджмент', '[B, C]', 'Российская Федерация', '2017-08-02', ' ', 12, 25000, '<p>Анализ денежных и товарных движений, анализ долговых обязательств, как поставщиков, так и покупателей, работа с клиент-банком, ведение счетов, наличный и безналичный расчёт, расчёт заработной платы, контроль подчинённых, ведение расходной части предприятия, ведение и расчёт премиальной составляющей предприятия, работа с клиентами (поставщиками и покупателями), работа с 1С, организация и планирование финансовых движений...</p>', '<p>Честность, прямолинейность, желание зарабатывать.</p>', 'Полная занятость', 'Да', '07ac68e0-7740-11e5-b25e-0163a9ae3d01', 'Готов к переобучению', '<p>Преданность делу, целеустремлённость, желание развиваться и зарабатывать!</p>', 'Готов к командировкам', ' '),
