(590, 'd39b663c-6d44-11e7-a400-037acc02728d', 31, NULL, 101, 'Массажист', '2017-07-20', 'Акушерское дело', '[B]', 'Российская Федерация', '2017-07-27', ' ', 5, 30000, '<p>Стремление к профессиональному росту, повышенная работоспособность, стрессоустойчивость, физическая выносливость, ответственность.</p>', '<p>Дружелюбность, тактичность, внимательность, постоянно нахожусь в процессе саморазвития, способность работать с большим количеством информации, нацеленность на результат, организованность.</p><p>&nbsp;</p><p>&nbsp;</p>', 'Полная занятость', 'Нет', 'f8f2b680-6d40-11e7-a400-037acc02728d', ' ', '<p>Учусь на заочном отделении в Уральском государственной институте физической культуры. Нужно отпускать на сессию.</p><p>&nbsp;</p>', 'Не готов к командировкам', ' '),
