(602, '20464f6a-e71f-11e6-9310-4376a32b3f45', 29, NULL, 108, 'Инженер ПТО', '2017-01-30', 'Природные ресурсы', '[B]', 'Российская Федерация', '2017-03-21', ' ', 7, 30000, '<ul><li>Уверенный пользователь ПК (офисные приложения &ndash; MS Word, MS Excel, MS Outlook, MS Internet, Power Point),</li><li>работа с Compass 3D, AutoCAD, 1С: Предприятие, сметной программой &laquo;Сметный калькулятор&raquo;, &laquo;SmetaWIZARD&raquo;,</li><li>административная поддержка руководителя и офиса,</li><li>знание оргтехники.</li></ul>', '<ul><li>Грамотная речь,</li><li>организаторские способности,</li><li>умение работать с большим количеством информации,</li><li>математический склад ума,</li><li>системное мышление,</li><li>настойчивость в достижении цели,</li><li>стремление к личностному росту и профессиональному развитию,</li><li>самостоятельность,</li><li>ответственность,</li><li>трудолюбие,</li><li>аккуратность,</li><li>отзывчивость,</li><li>отсутствие вредных привычек.</li></ul>', 'Полная занятость', 'Нет', 'f95ad610-e718-11e6-9310-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
