(613, '9b7a029a-234c-11e6-a6c7-736ab11edb0c', 39, NULL, 127, 'Юрист', '2017-07-17', 'Экономика Бухгалтерский учет и контроль', '[B]', 'Российская Федерация', '2016-08-26', ' ', 6, 25000, '<p>Знание и ремонт ПК, офисных программ Word, Excel, и др. справочно-правовых систем Гарант и Консультант плюс, работа с защищенными сетями и&nbsp; деловой почтой VipNet, знание программ автоматизировано-информациооные системы Роструд контроль, научно-производственный комплекс Катарсис, работа с цифровыми подписями, оказание государственных услуг в электронном виде на региональных порталах. Настройка офисной оргтехники (сканер, принтер) WI-FI.</p>', '<ul><li>Дисциплинированность,</li><li>коммуникабельность,</li><li>ответственность,</li><li>доброта,</li><li>умение ладить с людьми,</li><li>целеустремленность,</li><li>быстрая обучаемость,</li><li>отсутствие вредных привычек.&nbsp;</li></ul>', 'Полная занятость', 'Да', '09cd3220-ef46-11e5-904f-736ab11edb0c', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Сертификат №044-ТП32242 от 30.07.2013 г. ООО \"Инок Плюс\" - пользователь \"Консультант Плюс Технология ПРОФ\"</p>'),
(614, '0a494190-270d-11e6-977c-037acc02728d', 39, NULL, 99, 'Экономист', '2017-07-12', 'Экономика Бухгалтерский учет и контроль', '[B]', 'Российская Федерация', '2016-08-26', ' ', 6, 25000, '<p>Знание и ремонт ПК, офисных программ Word, Excel, и др. справочно-правовых систем Гарант и Консультант плюс, работа с защищенными сетями и&nbsp; деловой почтой VipNet, знание программ автоматизировано-информациооные системы Роструд контроль, научно-производственный комплекс Катарсис, работа с цифровыми подписями, оказание государственных услуг в электронном виде на региональных порталах. Настройка офисной оргтехники (сканер, принтер) WI-FI.</p>', '<ul><li>Дисциплинированность,</li><li>коммуникабельность,</li><li>ответственность,</li><li>доброта,</li><li>умение ладить с людьми,</li><li>целеустремленность,</li><li>быстрая обучаемость,</li><li>отсутствие вредных привычек.&nbsp;</li></ul>', 'Полная занятость', 'Да', '09cd3220-ef46-11e5-904f-736ab11edb0c', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Сертификат №044-ТП32242 от 30.07.2013 г. ООО \"Инок Плюс\" - пользователь \"Консультант Плюс Технология ПРОФ\"</p>');
INSERT INTO `resumes` (`id`, `cv_id`, `region_id`, `profession_id`, `industry_id`, `position_name`, `creation_date`, `education_list`, `drive_licence_list`, `country`, `publish_date`, `schedule_type_list`, `experience`, `salary`, `skills`, `additional_skills`, `busy_type`, `relocation`, `candidate_id`, `retraining_capability`, `other_info`, `business_trips`, `add_certificates`) VALUES
(615, '21c11130-3e56-11e7-a296-736ab11edb0c', 18, NULL, 128, 'Механик, заместитель по технике, или по предложению', '2017-05-21', 'Эксплуатация судовых силовых установок', '[B]', 'Российская Федерация', '2018-02-12', ' ', 23, 30000, '<p>- Опыт формирования и управления работой технических служб предприятия (ремонтной; энергетической; ОТ и ТБ); - Опыт ввода в эксплуатацию отечественного и импортного оборудования; - Опыт руководства и&nbsp; личного участия в жизнеобеспечении предприятия: взаимодействие с энергоснабжающими организациями (электроэнергия; ГВС, ХВС, техническое водоснабжение); &ndash; Контроль над использованием энергоресурсов; решение вопросов установки и функционирования охранной и пожарной сигнализации; взаимодействие с представителями ГосПожНадзора; взаимодействие с органами экологического надзора по вопросам утилизации производственных отходов, атмосферных загрязнений и примесей в сточных водах; содержание подъездных путей и территории предприятия; обеспечение функционирования системы управления охраной труда; - Опыт взаимодействия с проектными институтами, поставщиками материалов, оборудования, подрядными организациями; - Опыт по оформлению разрешительной документации, сопровождающей ввод в эксплуатацию в соответствии с графиком реализации проекта. Получение технической и исходно-разрешительной документации. Получение разрешения на строительство. - Опыт управления персоналом: подбор, расстановка, обучение, периодическая аттестация; - Опыт взаимодействия с арендодателями и работы на арендованных площадях.</p>', '<p>О себе; Высокие организаторские способности, инициативный, ориентированный на результат, коммуникабельный,&nbsp; стрессоустойчивый, &nbsp;способный работать в режиме многозадачности.</p><p>Готовность к постоянному развитию и обучению.</p><p>Хобби: Стрельба из лука ( КМС)</p>', 'Полная занятость', 'Нет', '3f797da0-3e4d-11e7-a296-736ab11edb0c', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>- ОАО &laquo;Мурманское морское пароходство&raquo;,Специальность: Судовой механик, механик ДВС (рабочий диплом).- Институт повышения квалификации <span class=\"ResumeMain_error m_mistake_word\">г</span>. С.-<span class=\"ResumeMain_error m_mistake_word\">Петербург</span>,Специальность: Специалист морского транспорта для работы на танкерах.- Учебно-курсовой комбинат ТПО ЖСКХ УР <span class=\"ResumeMain_error m_mistake_word\">г</span>. Ижевск 2001 <span class=\"ResumeMain_error m_mistake_word\">г</span>.,Специальность: Лицо ответственное за газовое хозяйство промышленных предприятий с правом руководства <span class=\"ResumeMain_error m_mistake_word\">газоопасных</span> работ.- ОАО &laquo;<span class=\"ResumeMain_error m_mistake_word\">Ижнефтемаш</span>&raquo;, 2001 <span class=\"ResumeMain_error m_mistake_word\">г</span>.,Специальность: Механик (энергетик) цеха, 4 гр. по электробезопасности до 1000 В., за исправное состояние ГПМ.- ООО &laquo;<span class=\"ResumeMain_error m_mistake_word\">Аксион</span>-<span class=\"ResumeMain_error m_mistake_word\">электро</span>&raquo;, 2004 <span class=\"ResumeMain_error m_mistake_word\">г</span>.,Специальность: Главный механик предприятия, 4 гр. по электробезопасности до 1000 В., за исправное состояние ГПМ, ответственный по ТБ, ОТ и ПБ.- ООО СФ &laquo;<span class=\"ResumeMain_error m_mistake_word\">Термо</span> &ndash; С&raquo;, 2006 <span class=\"ResumeMain_error m_mistake_word\">г</span>.,Специальность: Начальник цеха СМР, 4 гр. по электробезопасности до 1000 В., ответственный по ТБ, ОТ и ПБ, по пром. безопасности (<span class=\"ResumeMain_error m_mistake_word\">Б</span>, <span class=\"ResumeMain_error m_mistake_word\">Б</span>-1, <span class=\"ResumeMain_error m_mistake_word\">Б</span>-2-3).- ООО &laquo;Сервис Центр&raquo;Специальность: Главный инженер, ответственный по ОТ, ТБ и ПБ, ООС, 2009 <span class=\"ResumeMain_error m_mistake_word\">г</span>.</p>'),
(616, 'b34a5565-0e82-11e7-a035-736ab11edb0c', 78, NULL, 112, 'специалист по исполнительному производству, специалист по социальной работе, помощник юриста.', '2017-03-22', 'юридический', '[B]', 'Российская Федерация', '2017-05-15', ' ', 5, 25000, '<p>Работа с большим количеством исполнительных производств (25000 ип). Высокие показатели по фактическому окончанию ип. Профессионал в своей области.&nbsp;</p>', '<p>Русская, грамотная речь и письмо. Трудолюбива, дисциплинирована, собрана. Повышенное чувство ответственности. Умение работать в режиме многозадачности с большим объемом документации, с большим потоком граждан. Стрессойстойчива, соблюдаю корпоративную культуру, с уважением отношусь к людям, патриот своей страны. Общительна, тактична.</p>', 'Полная занятость', 'Нет', '04cb89a0-fe9c-11e6-b9e2-037acc02728d', 'Готов к переобучению', '<p>Отличное отношение с коллегами, начальством. Общественная нагрузка по обеспечению отдела оргтехникой и канцтоварами. Люблю спорт (мастер спорта по фигурному катанию), музыку (музыкальная школа), книги, не курю, люблю свой город. Увлекаюсь психологией.</p>', 'Готов к командировкам', '<p>Государственный чин-юрист 1-го класса. Сертификат педагога дополнительного образования.</p>'),
(617, 'c57f9550-3971-11e7-a1ca-ef76bd2a03c1', 78, NULL, 101, 'инструктор методист по лечебной физкультуре', '2017-05-15', 'юридический', '[B]', 'Российская Федерация', '2017-05-15', ' ', 0, 25000, '<p>Разработка методических рекомендаций, составление графика занятий, подбор музыкального сопровождения.&nbsp;Проведение групповых занятий с детьми разного возраста, по оздоровительной физической культуре. Формирование групп по возрасту, Ведение отчетной и учетной документации. Учет инвентаря. Обучение инструкторов. Составление и проведение индивидуальных комплексов упражнений.Знание методик проведения занятий по лечебной физкультуре, показания и противопоказания к проведению занятий по лечебной физкультуре, основыанатомии, физиологии и психологии.Коммуникабельность, деликатность, доброжелательность, индивидуальный подход к клиентам, повышенной чувство ответственности, творческие способности.Грамотная речь. Уверенный пользователь ПК, работа с оргтехникой. Навыки оказания первой медицинской помощи, умение обращаться с аппаратом по измерению артериального давления.</p>', '<p>Русская, грамотная речь и письмо. Трудолюбива, дисциплинирована, собрана. Повышенное чувство ответственности. Умение работать в режиме многозадачности с большим объемом документации, с большим потоком граждан. Стрессойстойчива, соблюдаю корпоративную культуру, с уважением отношусь к людям, патриот своей страны. Общительна, тактична.</p>', 'Полная занятость', 'Нет', '04cb89a0-fe9c-11e6-b9e2-037acc02728d', 'Готов к переобучению', '<p>Отличное отношение с коллегами, начальством. Общественная нагрузка по обеспечению отдела оргтехникой и канцтоварами. Люблю спорт (мастер спорта по фигурному катанию), музыку (музыкальная школа), книги, не курю, люблю свой город. Увлекаюсь психологией.</p>', 'Готов к командировкам', '<p>Государственный чин-юрист 1-го класса. Сертификат педагога дополнительного образования по детской ритмике и лфк.</p>'),
(618, 'db31f242-6e88-11e6-aa79-736ab11edb0c', 55, NULL, 127, 'Юрисконсульт', '2016-10-19', 'Юридический', '[B]', 'Российская Федерация', '2016-08-30', ' ', 5, 15000, '<p>Уверенный пользователь ПК, знание правовых систем (Гарант, Консультант), умение работать в программах АРМ, Лотус</p>', '<p>Нацеленность на результаумение ставить четкие цели, умение планировать рабочий день, умение находить подход к каждому человеку</p>', 'Полная занятость', ' ', 'cbdedb90-6e83-11e6-aa79-736ab11edb0c', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(619, '6943c318-f1d7-11e6-bad3-ef76bd2a03c1', 61, NULL, 111, 'Продавец, разнорабочий, ветеринарно-санитарный эксперт', '2017-02-13', 'Аграрный', ' ', 'Российская Федерация', '2017-02-14', ' ', 0, 17000, ' ', '<p>Добросовестный, ответственный, без в.п.</p>', 'Полная занятость', 'Нет', '460ab120-f1d6-11e6-bad3-ef76bd2a03c1', 'Не готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(620, '5c01caf9-3444-11e5-a8c4-239645b044d5', 63, NULL, 98, 'Специалист по рекламе', '2016-10-22', 'Экономика', '[B]', 'Российская Федерация', '2015-07-27', ' ', 2, 15000, '<p>Продвинутый пользователь ПК;</p><p>Работа в программе 1С Предприятие;</p><p>Работа с MS Office/Exel;</p><p>Знание делового этикета и переписки;</p><p>Способность слышать и слушать собеседника;</p><p>Желание и способность к обучению;</p><p>Аналитический склад ума;</p><p>Хорошее знание города, пользователь 2GIS, Google Maps;</p>', '<p>Коммуникабельность;</p><p>Ответственность;</p><p>Стрессоустойчивость;</p><p>Исполнительность;</p><p>Знание делового этикета и переписки;</p><p>Грамотная речь;</p><p>Способность слышать и слушать собеседника;</p><p>Позитивная жизненная позиция.</p>', 'Полная занятость', ' ', '14095530-3442-11e5-a8c4-239645b044d5', 'Готов к переобучению', '<p>Стала победительницей конкурса ПВГУС \"Оформитель года 2013\"</p><p>Есть множество грамот и благодарственных писем за организацию различных мероприятий университета;</p><p>Была участницей \"Бизнес Инкубатор\";</p><p>Есть статьи в печатных изданиях</p>', 'Готов к командировкам', ' '),
