(629, '54312298-6a6b-11e6-a2d0-4376a32b3f45', 41, NULL, 121, 'Программист, менеджер.', '2017-06-18', 'Прикладная Информатика', ' ', 'Российская Федерация', '2016-08-25', ' ', 0, 40000, '<p>Трудолюбивый. Легко работаю как один, так и в команде. Независемо от должности не меняю отношение к людям.</p>', '<p>Порядочный, ответственный, неконфликтный. Люблю активный образ жизни.</p>', 'Полная занятость', 'Нет', '8ba649a0-6a69-11e6-a2d0-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Военный билет. За врем службы дослужился до младшего сержанта.</p>'),
