(638, '9e08576b-3111-11e5-a8c4-239645b044d5', 73, NULL, 99, 'Бухгалтер', '2017-07-14', 'Самолетостроительный', '[B]', 'Российская Федерация', '2015-09-15', ' ', 2, 15000, '<ul><li>Прием и контроль всей необходимой первичной документации по соответствующим участкам бухгалтерского учета, а так же подготовка и оформление их к последующей счетной обработке.</li><li>Отражение на бухгалтерских счетах учета всех операции, связанных с передвижением основных средств организации, товарных ценностей и денежных средств.</li><li>Составление необходимых внутренних отчетных документов.</li><li>Подготовка необходимых документов и данных по вверенным участкам бухгалтерского учета для последующего составления отчетности.</li><li>Выполнение служебных поручений непосредственного руководителя и вышестоящего руководства.</li></ul>', '<p>Знание компьютерных программ на уровне продвинутого пользователя,хорошее владение оргтехникой,целеустремленность, ответственность, общительность, внимательность, БЫСТРАЯ ОБУЧАЕМОСТЬ, коммуникабельность, ответственный и профессиональный подход к работе, грамотное&sbquo; четкое и своевременное выполнение своих обязанностей.</p>', 'Полная занятость', ' ', 'c7edecf0-310e-11e5-a8c4-239645b044d5', 'Готов к переобучению', '<p>Опыт работы в программах 1С:Предприятие 7.7, 8.0, 8.2; справочно- правовые системы Гарант, Консультант; Мicrosoft Оffice: Еxcel, Word; Клиент- банк</p>', 'Готов к командировкам', ' '),
