(658, '2d819965-9eca-11e7-98d5-736ab11edb0c', 64, NULL, 112, 'Таможенный специалист', '2017-09-21', 'Бизнеса и информационных технологий', ' ', 'Российская Федерация', '2018-02-11', ' ', 3, 15000, ' ', '<p>Внимательная, ответственная, аккуратная, усидчивая,стрессоустойчивая, исполнительная, обучаемая, пунктуальная, способна принимать ответственные решения, умение работать в команде (находить свою роль), умение доводить нужную информацию&sbquo; находить общий язык с разными слоями населения.</p>', 'Полная занятость', 'Нет', '5fa75540-8d88-11e7-9696-4376a32b3f45', ' ', ' ', 'Готов к командировкам', ' '),
(659, 'd0d16b2a-926f-11e7-9083-0f468c90bfa7', 31, NULL, 99, 'Бухгалтер', '2017-09-06', '«Белгородский государственный университет»', '[B]', 'Российская Федерация', '2017-10-26', ' ', 5, 20000, ' ', ' ', 'Полная занятость', ' ', '28c609c0-926c-11e7-9083-0f468c90bfa7', 'Готов к переобучению', '<p>Без вредных привычек</p>', ' ', ' '),
(660, '16ae0ae6-d02d-11e7-a066-e37b4be0b9ed', 1, NULL, 99, 'Специалист', '2017-11-23', 'Экономический', ' ', 'Российская Федерация', '2017-11-24', ' ', 0, 10000, ' ', '<ol><li>Дисциплинированность</li><li>Аккуратность</li><li>Исполнительность</li><li>Внимательность</li><li>Пунктуальность</li><li>Добросовесность</li><li>Быстрая обучаемость</li><li>Стрессоустойчивость</li></ol>', 'Полная занятость', ' ', '17bbd8c0-d02a-11e7-a066-e37b4be0b9ed', ' ', ' ', ' ', ' '),
(661, '1e5968bd-8f80-11e5-94c3-833b590698f7', 35, NULL, 108, 'инженер', '2017-10-25', 'Промышленная теплоэнергетика', '[B, C]', 'Российская Федерация', '2015-11-20', ' ', 10, 40000, '<p>Дополнительное образование:&bull; специалист второго уровня НАКС (КО, ОХНВП, СК, ГО);&bull; удостоверение, допуск Ростехнадзора к теплопотребляющим энергоустановкам в качестве управляющего персонала с 2010-2013;&bull; удостоверение мастера СМР в следующих областях: общие требования промышленной безопасности; химическая, нефтехимическая и нефтеперерабатывающая промышленность; металлургическая промышленность; объекты газораспределения и газопотребления; оборудование, работающее под давлением; подъемные сооружения; &bull; удостоверение по курсу: &laquo;технология и контроль качества выполнения монтажных соединений на высокопрочных болтах с контролируемым натяжением&raquo;;&bull; квалификационное удостоверение по пожарной безопасности.&bull; удостоверение работ на высоте (присвоена 3 группа);&bull; удостоверение по охране труда для руководителей и специалистов;</p>', '<p>Обладаю хорошим здоровьем и не имею вредных привычек. Я коммуникабельный, ответственный, честный, трудолюбивый, пунктуальный, находчивый, дружелюбный, упорный в достижении цели, вежливый и опрятный, стрессоустойчивый и неконфликтный. В общении с людьми очень деликатный. На меня можно положиться, я всегда доброжелателен и исполнителен. Быстро ориентируюсь в сложной ситуации, умею работать в коллективе. Легко схожусь с людьми и приспосабливаюсь к новой обстановке.  Свободно владею персональным компьютером как пользователь (MS Office, AutoCad), отличное знание оргтехники (ксерокс, принтер, сканер).</p>', 'Полная занятость', ' ', '6aa24980-789c-11e5-b25e-0163a9ae3d01', ' ', ' ', ' ', ' '),
(662, '0170755f-f086-11e6-8ba9-037acc02728d', 50, NULL, 112, 'Специалист', '2017-02-11', 'Юриспруденции', ' ', 'Российская Федерация', '2017-09-01', ' ', 8, 20000, ' ', '<p>Пунктуальность, исполнительность, ответственность, стрессоустойчивость, многозадачность.</p>', 'Полная занятость', ' ', '6855f510-f081-11e6-8ba9-037acc02728d', 'Готов к переобучению', '<p>Составление&nbsp;отчетности&nbsp; Деловая&nbsp;переписка&nbsp; 1С:&nbsp;Склад&nbsp; Работа&nbsp;с&nbsp;большим&nbsp;объемом&nbsp;информации&nbsp; MS&nbsp;Outlook&nbsp; Работа&nbsp;с&nbsp;оргтехникой&nbsp; Оприходование&nbsp;товара&nbsp; Проведение&nbsp;инвентаризаций&nbsp; Точность&nbsp;и&nbsp;внимательность&nbsp;к&nbsp;деталям&nbsp; Электронная&nbsp;почта&nbsp; Ответственное&nbsp;хранение&nbsp; Работа&nbsp;в&nbsp;команде&nbsp; Пользователь&nbsp;ПК&nbsp; Навыки&nbsp;работы&nbsp;с&nbsp;первичной&nbsp;документацией&nbsp; MS&nbsp;Office&nbsp; OpenOffice&nbsp; MS&nbsp;Excel&nbsp; Документооборот&nbsp; Делопроизводство&nbsp; Adobe&nbsp;Acrobat&nbsp; FineReader&nbsp; Контроль&nbsp;исполнения&nbsp;&nbsp;решений&nbsp; исполнение&nbsp;поручений&nbsp;руководителя&nbsp; Взаимодействие&nbsp;с&nbsp;правоохранительными&nbsp;органами&nbsp; Консультант&nbsp;плюс&nbsp; Гарант&nbsp; MS&nbsp;PowerPoint</p>', ' ', ' '),
