(699, 'e9fb9899-acca-11e6-a8e9-4376a32b3f45', 23, NULL, 101, 'фельдшер-лаборант', '2016-11-17', 'Нижнетагигильское медицинское училище', ' ', 'Российская Федерация', '2017-02-17', ' ', 16, 18000, '<p style=\"text-align: right;\">Работала на анализаторах и с компьютером.</p>', '<p>Обучаема, не конфликтна, уравновешанна.&nbsp;</p>', 'Полная занятость', 'Нет', '286054d0-acc7-11e6-a8e9-4376a32b3f45', 'Готов к переобучению', ' ', ' ', '<p>Сертификат специалиста : \"Лабораторная диагностика\"</p>'),
(700, 'fb866e11-f29c-11e6-a868-736ab11edb0c', 23, NULL, 122, 'менеджер, энергетик', '2017-02-14', 'Энергетика', '[B, C]', 'Российская Федерация', '2017-05-10', ' ', 13, 25000, '<p>Высококвалифицированный специалист; ПК, оргтехника</p><p>&nbsp;</p>', '<p>Стрессоустойчив, моральноустойчив, внимателен, аккуратен, исполнителен</p>', 'Полная занятость', ' ', '10b65920-afeb-11e6-a4c8-736ab11edb0c', 'Готов к переобучению', '<p>Обладаю всеми необходимыми качествами руководителя среднего звена</p>', ' ', ' '),
(701, 'dc6fa24d-face-11e7-9699-037acc02728d', 92, NULL, 106, 'Эколог, Инженер по охране труда и окружающей среды', '2018-01-16', '«Московский государственный университет имени М.В.Ломоносова»', '[B]', 'Российская Федерация', '2018-02-06', ' ', 1, 20000, '<p>Профессиональные навыки:Пользователь ПК,Знание природоохранного законодательства,Аналитические навыки,Водительское удостоверение категории B,Проведение презентаций,Делопроизводство,Составление отчетности,Заключение договоров,Способность обучать,Грамотная речь,Ведение переговоров,Adobe Photoshop,Работа с кассовым аппаратом,Поиск и привлечение клиентов,Телефонные переговоры,Холодные продажи,Грамотность,Прямые продажи,CRM,1С: Документооборот.</p>', '<p>Активная жизненная позиция;Грамотность;Быстрая обучаемость;Жизнерадостность;Ответственность;Внимательность;Нацеленность на результат.</p>', 'Полная занятость', 'Да', 'd0d58e40-fac4-11e7-9699-037acc02728d', 'Готов к переобучению', '<p>Учёба на географическом факультете МГУ им. М.В. Ломоносова предоставила мне большой и ценный практический опыт: продолжительное время я вела работу в лаборатории; использовала измерительные приборы различных типов; выполняла оценку вредного&nbsp; воздействия на окружающую среду; изучала геологию, животный и растительный мир южных широт и заполярья; составляла отчёты о проделанной работе; была участником постоянной командной работы. Обучение в магистратуре на отделении &laquo;Управление персоналом&raquo; и её совмещение с должностью менеджера по работе с клиентами дали мне возможность ознакомиться со всеми тонкостями трудового законодательства Российской Федерации, а также&nbsp; отточили мои лидерские и организаторские качества.</p><p>&nbsp;</p><p>2013 г. - участник конференции \"<span class=\"ResumeMain_error m_mistake_word\">Лазаревские</span>&nbsp;чтения\";2015 г. - участник конференции \"Ломоносовские чтения\";2014-2015 г.г. - участник молодёжных патриотических движений \"Сеть\" и \"Дочери офицеров\".Являлась волонтёром МГУ им. М. В. Ломоносова по экологическому благосостоянию г. Севастополя, а также волонтёром 70-ой годовщины победы.Люблю активный отдых, походы, слежу за питанием, занимаюсь благотворительностью, являюсь донором крови.Прилагаю результаты теста PAEI&nbsp;<span class=\"ResumeMain_error m_mistake_word\">Ицхака</span>&nbsp;<span class=\"ResumeMain_error m_mistake_word\">Адизеса</span>&nbsp;&laquo;Идеальный руководитель&raquo;: http://paei.denero.ru/7/q9VSxh</p>', 'Готов к командировкам', ' '),
(702, '5d4b5616-b7c8-11e7-8320-0f468c90bfa7', 73, NULL, 112, 'Специалист по работе с клиентами', '2017-10-23', 'Экономический', ' ', 'Российская Федерация', '2017-10-23', ' ', 0, 20000, ' ', ' ', 'Полная занятость', ' ', '6ec47010-b7c4-11e7-a533-9122a281f90e', ' ', ' ', ' ', ' '),
(703, 'b2b346ea-3b77-11e7-824c-4376a32b3f45', 63, NULL, 109, 'Заместитель директора по качеству', '2017-05-18', 'Экономический', '[B]', 'Российская Федерация', '2017-11-30', ' ', 16, 45000, '<p>Способен любой вид деятельности, любой компании разделить на составляющие бизнес-процессы и развивать систему функционирования.Продолжительный, положительный опыт в автомобилестроении в различных производствах (штамповка, сварка, окраска, сборка и т.д.)Целеустремленность. Пунктуальность. Активная жизненная позиция. Работа на результат. Стратегическое мышление, умение расставлять приоритеты. Стрессоустойчивость. Проведение анализа и поиск корневых причин.Проведение аудитов (аудит продукта, процесса, процессов СМК, <span class=\"ResumeMain_error m_mistake_word\">аудиты</span> третьей стороной), опыт сертификации аудиторских фирм (&laquo;ЮТАК&raquo;, ООО &laquo;БСК&raquo; (Москва), ASES (RENAULT-NISSAN) и т.д.Подготовка отчетов и разработка корректирующих мероприятий.Подготовка отчетов высшему руководству и мероприятий по приведению деятельности компании в соответствие с требованиями стандартов.Знаком и применяю на практике методику 8 D &ndash; решение вопросов качества поставок (разработанной на основе методики 8 D компании &laquo;RENAULT&raquo;), QC Story, с методом 5 С (одним из элементов производственной системы компании &laquo;TOYOTA&raquo;) и основными элементами системы &laquo;Бережливое производство&raquo;, \"5 Почему\", Ишикава, процедуры FMEA, PPAP, ANPQP.Внедрение и отслеживание основных KPI деятельности компании.Разработка и распространение на предприятии &laquo;Политики по качеству&raquo;. Развертывание целей между подразделениями, контроль и оценка результативности функционирования процессов с целью достижения корпоративных целей и выполнения миссии компании.Выполнение установленных показателей, контроль качества выпускаемой продукции и соблюдения технологической дисциплины.Разработка и внедрение стандартов предприятия, рабочих инструкций и методик. Обучение персонала. Контроль выполнения деятельности в соответствии с требованиями рабочих инструкций и стандартов предприятия.Работа с поставщиками и потребителями, решение вопросов по качеству продукции. Работа с нормативной и конструкторской документацией.Представление интересов компании во время проведения аудитов и проверок третьей стороной.Владение телефонным и деловым этикетом, опыт ведения переговоров.Высокая обучаемость. Много времени уделяю самообразованию (перспективные бизнес проекты и направления деятельности, выбор ниши, психология, маркетинг, Интернет продажи, инвестиции и т.д.)Быстро ориентируюсь в новой обстановке. Легко завожу новые знакомства.Неоднократно находился в командировках, в том числе за пределами Самарской области (Скопин, Сердобск, Балаково, Белебей, Германия и т.д.).Опыт работы на руководящих должностях более 15 лет, опыт работы в системе менеджмента качества более 13 лет.Количество подчиненных до 115 человек.Знание компьютера на уровне пользователя (Word, Excel, Paint.NET)Увлечения: спорт (баскетбол, лыжи, велоспорт), рыбалка, нумизматика, изучение английского языка (начальный уровень).Женат, сын 2006 года рождения, сын 2016 года рождения.Водительское удостоверение категории &laquo;В&raquo;, стаж вождения более 15 лет, имеется личный автомобиль.</p>', '<p>Активная жизненная позиция. Легко обучаюсь. Быстро ориентируюсь в новой обстановке. Работа на результат. Стратегическое мышление, умение расставлять приоритеты. Стрессоустойчивость. Легко завожу новые знакомства.Неоднократно находился в командировках, в том числе за пределами Самарской области (Скопин, Сердобск, Балаково, Белебей, Германия и т.д.).Опыт работы на руководящих должностях более 15 лет, опыт работы в системе менеджмента качества более 13 лет. Количество подчиненных до 115 человек.</p>', 'Полная занятость', ' ', '52048b40-3ac4-11e7-adfe-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Внутренний аудитор согласно требованиям ИСО ТУ 16949- свидетельство</p>'),
