(706, '3c0014a7-6ab2-11e6-a2d0-4376a32b3f45', 23, NULL, 127, 'юрист', '2017-07-17', 'юриспруденция', ' ', 'Российская Федерация', '2016-08-25', ' ', 6, 20000, '<p>&nbsp;Люблю работать на результат, умею работать как в команде так и индивидуально. Есть опыт работы с людьми.Уверенный пользователь ПК (программы Microsoft Word, Excel, bp, OmegaGeo, AVTOCAD) Интернет и электронной почты.</p>', '<p>активность, коммуникабельность, внимательность, ответственность, инициативность, легкообучаемость, порядочность. &nbsp;</p>', 'Полная занятость', 'Нет', '65079450-6ab1-11e6-a2d0-4376a32b3f45', ' ', '<p>Вредных привычек не имею, веду здоровый образ жизни: лыжи, коньки, ролики, прогулки на свежем воздухе с детьми. Положительно отношусь к чтению: последняя прочитанная художественная книга Р. Масси &laquo;Николай и Александра&raquo;, нормативно правовая литература - обзор проекта Федерального закона &laquo;О государственной регистрации недвижимости&raquo;.</p><p>Готова к кратковременным командировкам, обучению и повышению квалификации.</p><p>Ищу основное место работы на постоянной основе.</p>', ' ', ' '),
