(719, '0c4581c7-5ca1-11e5-a426-9370902ea73e', 54, NULL, 112, 'Экономист', '2016-10-20', '«Российский экономический университет имени Г.В. Плеханова»', '[B]', 'Российская Федерация', '2017-03-29', ' ', 12, 20000, '<p><strong>ПРОФЕССИОНАЛЬНЫЕ НАВЫКИ И ЗНАНИЯ:</strong></p><ul><li>Windows, MS Office, MS Word, Excel, PowerPoint, Internet, основы Adobe Photoshop, Internet-опытный пользователь.</li><li>\"Автоматизированная система Федерального казначейства\" (ППО АСФК), &laquo;АЦК-Финансы&raquo;, Портал УФК по КО Система удаленного финансового документооборота (СУФД), Систем электронного документооборота (СЭД), СКИФ-Терминал, Сетевой программный комплекс &laquo;Бюджет 7&raquo;, владение всеми видами орг.техники.</li><li>Знание 1С торговля и склад, 1С зарплата и кадры (Менеджер по персоналу).</li><li>Делопроизводство.</li></ul>', '<p><strong>ЛИЧНЫЕ КАЧЕСТВА:</strong></p><ul><li>Ответственность, лидерство, гибкость, коммуникабельность, уравновешенность, решительность, находчивость, оптимизм, стратегическое мышление, быстрая оценка ситуации и принятие самостоятельного решения, целеустремленность, энергичность, стойкость в стрессовых ситуациях, активная жизненная позиция, инициативность, нацеленность на результат, организаторские способности, пунктуален, дипломатичен.</li><li><ul><li>Быстрая обучаемость.</li><li>Способен создать, организовать и мотивировать коллектив. Не боюсь взять на себя ответственность.</li><li>Готов к командировкам и ненормированному рабочему дню.</li><li>Готов к работе в команде и индивидуально. Выполняю работу в срок (способен четко оценить сроки выполнения задачи).</li></ul><p>&nbsp;</p></li></ul><p><strong>ПРОЧИЕ:</strong></p><ul><li>Семейное положение- холост</li><li>Водительские права категории \"B\".</li></ul>', 'Полная занятость', ' ', '8083b9a0-5c9f-11e5-a426-9370902ea73e', ' ', '<p>Готов к разнообразной и интересной работе, рекомендательные письма, характеристики и другую подробную информацию готов выслать по запросу на Вашу электронную почту.</p>', 'Готов к командировкам', '<ol><li>Классный ЧИН Референт Государственной Гражданской службы Кемеровской области 2 класса</li><li>Удостоверение &laquo;Менеджер по персоналу с изучением программы 1С: Зарплата и кадры&raquo; от 15.10.2010г.</li><li>Сертификат (участие в семинаре, 8 ак. часов) от &laquo;17&raquo; мая 2016г., Планирование закупок товаров, работ, услуг для обеспечения государственных и муниципальных нужд на 2017 и последующие годы&raquo;, выданный ОЦ ООО Новатор Алтайский край, г. Бийск.</li></ol>'),
