(726, '44ee2686-c90f-11e7-8320-0f468c90bfa7', 70, NULL, 113, 'Химик', '2017-11-14', 'Химический', ' ', 'Российская Федерация', '2017-12-07', ' ', 0, 20000, 'Опыт работы в химической лаборатории 6 лет. Определение структурно-механических свойств нефтей: проведение реологических исследований, подбор депрессорных и ингибирующих присадок для нефтей и нефтепродуктов, определение группового и индивидуального состава нефтей. Знание инструментальных методов исследования: элементный анализ, ИК-спектроскопия, хроматомасс-спектрометрия, оптическая микроскопия.', 'Личные качества: ответственность, коммуникабельность, открытость для новых идей, умение работать в команде, работа на результат. Без вредных привычек. Опытный пользователь ПК (работа с программами MS Office, Chem Office, Rheocalc, Zen, Corel Draw, Origin)', 'Полная занятость', 'Нет', '0a2bb090-c90e-11e7-a533-9122a281f90e', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(727, 'f5e8f0fa-0014-11e8-a659-e37b4be0b9ed', 35, NULL, 126, 'помощник юриста, секретарь,менеджер,делопроизводитель', '2018-01-23', 'НОУ СПО «Череповецкий торгово-экономический колледж»', '[B]', 'Российская Федерация', '2018-01-23', ' ', 4, 15000, '<ul><li>Уверенный пользователь ПК;</li><li>Знание информационных правовых систем &laquo;Консультант Плюс&raquo; и &laquo;Гарант&raquo;;</li><li>Навыки работы в программах Microsoft Word, Microsoft Excel.</li><li>Умение работать с большим объёмом документов, корреспонденцией, денежными средствами и первичными бухгалтерскими документами;</li><li>Умение организовать работу небольшого коллектива.</li></ul>', '<ul><li>Самоорганизованность;</li><li>Нацеленность на&nbsp;результат;</li><li>Грамотная устная и&nbsp;письменная речь;</li><li>Коммуникабельность, стрессоустойчивость, аккуратность, педантичность;</li><li>Стремлюсь получать новые знания в различных сферах деятельности;</li><li>Не имею вредных привычек, веду здоровый образ жизни;</li><li>Хобби&nbsp;&mdash; в свободное время предпочитаю активный отдых,&nbsp; велопрогулки на природе с семьей, посещаю &nbsp;бассейн, читаю классическую литературу, люблю готовить;</li><li>Готовность получать новые знания и стремление достигнуть всех поставленных целей.</li></ul>', 'Полная занятость', 'Нет', '7a807390-0012-11e8-a659-e37b4be0b9ed', 'Готов к переобучению', '<p>В настоящее время заканчиваю обучение по специальности &laquo;Юриспруденция&raquo; в НОЧУ ВО &laquo;Московский&nbsp;финансово-промышленный&nbsp;университет &laquo;Синергия&raquo;, хочу &nbsp;работать в успешной компании. Предпочтение отдаю вакансиям в сфере обеспечения безопасности, администрировании. Легко нахожу общий язык с людьми, могу убеждать. Умею организовать свое рабочее и личное время, поскольку обладаю хорошей памятью, высокой работоспособностью. Могу отстоять свою точку зрения, ввиду природного упорства и целеустремленности. Быстро обучаюсь и ответственно подхожу к решению поставленных руководством задач.</p><p>Готова стать достойным представителем Вашей компании!</p>', 'Готов к командировкам', '<ul><li><strong>2014&nbsp;г. ЧОП &laquo;Аквилон&raquo;, </strong>охранник 4 разряда;</li></ul>'),
