(765, '64be3469-e575-11e6-90cd-ef76bd2a03c1', 24, NULL, 125, 'учитель математики', '2017-01-28', 'физ-мат', '[B]', 'Российская Федерация', '2017-01-30', ' ', 6, 22000, '<p>Опытный пользователь: MS Office (Word, Exсel, Power Point, Access, Outlook), навыки работы с Интернетом (Internet Explorer, Opera, Mozilla Firefox) и электронной почтой (Outlook Express), графическими редакторами (Photoshop, CorelDRAW)</p>', '<p>Быстро усваиваю новую информацию;желание работать выполнения поставленных задач;умение согласованно работать в коллективе;целеустремленность в достижении поставленных целей; энергичность; вежливость; жизнерадостность;хорошие организаторские способности.</p>', 'Полная занятость', 'Да', '47cffe10-e570-11e6-90cd-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
