(769, '411a66fe-0b62-11e8-ad4f-736ab11edb0c', 23, NULL, 107, 'Администратор', '2018-02-06', 'Факультет иностранных языков', '[B]', 'Российская Федерация', '2018-02-07', ' ', 24, 40000, '<p><strong>Знание ПК на уровне опытного пользователя, опыт работы в текстовых редакторах, с электронными таблицами, Интернетом, базами данных. Есть домашний ПК.</strong></p><p><strong>Навыки использования организационной техники &ndash; ксерокс, сканер, факс-модем, факс.</strong></p>', '<p>При выборе работы наибольшее значение имеет: приобретение нового опыта и знаний, материальное вознаграждение.Быстрая оценка ситуации и принятие решений, эффективное ведение переговоров на различном уровне, умение убеждать, коммуникабельность, мобильность,организаторские способности, умение работать самостоятельно и в команде, ориентированность на результат.Уверена в себе, свойственна явная, но не крайняя&nbsp; степень независимости мыслей и поступков.&nbsp; Очень рациональна, практична. Несколько подозрительна и не склонна доверять окружающим. Стремлюсь к положительным результатам без высокой заорганизованности работы. Предпочитаю иметь дело с реальными и конкретными проблемами.</p><p>Имею водительские права категории &laquo;В&raquo;, стаж активного вождения 25 лет.</p>', 'Полная занятость', ' ', 'e0ff2df0-8358-11e7-851f-4376a32b3f45', 'Готов к переобучению', ' ', ' ', ' '),
