(780, '76ce5a97-7d57-11e5-b17c-239645b044d5', 86, NULL, 127, 'помощник юриста, юрист.', '2017-07-19', 'Юриспруденция', '[A, B, C]', 'Российская Федерация', '2015-10-28', ' ', 0, 25000, ' ', '<p>Веду активную образ жизни, стремлюсь быть успешным во всех начинаниях, способен разложить ситуацию на составляющие и взглянуть на нее с разных точек зрения, в короткие сроки обучаюсь новыми знаниям, внимательно отношусь к процессу выполнения задач, проявляю упорство в достижении поставленных целей, нацелен на получение результата от выполняемой работы.&nbsp;</p>', 'Полная занятость', 'Да', 'adb78ac0-7d54-11e5-b17c-239645b044d5', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
