(782, '2e448078-8273-11e6-86ca-736ab11edb0c', 34, NULL, 101, 'Медицинская сестра. Начинающий специалист.', '2017-06-17', 'Институт естественных наук', ' ', 'Российская Федерация', '2016-09-26', ' ', 0, 10000, '<p>Выполнение сестринских манипуляций в соответствии с алгоритмами. Готовность к дополнительному обучению.</p>', '<p>Ответственность, честность, доброжелательность, коммуникабельность.</p>', 'Частичная занятость', 'Нет', 'ded4b9d0-8270-11e6-86ca-736ab11edb0c', 'Готов к переобучению', '<p>Последнее время проходила обучение без возможности работать. В настоящее время являюсь начинающим специалистом в области медицины ( \"Медицинская сестра\"), кроме того являюсь студенткой очного отделения ВолГУ по направлению \"Биология\" института естественных наук.</p>', 'Готов к командировкам', '<p>Действующий сертификат специалиста &nbsp;по направлению \"Медицинская сестра\"</p>'),
(783, '1bacb29d-5bc0-11e6-a33c-4376a32b3f45', 77, NULL, 128, 'Аудитор, эколог, специалист в области земельных отношений', '2017-08-02', 'Географический', '[B]', 'Российская Федерация', '2017-11-01', ' ', 10, 50000, '<ul><li>Уверенный пользователь ПК, Microsoft Office, системы электронного документооборота Эффект Офис, умение работать с юридической базой (Консультант Плюс, Гарант);</li><li>Опыт работы в сфере экологии, земельных отношений (знание законодательства РФ);</li><li>Опыт подготовки материалов для судебных разбирательств (земельные споры), переговоров с землепользователями;</li><li>Грамотность, опыт ведения переписки по различным направлениям;</li><li>Опыт работы в команде, коммуникабельность;</li></ul>', '<ul><li>Дисциплинированность, исполнительность, ответственность;</li><li>Способность принимать решения;</li><li>Коммуникабельность;</li><li>Стрессоустойчивость;</li><li>Способность осваивать новые направления, обучаемость.</li></ul>', 'Полная занятость', 'Нет', '3729d940-5bb0-11e6-a33c-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
