(825, '5f6b29b5-c521-11e6-acfd-037acc02728d', 77, NULL, 110, 'Машинист буровой установки', '2016-12-18', 'Муниципальная вечерняя (сменная) общеобразовательная школа 31', '[B]', 'Российская Федерация', '2016-12-26', ' ', 5, 140000, '<p>Имею опыт работы, бурения скважин под массовый взрыв на нефте-газо трассах в карьерах по добыче не рудных материалов, рудных полезных ископаемых.</p><p>Целеустремленность, выдержка, выносливость, каммуникабельность. &nbsp;Легкообучаем &nbsp;</p>', '<p>Доброта, порядочность</p>', 'Полная занятость', 'Нет', 'b45d7e70-c515-11e6-acfd-037acc02728d', 'Готов к переобучению', '<p>Присутствует желание работать, желание зарабатывать. Очень хочется работать в стабильной успешной компани</p>', 'Готов к командировкам', '<p>Удостоверение машиниста буровой установки</p><p>Удостоверения машинист-тракторист \"Е\" категории (гусеничные машины с двигателем мощностью свыше 25,7 кВт)</p>'),
(826, '05e8e139-c07a-11e6-8328-4376a32b3f45', 2, NULL, 115, 'Водитель \"В С\"', '2016-12-12', 'общая физика', '[B, C]', 'Российская Федерация', '2017-12-12', ' ', 5, 70000, '<p>Отличное вождение автомобиля в условиях бездорожья, &nbsp;разбираюсь в технике,&nbsp;бережная эксплуатация, обслуживание и ремонт доверенной техники.&nbsp;</p>', '<p>Дисциплинированность</p><p>Пунктуальность</p><p>Ответственность</p><p>Быстрообучаемость</p><p>Морально и физически устойчив&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'Полная занятость', ' ', '104bdea0-b087-11e6-ab05-037acc02728d', 'Готов к переобучению', '<p>Военную службу проходил в ремонтном взводе, водителем автомобиля &nbsp;Урал&nbsp;и Камаз. Возил боеприпасы, личный состав. Ремонтировал военную технику( автомобили Урал,Камаз, Зил, Уаз, бтр-60, газ-66, БРЭМ-1, БРЭМ-Ч.&nbsp;</p><p>Есть опыт работы на севере (респ. Коми). Работал 4 вахты монтажником (монтаж и демонтаж буровых установок).</p>', 'Готов к командировкам', ' '),
(827, 'c0d709b9-500b-11e7-8cfa-736ab11edb0c', 86, NULL, 108, 'монтажник наружных трубопроводов; газорезчик (плазма)', '2017-06-13', 'средняя школа №42 город Тараз Республика Казахстан', '[B, C, D, E]', 'Российская Федерация', '2017-10-01', ' ', 13, 50000, ' ', '<p>внимательность, бдительность, осторожность,&nbsp; наблюдательность, предусмотрительность, уравновешенность.</p>', 'Полная занятость', ' ', '79aa2be0-500a-11e7-8cfa-736ab11edb0c', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(828, '756d17cc-00d4-11e7-b9e2-037acc02728d', 54, NULL, 105, 'Помощник машиниста электровоза', '2017-03-04', 'ПЛ 10 им.Н.А. Лунина (Новосибирск)', ' ', 'Российская Федерация', '2017-03-20', ' ', 2, 25000, ' ', '<p>Ответственность, работоспособность, стрессоустойчивость, умение ставить и добиваться своих целей, Владение пк уровень пользователь, имеется 3 группа по электробезопастности.</p><p>&nbsp;</p>', 'Полная занятость', ' ', '86b85640-f754-11e6-b2a1-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(829, '19900a6a-bb1f-11e7-89cf-e37b4be0b9ed', 2, NULL, 110, 'Инженер по охране труда', '2017-10-27', 'ГНФ', '[B]', 'Российская Федерация', '2017-10-28', ' ', 3, 80000, ' ', '<p>Обладаю математическим складом ума.Способен работать с большим колличеством информации. Кандидат в мастера спорта по настольному теннису.</p>', 'Полная занятость', 'Да', '7cbe8020-bb1b-11e7-89cf-e37b4be0b9ed', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(830, 'f05d6606-0d5a-11e7-94b6-0f468c90bfa7', 23, NULL, 101, 'Мастер маникюра', '2017-03-20', ' ', ' ', 'Российская Федерация', '2017-03-20', ' ', 0, 25000, ' ', ' ', 'Полная занятость', 'Нет', '3e3f3670-0d59-11e7-94b6-0f468c90bfa7', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
