INSERT INTO `resumes` (`id`, `cv_id`, `region_id`, `profession_id`, `industry_id`, `position_name`, `creation_date`, `education_list`, `drive_licence_list`, `country`, `publish_date`, `schedule_type_list`, `experience`, `salary`, `skills`, `additional_skills`, `busy_type`, `relocation`, `candidate_id`, `retraining_capability`, `other_info`, `business_trips`, `add_certificates`) VALUES
(832, '4bbffc99-0219-11e6-a555-037acc02728d', 37, NULL, 97, 'Менеджер по продажам', '2017-01-06', 'Ивановский энергетический колледж', '[B]', 'Российская Федерация', '2017-08-01', ' ', 24, 30000, '<p>Знание техники продаж, ценообразования и формирования спроса, развитые коммуникативные навыки , способность работы в команде .</p>', '<p>Активный , коммуникабельный , целеустремленный , обязательный , быстрая обучаемость , неконфликтный .Считаю себя перспективным специалистом, который может быть полезным и востребованным для компании. Обладаю для этого всеми необходимыми качествами: лояльность и соблюдение интересов компании, терпение, усидчивость, стремление к достижению поставленных целей, надежность. Ответственно отношусь к служебным обязанностям, всегда приду на помощь коллегам и навстречу руководителю. Готов вложить свои усилия в компанию, которая так же лояльно относится к своим специалистам и готова вкладываться в их развитие. Я предпочитаю долгое и плодотворное сотрудничество</p>', 'Полная занятость', 'Нет', '686da810-ff58-11e5-9aa0-736ab11edb0c', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(833, 'ebad20d7-83fb-11e5-8d54-833b590698f7', 70, NULL, 112, 'Психолог', '2017-06-16', 'Психология', '[B]', 'Российская Федерация', '2015-11-06', ' ', 0, 15000, '<p>Являюсь практикующим психологом, постоянно развиваюсь и осваиваю новые научные методики, и поэтому, смогу квалифицированно осуществлять свою деятельность во благо развития&nbsp; организации работодателя</p><p>&bull; Многолетний работы психологом, в том числе проведение групповых и личных психокоррекций и on line консультирование. </p><p>&bull; Опыт работы с кадрами ( инспектор отдела кадров), также периодическое оказание услуг и консультирования в сфере управления персоналом на базе фриланса.</p><p>&bull; Опыт в обработке резюме, проведение собеседований с кандидатами, в том числе на основе классических методик и новейших разработок в области психологии и нейролингвистического программирования.</p><p>&bull; Готовность к поддержанию и развитию системы обучения и развития персонала и участию в разработке систем адаптации и мотивации персонала. Осуществление психодиагностических исследований социально- психологического климата коллектива и составление индивидуальных психологических портретов.</p><p>&nbsp;</p>', '<p>Коммуникабельность, ответственность, стрессоустойчивость,целеустремленность, дипломатичность, знание делового этикета, грамотная и квалифицированная речь.</p>', 'Полная занятость', ' ', '891358b0-83f9-11e5-8d54-833b590698f7', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(834, 'e626516a-bb8a-11e5-9eda-0163a9ae3d01', 30, NULL, 128, 'сантехник монтажник', '2017-07-02', 'РОСТО АСТРАХАНСКОЙ ОБЛАСТИ', ' ', 'Российская Федерация', '2016-01-17', ' ', 4, 60000, '<p>могу и хочу работать</p>', '<p>пью редко . дисциплинирован. ответственный. комуникабельный. быстро нахожу общий язык с людьми&nbsp;</p>', 'Полная занятость', 'Нет', 'b8f4bab0-ba04-11e5-9eda-0163a9ae3d01', 'Готов к переобучению', '<p>в сму 17 работал по трудовому договору. уволился из-за того что началось простое \"кидалово\". В \"Альтаир строе\" работал вахтой 15/15 но фирма развалилась(опять таки работал по трудовому договору). В \"КОНЦЕРНЕ СТРОИТЕЛЬНЫЕ ЗАВОДЫ\" РАБОТАЛ 4 месяца по трудовому договору. строили обьект в Якутии. уволился по окончанию строительства.&nbsp;</p><p>&nbsp;Я ОЧЕНЬ ПРОШУ НЕ ДЕЛАТЬ ОКОНЧАТЕЛЬНЫХ ВЫВОДОВ ПРИ ПРОСМОТРЕ МОЕГО РЕЗЮМЕ.Я РАБОТУЮ ЧЕСТНО И НЕ С ОДНОЙ ФИРМОЙ МЕНЯ НЕ УВОЛЬНЯЛИ ЗА ХАЛАТНОСТЬ И НЕБРЕЖНОЕ ОТНОШЕНИЕ К РАБОТЕ. В ПРОМЕЖУТКАХ МЕЖДУ РАБОТОЙ В ОРГАНИЗАЦИЯХ Я БРАЛ ПОДРЯДЫ НА РЕМОНТ БОЛЬНИЦ ШКОЛ И ДЕТСАДОВ. ( ЗАМЕНА САНТЕХОБОРУДОВАНИЯ И ЗАМЕНА ТРУБ. А ТАКЖЕ УСТАНОВКА РАДИАТОРОВ ОТПЛЕНИЯ)</p>', 'Готов к командировкам', ' '),
