(842, '37eafc70-9328-11e5-8929-833b590698f7', 24, NULL, 115, 'Кондуктор', '2017-07-08', 'Школа 8', '[B]', 'Российская Федерация', '2015-11-25', ' ', 1, 15000, ' ', '<p>коммуникабельность</p>', 'Полная занятость', ' ', 'e7550ff0-9262-11e5-8929-833b590698f7', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(843, '0bf71909-5d66-11e7-b349-037acc02728d', 50, NULL, 126, 'административный (исполнительный) директор, руководитель, заместитель руководителя.', '2017-06-30', 'воспитательный', '[B, C]', 'Российская Федерация', '2017-11-01', ' ', 5, 150000, '<p>Умею и люблю работать с людьми. Руководя, воинскими и трудовыми коллективами, всегда добивался качественного выполнения всех поставленных руководством задач точно и в срок.</p>', '<p>Исполнительный, добросовестный, честный, не ворую и не предаю.</p>', 'Полная занятость', 'Да', '07922320-5d64-11e7-b349-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(844, 'f49d24f8-df82-11e5-935e-7de68f1c536d', 77, NULL, 112, 'Ведущий специалист', '2018-02-15', 'юриспруденция', ' ', 'Российская Федерация', '2016-03-28', ' ', 7, 30000, '<p>Весь опыт работы мой складывается из постоянного общения с абсолютно разными людьми, и поэтому у меня большой опыт делового общения с клиентами а также оформления документов. Хорошо владею ПК и офисной техникой. Умею работать в режиме многозадачности. К работе отношусь внимательно и с полной ответственностью.</p>', '<p>Вежливость,честность,уверенность в себе,коммуникабельность.</p>', 'Полная занятость', 'Нет', 'e6319d40-df7f-11e5-935e-7de68f1c536d', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
