(866, '7ce5cc79-a343-11e6-af05-0f468c90bfa7', 86, NULL, 116, 'Продавец-кассир', '2016-11-07', ' ', ' ', 'Российская Федерация', '2017-05-09', ' ', 0, 23000, '<p>Быстро обучаюсь, выполняю поставленные задачи,&nbsp;</p>', '<p>Дружелюбная, добрая, пунктуальная&nbsp;</p>', 'Полная занятость', 'Нет', 'f2fbce60-a33d-11e6-af05-0f468c90bfa7', 'Готов к переобучению', '<p><span style=\"text-decoration: underline;\">У меня есть необходимые навыки , которые вы ищите это: выносливость, быстрая обучаемость, комунекабельность, стараюсь выполнять поставленную работу на 100%,и я уверена что отлично подхожу вам. Помимо этого, мне очень нравиться эта сфера &nbsp;деятельности и всегда хотела в ней работать, я обеспечиваю выполнение работы высокого качества.</span></p>', 'Не готов к командировкам', ' '),
(867, 'bda2fd89-6e76-11e5-b4c7-239645b044d5', 31, NULL, 101, 'Заведующий аптечным пунктом', '2017-06-17', 'Фармацевтический', ' ', 'Российская Федерация', '2017-08-01', ' ', 7, 22000, '<p>Знаю:</p><ul><li>законы РФ и другие нормативно-правовые акты по вопросам здравоохранения и фармацевтики;</li><li>критерии и показатели, характеризующие обеспечение потребителей лекарст&shy;венными препаратами;</li><li>теоретические и организационные основы фармацевтического дела;</li><li>установленный федеральным органом исполнительной власти в сфере здравоохранения минимальный ассортимент лекарственных средств, необходимых для оказания медицинской помощи;</li><li>порядок ценообразования;</li><li>основы экономики, организации труда и управления;</li><li>законодательство о труде РФ;</li><li>правила и нормы охраны труда, техники безопасности, производственной санитарии и противопожарной защиты;</li></ul><p>Имею:</p><p>&bull; Опыт работы на спектрофотометре&bull; Опыт применения высокоэффективной жидкостной хроматографии&bull; Качественный и количественный химический анализ субстанций и лекарственных средств&bull; Управление трудовым коллективом&bull; Контроль качества лекарственных средств</p>', '<p>способность логично выстраивать аргументацию и предоставлять ее с учетом максимальной выгоды для клиента; - умение преодолевать сопротивление клиента и добиваться его осознанного согласия на сотрудничество; - наличие эффективных навыков активного слушания и расспроса; - умение вести диалог в конфликтных ситуациях; - умение убеждать; - обширные знания фармацевтических препаратов, их качеств и спрос на рынке; - работа с документацией; - проведение переговоров и заключение договоров на поставку продукции;  - взаимодействие с государственными структурами;</p>', 'Полная занятость', ' ', '6b34bb60-6e5d-11e5-a367-833b590698f7', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
