(876, 'e3876a19-97dc-11e5-b140-0163a9ae3d01', 24, NULL, 99, 'главный бухгалтер', '2017-07-13', '«Сибирский государственный технологический университет»', '[B]', 'Российская Федерация', '2015-12-05', ' ', 12, 40000, '<p>работа с договорами, составление доп. соглашений;- подготовка бюджетов годовых и прогнозных (на месяц), контроль исполнения бюджетов, анализ отклонений;- подготовка и предоставление отчетов в органы статистики;- ведение кадровой работы, делопроизводства;- учет рабочего времени, учет расчетов с персоналом по оплате труда, начисление, удержание и перечисление налогов и взносов во внебюджетные фонды и ИФНС;- предоставление отчетности в Пенсионный фонд РФ, в ФСС;- учет основных средств;- учет товарно-материальных ценностей;- проведение и учет результатов инвентаризации; - учет денежных средств и расчеты с подотчетными лицами; - взаимодействие с налоговыми органами, фондами;- учет операций с покупателями и поставщиками товаров и услуг, сверка взаиморасчетов с составлением актов сверки, отражение на счетах б/учета операций, связанных с оказанием услуг от поставщиков, ведение журнала полученных счетов-фактур, инвентаризация дебиторской и кредиторской задолженности;- учет реализации услуг; - учет затрат;- расчет, составление отчетности и перечисление налога на имущество, транспортный и земельный налоги, налог на прибыль, НДС, ЕНВД, УСН;- оптимизация налогообложения;- ведение управленческого учета;- подготовка пакета документов в банк для кредитования, составление отчетности для банков;- подготовка пакета документов для получения субсидий;- учет финансовых результатов;- составление промежуточной и годовой бухгалтерской отчетности;- опыт прохождения проверки количественно - качественной сохранности зерна государственного интервенционного фонда, а так же ФС финансово-бюджетного надзора по целевому использованию субсидий, выездной проверки ФСС и ПФ, проверка банком и ИФНС кассовой дисциплины, выездная налоговая проверка, проверки внутреннего аудита. При проверках отклонений по ведению бухгалтерского и налогового учета не были выявлены; - опыт возмещения НДС из бюджета;- опыт ведения нескольких юр. лиц.</p>', '<p>ответственна, целеустремленна, дисциплинированна, любознательна, исполнительна, коммуникабельна, легко обучаема, заинтересована в повышении профессионального и карьерного роста</p>', 'Полная занятость', 'Да', '3a201040-97db-11e5-b140-0163a9ae3d01', ' ', ' ', 'Готов к командировкам', ' '),
