(915, 'b5351dca-157a-11e7-9b2c-736ab11edb0c', 50, NULL, 101, 'Врач - хирург', '2017-03-30', 'Медико-биологический', '[B]', 'Российская Федерация', '2017-03-31', ' ', 3, 50000, '<p>Прием пациентов хирургического, колопроктологического, сосудистого, гастроэнтерологического, урологического профилей в условиях стационара и поликлиники, в том числе оказание неотложной помощи. Выполнение манипуляций и оперативных вмешательств в условиях перевязочной и операционной. Назначение консервативного лечения хирургическим больным с учётом тяжести и рисков основного и сопутствующих заболеваний.</p><p>Самостоятельно выполняемые &laquo;большие&raquo; оперативные вмешательства:</p><p>- вскрытие и дренирование флегмон различных локализаций.</p><p>- операции при травматических повреждениях органов грудной клетки.</p><p>- операции на брюшной стенке и органах брюшной полости: грыжесечения с пластикой местными тканями и аллопластикой при свободных и ущемленных грыжах различной локализации; ушивания перфоративных язв желудка и 12-перстной кишки, травматических повреждениях указанных органов; наложение гемостатических швов при повреждениях&nbsp; печени; спленэктомия; резекции тонкой и толстой кишки с наложением анастомозов и/или выведением стом; аппендэктомия; адгезиолизис, холецистэктомия;</p><p>- прочие операции: деторсия яичка с орхипексией, кроссэктомия, ампутации верхних и нижних конечностей на различных уровнях</p>', '<p>Ответственность, доброжелательность, умение работать индивидуально и в коллективе, энтузиазм и желание профессионально развиваться, неформальный подход к работе.</p>', 'Полная занятость', ' ', 'b84b17b0-1577-11e7-9b2c-736ab11edb0c', ' ', ' ', ' ', '<p>Член Российского Общества Хирургов, регулярный слушатель конференций, мастер-классов.</p><p>Уверенный пользователь ПК: интернет, электронная почта, офисные программы, электронная база данных &laquo;ИНТЕРИН&raquo; (электронная история болезни), \"ЕМИАС\".</p>'),
