(952, '5fa8c074-7af1-11e5-b25e-0163a9ae3d01', 77, NULL, 101, 'Ретнгенлаборант', '2017-07-27', 'Кибернетика', '[B]', 'Российская Федерация', '2015-10-25', ' ', 4, 20000, '<p>Навыки рентгенлаборанта (работа на цифровом и аналоговом рентгеновском аппарате, маммографе, флюорографе, денситометре. Использование автоматической проявочной машины). Компьютер на уровне продвинутого пользователя.</p>', '<p>Трудолюбие, добросовестность, бесконфликтность, терпение, доброжелательность, исполнительность.</p>', 'Полная занятость', ' ', '8a0862f0-6ad2-11e5-a7c5-833b590698f7', ' ', ' ', ' ', ' '),
(953, 'f3e06dc7-3040-11e5-a8c4-239645b044d5', 66, NULL, 112, 'секретарь суда', '2017-06-16', 'Исторический', ' ', 'Российская Федерация', '2015-07-22', ' ', 26, 12000, '<p>Свободно владею персональным компьютером как пользователь&nbsp;</p>', '<p>аккуратность, активность, доброжелательность, внимательность, коммуникабельность, добросовестность, исполнительность, нацеленность на результат, оптимизм, неконфликтность, пунктуальность, порядочность, отзывчивость,&nbsp; честность, целеустремленность. Без вредных привычек.</p>', 'Полная занятость', ' ', 'a4f3e0e0-303e-11e5-a8c4-239645b044d5', 'Готов к переобучению', ' ', ' ', ' '),
