(955, 'f3180a17-c6a2-11e7-a62f-736ab11edb0c', 64, NULL, 128, 'ооо сэпо -зэм', '2017-11-11', 'пу49', ' ', 'Российская Федерация', '2017-11-13', ' ', 4, 16000, ' ', ' ', 'Полная занятость', 'Нет', 'af23fb00-c69f-11e7-a62f-736ab11edb0c', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(956, '4e55c613-e002-11e7-812e-736ab11edb0c', 77, NULL, 125, 'Преподаватель эстрадного и джазового вокала', '2017-12-13', 'Государственное музыкальное училище эстрадного и джазового искусства', ' ', 'Российская Федерация', '2017-12-13', ' ', 5, 30000, '<p>Преподаю эстрадно-джазовый вокал уже 5 лет. За время своего преподавания мои ученики стали дипломатами и лауреатами различных всероссийских и международных вокальных конкурсов. Также сам являюсь лауреатом многих вокально-эстрадных конкурсов разных уровней. К каждому своему ученику я подбираю индивидуальную методику преподавания, так как голос каждого человека уникален.Моя задача научить своего ученика петь красиво и, самое главное, правильно. Я могу заниматься как и с начинающими вокалистами, так и с более продвинутыми. В процессе обучения я использую методики многих современных музыкальных школ, также использую методику старой итальянской школы, что, в свою очередь, помогает более точно и правильно достигать желаемых результатов во всех стилях эстрадного и джазового пения. Для каждого своего ученика я подбираю определенный метод преподавания, так как у каждого человека голосовой аппарат уникален и нужно так же уникально и индивидуально подобрать метод, с которым мы будем работать. Помимо вокала есть возможность пройти общую музыкальную подготовку.</p>', '<p>Работа нацеленная на результат, комуникабельность, доброжелательное отношение к людям, стрессоустойчивость, пунктуальность.</p>', 'Полная занятость', 'Нет', '21909460-dffe-11e7-812e-736ab11edb0c', 'Готов к переобучению', '<p style=\"text-align: center;\">Мои достижения:&bull; Всероссийский конкурс вокалистов \"Super star\" г. Ульяновск 2009г. Диплом 2 степени (В номинации эстрадное пение);&bull; Шоу конкурс \"Звездная дорожка. Третий сезон\" г. Ульяновск 2009г. Диплом Лауреата;&bull; Областной конкурс исполнителей эстрадной песни \"Весенняя капель\" г. Ульяновск 2009г. Диплом лауреата 2 степени;&bull; Областной конкурс исполнителей эстрадной песни \"Весенняя капель\" г. Ульяновск 2010г. Диплом лауреата 2 степени;&bull; Всероссийский конкурс вокалистов \"Super star\" г. Ярославль 2011г. Диплом Лауреата 2 степени (В номинации эстрадное пение);&bull; Всероссийский конкурс вокалистов \"Super star\" г. Ярославль 2011г. Диплом Лауреата 3 степени (В номинации дуэт);&bull; Сертификат участника Областного телевизионного конкурса молодых вокалистов \"Шанс\" г. Ульяновск 2013г.;&bull; Всероссийский фестиваль-конкурс исполнителей эстрадной песни \"дыхание весны\" г. Ульяновск 2013г. Диплом лауреата 2 степени;&bull; IV международный фестиваль конкурс национальное достояние-2013 г.Чебоксары 2013г. Диплом лауреата 3 степени (в номинации эстрадный вокал)&bull; Всероссийский конкурс-фестиваль эстрадного вокала \"Открой свое сердце\" г. Тольятти 2016г. Диплом лауреата 1 стпени (в номинации эстрадный вокал 19-25)</p>', 'Готов к командировкам', ' '),
