(962, 'ac8fcdf9-a12b-11e6-a2a7-4376a32b3f45', 77, NULL, 127, 'юрист, помощник руководителя', '2016-11-02', 'юридический', ' ', 'Российская Федерация', '2016-11-23', ' ', 4, 52000, '<p>Аналитическое мышление; стремление к повышению профессионального уровня; уверенность в себе; умение сосредотачиваться на главном;&nbsp;исполнительность; умение&nbsp;приоритетно распределять поставленные задачи.</p>', '<p>Ответственность; порядочность; коммуникабельность;&nbsp;внимательность; аккуратность; &nbsp;надежность.</p>', 'Полная занятость', 'Нет', 'bf3532f0-a127-11e6-a2a7-4376a32b3f45', ' ', '<p>Применяю рациональные методы организации любого процесса.</p>', 'Не готов к командировкам', ' '),
