(965, '7185bf4a-d2d0-11e6-94b6-0f468c90bfa7', 77, NULL, 112, 'Научный сотрудник', '2017-01-05', 'Юриспруденции', ' ', 'Российская Федерация', '2018-01-26', ' ', 0, 40000, 'Знание актуальной юридической нормативной базы, большой опыт работы с различными категориями граждан', 'Порядочность, ответственность, организованность, пунктуальность', 'Полная занятость', ' ', '7cba9f40-d2ce-11e6-94b6-0f468c90bfa7', 'Готов к переобучению', 'Без вредных привычек, без татуировок. Категория годности в военной службе В. Не служил по медецинским показателям, на данный момент исправленным. Текущих проблем со здоровьем и ограничений по строевой службе нет.', ' ', ' '),
(966, '3df076d8-fee3-11e7-9855-0f468c90bfa7', 61, NULL, 114, 'Менеджер', '2018-01-21', 'Дорожно-транспортный', '[B]', 'Российская Федерация', '2018-02-09', ' ', 0, 10000, 'Организаторские, управленческие и коммуникативные навыки.- Грамотная речь. - Ответственность.- Исполнительность.- Инициативность.- Высокая работоспособность.-Требовательность.- Целеустремленность.Наличие личного автомобиля и прав категории В. Стаж 8 лет.', '-Доброта-Отзывчивость-Справедливость-Взаимопомощь и взаимовыручка', 'Временная', 'Нет', '3de03510-fee1-11e7-9855-0f468c90bfa7', 'Готов к переобучению', 'В связи с новым семейным положением матери-одиночки, рассматриваю любую работу по договору, т.к.на хожусь в отпуске по уходу за ребёнком. А на основноё место работы возвращаться пока нет возможности. Ребенку 1.8 ходит в ясли. Поэтому варианты работы должны быть рядом в г.Аксай.', 'Готов к командировкам', ' '),
(967, 'e31ebc3e-b374-11e7-ab3d-ef76bd2a03c1', 69, NULL, 97, 'Управляющий', '2017-10-17', 'Экономика и управление на предприятии городского хозяйства', '[B]', 'Российская Федерация', '2018-01-15', ' ', 24, 30000, '<p>Управление, организация, ремонт, эксплуатация. Контракты и договора, переговоры, поставщики, подрядчики, тендеры, оптимизация затрат. Документация, документооборот, создание регламентирующих документов.</p>', '<p>Ответственность, работоспособность.</p>', 'Полная занятость', 'Нет', '02afc7d0-b341-11e7-aef1-e37b4be0b9ed', 'Не готов к переобучению', '<p>Владение ПК на высоком пользовательском уровне, знание и работа в программах 1С,&nbsp;\"WEB-Торги-КС\", \"WEB-бюджет\".</p>', 'Не готов к командировкам', ' '),
