(980, 'c104f217-fdba-11e6-b9e2-037acc02728d', 23, NULL, 127, 'юристконсульт', '2017-02-28', 'юриспруденция', '[B]', 'Российская Федерация', '2017-03-01', ' ', 13, 30000, '<p>целеустремленная, большой опыт делового общения, навык публичных выступлений, умение ориентироваться в законодательстве.</p>', '<p>пунктуальная, ответственная, исполнительная, контактная, усидчивая, стрессоустойчивая.</p>', 'Полная занятость', 'Нет', '1eb16930-fdb5-11e6-b9e2-037acc02728d', ' ', '<p>Консультант+, Internet, Windows, MS Office - опытный пользователь.</p>', ' ', ' '),
(981, '59b9a8a0-afc0-11e6-b250-4376a32b3f45', 72, NULL, 115, 'Диспетчер', '2016-11-21', 'Управление движением воздушного транспорта', ' ', 'Российская Федерация', '2018-02-07', ' ', 11, 40000, '<p>Обладаю юридической грамотностью, педантично отношусь к делопроизводству и документированию, знаю архивное дело, опытный пользователь офисной техники и сопутствующего программного обеспечения. Склона к аналитическому мышлению и работе в условиях многозадачности. Изучаю рынок автоперевозок и программу 1С, занимаюсь общественной деятельностью.&nbsp;</p>', '<p>Зарегистрирована в социальной сети &laquo;Одноклассники&raquo; - sazukova.</p>', 'Полная занятость', 'Да', 'f0c48320-f1a0-11e5-b23d-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
