(985, 'b4b909f8-37ea-11e7-a1ca-ef76bd2a03c1', 60, NULL, 115, 'механик - водитель', '2017-05-13', 'Псковский прфессиональный лицей №23', '[A, B, C]', 'Российская Федерация', '2017-12-22', ' ', 4, 20000, '<p>&nbsp; &nbsp; &nbsp;</p><ul><li><strong>стремление к профессиональному росту;</strong></li><li><strong>умение убеждать;</strong></li><li><strong>повышенная работоспособность;</strong></li><li><strong>аналитическое мышление.</strong></li></ul><p style=\"text-align: left;\">&nbsp;</p><ul><li><strong>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></li></ul><p>&nbsp;</p>', '<ul><li><strong>Умение работать с людьми, способность быстро оценивать ситуацию, целеустремленность, навыки ведения переговоров , деловая этика и честность в соблюдении деловых обязательств, совпадение личных ценностей с корпоративными ценностями компании, навыки делегирования полномочий.</strong></li></ul>', 'Полная занятость', 'Нет', '6a933110-37e1-11e7-a1ca-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(986, '362d49ae-e701-11e6-8228-736ab11edb0c', 58, NULL, 112, 'Заместитель руководителя, Экономист', '2017-01-30', 'Пензенский Филиал «Академия МНЭПУ»', ' ', 'Российская Федерация', '2017-01-31', ' ', 4, 20000, '<p>Навыки:&nbsp;Руководство&nbsp;коллективом, Пользователь&nbsp;ПК, Управление&nbsp;командой, &nbsp;Продвижение&nbsp;сайтов, &nbsp;Управление&nbsp;отношениями&nbsp;с&nbsp;клиентами, &nbsp;Ориентация&nbsp;на&nbsp;результат , Взаимодействие&nbsp;с&nbsp;разрешительными&nbsp;органами, &nbsp;Взаимодействие&nbsp;с&nbsp;государственными&nbsp;контролирующими&nbsp;органами, &nbsp;Опыт&nbsp;судебных&nbsp;разбирательств, &nbsp;опыт&nbsp;написания&nbsp;деловых&nbsp;писем, &nbsp;Знание&nbsp;Закона&nbsp;№&nbsp;44-ФЗ&nbsp;о&nbsp;контрактной&nbsp;системе, &nbsp;Знание&nbsp;Земельного&nbsp;кодекса</p>', '<p>Ответственная, энергичная, инициативная, имею организаторские способности, коммуникабельная, умею брать ответственность на себя, отстаивать свою точку зрения.</p>', 'Полная занятость', ' ', '5281e470-e397-11e6-9e1a-ef76bd2a03c1', ' ', ' ', ' ', ' '),
(987, '5d6625d9-17be-11e7-82b8-037acc02728d', 11, NULL, 108, 'Главный специалист', '2017-04-02', 'Проектирование и эксплуатация магистральных газонефтепроводов', '[B]', 'Российская Федерация', '2017-10-01', ' ', 6, 100000, '<p>-высокая работоспособность;</p><p>-нацеленность на результат;</p><p>-умение достигать результаты в условиях многозадачности;</p><p>стрессоустойчивость</p><p>-умение вести результативные переговоры;</p><p>-умение работать в команде.</p>', '<p>-ответственность;</p><p>-дисциплинированность;</p><p>-надежность;</p><p>-аккуратность;</p><p>-порядочность;</p><p>-быстрая обучаемость;</p><p>коммуникабельность.</p>', 'Полная занятость', 'Да', '88fa32e0-17b4-11e7-82b8-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(988, '57701459-c540-11e5-b178-833b590698f7', 39, NULL, 110, 'Старший оператор сейсмостанции', '2017-02-13', 'Наладка и управление ЧПУ', '[B, C]', 'Российская Федерация', '2018-01-02', ' ', 25, 70000, '<p>инициативность, внимательность, аккуратность, ответственность, пунктуальность, склонность к командной работе, стремление к профессиональному росту, энтузиазм.</p>', '<p>Коммуникабельность, общительность, самоконтроль, способность к обучению, тактичность.</p>', 'Полная занятость', 'Нет', '836b5f10-c14e-11e5-9eda-0163a9ae3d01', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Мореходная книжка, удостоверение личности моряка,&nbsp;ИБЖС,&nbsp;Базисная подготовка моряков по вопросам охраны.</p>'),
(989, '8bedc95a-4194-11e5-a507-833b590698f7', 73, NULL, NULL, 'Экономист', '2017-08-11', 'экономический', '[B]', 'Российская Федерация', '2015-08-24', ' ', 6, 18000, ' ', '<p>ответственность исполнительность</p>', 'Полная занятость', ' ', 'a4e43230-4191-11e5-a507-833b590698f7', ' ', ' ', 'Готов к командировкам', '<p>Наличие собственного автомобиля</p>'),
(990, '396a611b-5526-11e6-853e-037acc02728d', 28, NULL, 111, 'уборщик производственных и служебных помещений', '2017-07-06', 'Новосибирукий авиационный техникум', ' ', 'Российская Федерация', '2016-07-29', ' ', 16, 20000, '<p>Умею согласованно работать в коллективе.</p>', '<p>Ответственная, добросовестная, коммуникабельная.</p>', 'Полная занятость', ' ', '186d0090-5520-11e6-853e-037acc02728d', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(991, '6b9390c2-5655-11e5-905c-239645b044d5', 23, NULL, 109, 'Директор', '2017-06-11', 'подъемно-транспортные машины и оборудование.', '[A, B, C, D, E]', 'Российская Федерация', '2017-12-01', ' ', 24, 100000, '<ul><li>Опыт управленческой деятельности более 14 лет.</li><li>Знания основ экономики, маркетинга, организации труда и управления, основ трудового законодательства, правил и норм охраны труда, техники безопасности, производственной санитарии и противопожарной защиты.</li><li>Знание производственных мощностей производственного предприятия и технологий производства продукции.</li><li>Знание документации систем менеджмента качества предприятия.</li><li>Навыки планирования производственно-хозяйственной деятельности компании с учетом ее роста и развития.</li><li>Отличное владение навыками ведения переговоров на высшем уровне.</li><li>Отличные навыки планирования и совершения закупок, и продаж.</li><li>Отличное знание систем видеонаблюдения и систем безопасности.</li><li>Навыки отбора и обучения персонала.</li><li>Опыт организации и контроля бесперебойной работы отделений: электро-, тепло-, водоснабжение, за техническим состоянием техники и помощь в организации необходимого технического обслуживания и ремонта (текущего и капитального).</li><li>Отличные навыки работы со сметами (хозяйственные расходы, ремонт , строительство и пр.).</li><li>Опыт закупки оборудования и материалов.</li><li>Опытный пользователь ПК (MS - Office, в т.ч. Excel и работа с презентациями (PowerPoint), Internet, Консультант Плюс/Гарант, 1С Предприятие, OpenOffice, Skype, почтовые программы и пр.).</li><li>Отлично работаю как самостоятельно, так и в команде.</li></ul>', '<p>Профессионализм, организаторские способности, стратегическое мышление, лидерские качества, коммуникабельность, навыки ведения переговоров разных уровней, навыки убеждения,&nbsp; ответственность, требовательность, исполнительность, нацеленность на результат, гибкость, обучаемость, активная жизненная позиция, умение работать в &laquo;многозадачном режиме&raquo;. Фанатично отношусь к работе.</p>', 'Полная занятость', 'Да', 'f5816fb0-55f4-11e5-90a7-9370902ea73e', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
