(1012, '06d6bff8-7db1-11e7-851f-4376a32b3f45', 50, NULL, 112, 'эксперт', '2017-08-10', 'Институт международных отношений и социально-политических наук', '[B]', 'Российская Федерация', '2017-08-10', ' ', 0, 40000, '<p><strong>Владение компьютером:</strong> MS Word, MS Exсel, MS Power Point, Adobe Premiere Pro (Уверенный пользователь)</p><p><strong>Наличие водительских прав категории</strong> B</p><p><strong>Владение языками</strong>:&nbsp; Английский язык (advanced), Китайский язык (базовый)</p><p>Имею опыт по составлению информационно-аналитического материала</p>', '<p>коммуникабельный, активный, сдержанный, легко обучаемый, дисциплинированный, объективный, усидчивый, энергичный, пунктуальный, внимательный.</p>', 'Полная занятость', 'Нет', '23dbe530-7dac-11e7-851f-4376a32b3f45', 'Готов к переобучению', '<p>Получил полное среднее образование в МОУ Гимназия №4 пгт Нахабино.  В период с 2007 по 2009 занимался с репетитором по английскому языку.  В период с 2009 по 2011 проходил дополнительные курсы при МГЛУ по предметам история, английский язык, русский язык.  Проходил службу в армии в танковых войсках на должности оператор-наводчик танка Т-72б, Т-72б3 (2014 - 2015).  Посещал разноплановые кружки и секции (рукопашный бой, ушу, айкидо, гитара, плавание, волейбол).  Хобби: волейбол, ирландская история и культура, восточная история и культура, &nbsp;гитара</p>', 'Не готов к командировкам', ' '),
