(1018, 'fbb20484-4918-11e7-b3b6-ef76bd2a03c1', 77, NULL, 121, 'Системный администратор', '2017-06-04', 'Финансы и кредит', '[B, C]', 'Российская Федерация', '2017-11-01', ' ', 15, 50000, '<p>Увлекаюсь информационной безопасностью, тестируя сети такими программными продуктами как Backtrack Linux, Kali Linux, Wireshark, Nmap, Metasploit Framework, sqlmap, Acunetix, Nessus. Программирование на языках: С, С#, Java Android, PHP. JavaScript. Администрирование серверов Windows, Linux. <span class=\"ResumeMain_error m_mistake_word\">Вебтехнологии</span>, IP телефония. CryptoPro, Администрирование АТС, Администрирование оборудования Cisco, Администрирование 1C 7.7/8.0/8.1/8.2/8.3 Знание графических пакетов CorelDRAW, Photoshop. Резервное копирование. Антивирусная политика. Проектирование, монтаж, прокладка LAN. Закупка/ремонт оргтехники, расходные материалы.</p><p>&nbsp; &nbsp; &nbsp;</p>', '<p>Люблю работать в команде. Быстро адаптируюсь в новых условиях. Много читаю, особенно техническую документацию и все, что касается своей работы. Хорошо владею английским и голландским языком, что помагает быстро разобраться в технической документации и инструкциях.</p>', 'Полная занятость', 'Нет', '8f92ba10-4918-11e7-b3b6-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
