(1024, 'd026fac8-9896-11e5-8b58-239645b044d5', 24, NULL, 97, 'делопроизводитель, помощник воспитателя, домработница.', '2017-06-28', 'Юриспруденция', ' ', 'Российская Федерация', '2015-12-02', ' ', 0, 15000, ' ', '<p>Ответственная, пунктуальная, высокая работоспособность, общительная, приветливая, готова к обучению.</p>', 'Частичная занятость', 'Нет', '94207e00-9893-11e5-8b58-239645b044d5', 'Готов к переобучению', ' ', 'Не готов к командировкам', ' '),
(1025, '6176dc89-a42e-11e7-9e1a-4376a32b3f45', 56, NULL, 108, 'прораб отделочных работ', '2017-09-28', 'Технология машиностроения', '[B]', 'Российская Федерация', '2017-09-28', ' ', 7, 20000, '<p>Мещанкин Александр Анатольевич.Дата рождения 08.03.1959г.Прораб высококачественных отделочных работ со стажем 20 лет,безаварийный водитель категории B со стажем 20 лет, диплом инженера-механника(технология машиностроения 1976-1981г.г.), опыт работы инженером-конструктором 6 лет(Оренбургский машзавод КБ\"Орион\"). Опыт управления коллективом рабочих (до 20 человек). \"Умелые руки\" в различных областях. Ответственность за порученное дело при достойном вознаграждении.</p>', '<p>Мещанкин Александр Анатольевич.Дата рождения 08.03.1959г.Умение любительской игры на гитаре, опыт работы в либительском ВИА(1975-1985г.г.) вокалистом. Хобби-рыбалка. Здоровье хорошее. Без вредных привычек. Ответственность за порученное дело при достойном вознаграждении.</p>', 'Полная занятость', 'Нет', '4d329700-8656-11e7-a7ba-037acc02728d', ' ', ' ', 'Готов к командировкам', ' '),
(1026, 'ed55dbeb-d4f2-11e6-bbde-ef76bd2a03c1', 55, NULL, 99, 'Начальник отдела,главный специалист', '2017-01-07', 'Финансы и кредит', '[A, B, C]', 'Российская Федерация', '2017-08-01', ' ', 7, 25000, '<p>Обладаю высокой трудоспособностью и усидчивостью. Коммуникабелен, легко устанавливаю контакт с людьми. Соблюдаю правила делового этикета. Качественно и грамотно выполняю поставленные передо мной задачи. Продвинутый пользователь ПК. Надеюсь на длительное взаимовыгодное сотрудничество.</p>', '<p>Без вредных привычек. Активно занимаюсь спортом</p>', 'Полная занятость', 'Да', '379c9620-d4ef-11e6-bbde-ef76bd2a03c1', ' ', ' ', ' ', ' '),
(1027, '80c2ad6a-e1f4-11e5-b653-736ab11edb0c', 77, NULL, 112, 'Научный сотрудник', '2016-11-28', 'Автоматизированные системы управления', '[B, C]', 'Российская Федерация', '2017-02-15', ' ', 16, 50000, '<p>&nbsp;&nbsp; Ильичев Дмитрий Евгеньевич 17.12.1967 г.р. 48 лет подполковник запаса, ветеран военной службы МО РФ, проживаю г. Москва ул. Перовская, женат двое детей.</p><p>В 1990 г. закончил Тульское Артиллерийское инженерное училище по специальности ВУС- 430100. Проходил службу в в/ч 35511 на различных должностях в т.ч. начальника ОБИ (обеспечение безопасности информации), начальника отдела в 208 ВЦ ГРАУ МО РФ. За отличие в службе имею награды МО РФ.</p>', '<p>Свободная работа с компьютером Ответственность Целеустремленность Пунктуальность</p>', 'Полная занятость', 'Нет', '1273ab50-e1ec-11e5-b653-736ab11edb0c', ' ', '<p>Инициативен, занимаю активную жизненную позицию, в 2014 году являлся зарегистрированным кандидатом для участия в выборах кандидатов в депутаты Московской городской Думы VI созыва по избирательному округу № 17, участвовал в праймериз к выборам. Более подробную информацию обо мне можно узнать: http://www.stihi.ru/avtor/dimai</p><p>&nbsp;</p>', ' ', '<p>Ильичев Дмитрий Евгеньевич 17.12.1967 г.р. 48 лет подполковник запаса, ветеран военной службы МО РФ, проживаю г. Москва ул. Перовская, женат двое детей.</p><p>В 1990 г. закончил Тульское Артиллерийское инженерное училище по специальности ВУС- 430100. Проходил службу в в/ч 35511 на различных должностях в т.ч. начальника ОБИ (обеспечение безопасности информации), начальника отдела в 208 ВЦ ГРАУ МО РФ. За отличие в службе имею награды МО РФ.</p><p>&nbsp; Инициативен, занимаю активную жизненную позицию, в 2014 году являлся зарегистрированным кандидатом для участия в выборах кандидатов в депутаты Московской городской Думы VI созыва по избирательному округу № 17, участвовал в праймериз к выборам. Более подробную информацию обо мне можно узнать: http://www.stihi.ru/avtor/dimai</p><p>&nbsp;</p><p>Телефоны для оперативного контакта: +7-916-153-74-55, +7-495-770-25-35.</p><p>Почта: die1712@yandex.ru</p>'),
