(1051, '40a2a1c9-305d-11e5-b22a-9370902ea73e', 1, NULL, 112, 'Менеджер', '2017-06-14', 'Экономики, управления и бизнеса', ' ', 'Российская Федерация', '2016-02-09', ' ', 2, 10000, '<p>Деловая переписка,&nbsp;Опытный пользователь: MS Office (Word, Exсel, Power Point), навыки работы с Интернетом (Internet Explorer, Opera, Mozilla Firefox),&nbsp;Организационные способности, многозадачность</p>', '<p>Высокая работоспособность, инициативность, ответственность, дисциплинированность, нацеленность на результат</p>', 'Полная занятость', 'Да', '217c91f0-305a-11e5-b22a-9370902ea73e', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
