(1053, '7c16b26f-0cf2-11e6-a555-037acc02728d', 70, NULL, 111, 'менеджер по продажам', '2017-01-06', 'технология-машиностроения', ' ', 'Российская Федерация', '2016-04-29', ' ', 7, 13000, '<p><span class=\"bloko-tag bloko-tag_inline bloko-tag_countable Bloko-TagList-Tag\" data-tag-id=\"4118\" data-qa=\"bloko-tag_inline\"><span class=\"bloko-tag__layout-slim\"><span class=\"bloko-tag__section bloko-tag__section_stretched\" title=\"Работа в команде\"><span class=\"bloko-tag__section-text Bloko-TagList-Text\" data-qa=\"bloko-tag__text\">Приобрёл много полезных навыков и совершенствовал свои качества.Могу сказать, что я стрессоустойчивый, самодисциплинированный, не боюсь браться за сложную работу, довожу её до конца. Умею работать в команде, прислушиваюсь к мнению коллег, нацелен на достижение поставленной цели.</span></span></span></span></p>', '<p>Трудолюбив, педантичен, исполнителен, легко обучаем, хорошо развита визуальная память, физически крепкий, вынослив, опрятен, люблю чистоту, стрессоустойчив, молод, активен, знаю ПК как продвинутый пользователь...</p>', 'Полная занятость', 'Нет', '60c90cb0-0ced-11e6-a555-037acc02728d', 'Готов к переобучению', '<p>Умею неплохо рисовать (могу придумывать эмблемы, афиши, рекламные баннеры и прочее), хороший каллиграфический почерк, хорошо знаю Москву (в частности метро) и Подмосковье, люблю спорт, занимаюсь футболом (ЛДФ г.Королёв) есть награды городского уровня, так же занимался карате и тайским боксом, а так же легкой атлетикой. Отслужил в рядах ВС РФ 2 года с 2006 по 2008 (гвардии старший сержант танковых войск)...</p>', 'Не готов к командировкам', ' '),
(1054, '039e9690-ceca-11e7-a066-e37b4be0b9ed', 43, NULL, 102, 'Звукорежиссёр', '2017-11-21', 'СКД и НХТ', '[B]', 'Российская Федерация', '2017-11-22', ' ', 1, 10000, '<p>Ответственный</p>', '<p>Добрый</p>', 'Полная занятость', 'Да', 'c5056b90-cec7-11e7-a066-e37b4be0b9ed', 'Готов к переобучению', ' ', 'Готов к командировкам', '<p>Диплом финалиста конкурса бизнес-проектов федеральной программы \"Ты-предприниматель\" в Кировской области в 2016 году</p>'),
