(1095, '9b37a0b5-d650-11e5-ac86-7de68f1c536d', 47, NULL, 97, 'Менеджер по продажам автозапчастей, стаж работы в запчастях 12 лет', '2016-10-16', ' ', '[B]', 'Республика Беларусь', '2016-02-20', ' ', 0, 70000, '<p>Знание устройства автомобилей&sbquo; ассортимента запчастей, опыт подбора по электронным каталогам запчастей для иномарок ( оригинальные, неоригинальные)</p>', '<p>Трудолюбивый,&nbsp;коммуникабельный, общительный, умею находить общий язык с клиентами, хорошие организаторские способности,&nbsp;неконфликтный, готов работать сверхурочно, легко обучаюсь, стремлюсь развиваться, гибкое мышление.</p>', 'Полная занятость', 'Да', '8f77c2f0-d64b-11e5-ac86-7de68f1c536d', 'Готов к переобучению', '<p>&nbsp;телефон +375298882878</p>', 'Готов к командировкам', ' '),
(1096, '116c8d95-d651-11e5-ac86-7de68f1c536d', 47, NULL, 112, 'Водитель, личный водитель. Стаж вождения 15 лет', '2016-10-16', ' ', '[B]', 'Республика Беларусь', '2016-03-02', ' ', 0, 50000, '<p>знание устройство автомобиля, безаварийная езда&nbsp;</p>', '<p>Отсутствие вредных привычек, трудолюбие,&nbsp;коммуникабельный, внимательный, пунктуальный, неконфликтный, вежливый, наблюдательный, растрая реакция, бережное отношение к автомобилю.</p>', 'Полная занятость', 'Да', '8f77c2f0-d64b-11e5-ac86-7de68f1c536d', 'Готов к переобучению', '<p>+375298882878. &nbsp;Нахожусь в Беларусии. Готов к переезду на постоянное место жительства в РФ с получение гражданства. Готов участвовать в программе по переселению соотечественников.&nbsp;</p><p>Есть навигатор.</p>', 'Готов к командировкам', ' '),
