(1145, '22660de0-d09b-11e5-ab87-037acc02728d', 59, NULL, 97, 'продавец', '2016-10-31', 'ИНФОРМАТИКИ', '[B]', 'Российская Федерация', '2016-02-11', ' ', 12, 15000, '<p>УМЕНИЕ НАЛАЖИВАТЬ КОНТАКТ С КЛИЕНТОМ, УХОДИТЬ ОТ КОНФЛИКТА, УМЕНИЕ БЫСТРО ОРИЕНТИРОВАТЬСЯ В СЛОЖИВШЕЙСЯ СИТУАЦИИ И САМОСТОЯТЕЛЬНО ПРИНИМАТЬ РЕШЕНИЯ.</p>', '<p>АНАЛИТИЕСКОЕ МЫШЛЕНИЕ,БЫСТРАЯ ОБУЧАЕМОСТЬ, ОТВЕТСТВЕННОСТЬ, ВНИМАТЕЛЬНОСТЬ, КОММУНИКАБЕЛЬНОСТЬ, ЦЕЛЕУСТРЕМЛЕННОСТЬ, НАСТОЙЧИВОСТЬ И СТРЕМЛЕНИЕ К ПРОФЕССИОНАЛЬНОМУ РОСТУ. БОЛЬШОЙ ОПЫТ ОБЩЕНИЯ С ЛЮДЬМИ.</p>', 'Полная занятость', ' ', '6a855b90-d094-11e5-ab87-037acc02728d', 'Готов к переобучению', '<p>УВЕРЕННЫЙ ПОЛЬЗОВАТЕЛЬ MS OFFICE (WORD. EXCEL. OUTLOOK). ИНТЕРНЕТ, ЭЛЕКТРОННАЯ ПОЧТА. ОПЫТ РАБОТЫ С ОРГТЕХНИКОЙ: ФАКС, КОПИРОВАЛЬНЫЕ АППАРАТЫ, СКАНЕР, ПРИНТЕР.</p>', ' ', ' '),
