(1165, '6baf9942-d674-11e7-b349-e37b4be0b9ed', 91, NULL, 115, 'Инженер', '2017-12-01', 'Эксплуатации и ремонта машин и оборудования агропромышленного производства', '[B, C]', 'Российская Федерация', '2017-12-07', ' ', 6, 20000, '<p class=\"western\">Уверенный пользователь ПК (Word, Exel, 1С, MS DOS, а так же настройка и ремонт);</p><p class=\"western\">Удостоверение тракториста-машиниста категории А,С;</p><p class=\"western\">Водительское удостоверение категории В,C.</p>', '<p class=\"western\">Ответственный, пунктуальный, трудолюбивый, коммуникабельный, не конфликтный, быстро обучаюсь, очень стрессоустойчив, быстро нахожу подход к людям и технике. При необходимости готов к переезду. Хорошо разбираюсь в технике и ее настройке. Готов освоить новые виды деятельности.</p>', 'Полная занятость', ' ', '90908530-d669-11e7-8320-0f468c90bfa7', 'Готов к переобучению', ' ', ' ', '<p class=\"western\">Сертификат по заточке маникюрного, парикмахерского, медицинского и бытового инструмента.</p>'),
(1166, '674dc607-c5b9-11e5-b178-833b590698f7', 77, NULL, 128, 'Электрогазосварщик', '2016-10-16', 'КПК №9', '[B]', 'Российская Федерация', '2016-10-16', ' ', 4, 35000, ' ', '<p>Ответственный, внимательный, исполнительный, дисциплинированный. Легко нахожу выход в сложных ситуациях. Стрессоустойчив, обладаю умением работать в команде, легко нахожу общий язык с людьми. Нацелен на результат, предприимчив, быстро обучаемый, готов к освоению смежных профессий.Уверенный пользователь ПК, личный авто. Категория В.</p>', 'Полная занятость', ' ', 'ed151350-bb74-11e5-a932-833b590698f7', 'Готов к переобучению', ' ', ' ', ' '),
