(1172, '5056e446-0504-11e8-a882-e37b4be0b9ed', 60, NULL, 127, 'юрист', '2018-01-29', 'Экономика, бухгалтерский учет и контроль', '[B]', 'Российская Федерация', '2018-02-06', ' ', 10, 30000, '<p>Аналитическое мышление, способна быстро ориентироваться в новых обстоятельствах.&nbsp;</p><p>Грамотная письменная и устная речь, навыки составления процессуальных документов.&nbsp;</p><p>&nbsp;</p>', '<p>Коммуникабельна, способна работать с большим объемом информации. Стрессоустойчива, не конфликтна</p><p>Всегда заканчиваю начатые дела. Постоянно совершенствую профессиональные навыки, изучаю большое количетво необходимой для успешной работы литературы.&nbsp;</p><p>&nbsp;</p>', 'Полная занятость', 'Нет', '8b61be40-b2f1-11e6-b250-4376a32b3f45', 'Готов к переобучению', ' ', ' ', '<p>Диплом с отличием по специальности \"Бухгалтер с дополнительной подготовкой в области финансово - хозяйственной деятельности предприятия\"&nbsp;</p>'),
(1173, '42b52318-eabb-11e6-962c-ef76bd2a03c1', 68, NULL, 97, 'Менеджер отдела продаж', '2017-02-04', 'Менеджмент', '[B]', 'Российская Федерация', '2017-03-14', ' ', 4, 25000, ' ', '<p>Коммуникабелен, стрессоустойчив, готов отстаивать собственную точку зрения, ответственно подхожу к выполнению должностных обязанностей, ориентирован на результат.</p>', 'Полная занятость', 'Нет', 'be2e3f10-eab9-11e6-962c-ef76bd2a03c1', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
