(1186, 'd017123c-ba37-11e7-aa28-736ab11edb0c', 35, NULL, 115, 'Инженер отдела эксплуатации/Инженер-механик/Инженер по БДД/Диспетчер/Менеджер по продажам автозапчастей', '2017-10-26', 'Промышленного менеджмента и инновационных технологий', ' ', 'Российская Федерация', '2017-10-26', ' ', 7, 30000, '<p>Знание устройства автомобиля, основ технической эксплуатации автомобиля, автомобильных перевозок&nbsp; и смежных дисциплин;</p><p>Включен в сборник: Лучшие выпускники Вологодской области 2012</p><p><strong>Знание языков</strong> : английский (со словарем),технический английский в сфере автотранспорта;</p><p><strong>Уверенный пользователь ПК:</strong> Word, Excel, PowerPoint, Интернет, знание программы Компас V7 -V13, автоматизированная система диспечерского управления городским наземным транспортом ПК-Диспетчер, уверенный пользователь Windows, система управления складской логистикой SAP EWM, система управления ресурсами предприятия SAP ERP, каталоги автозапчастей любых марок.</p><p>Огромное желание работать в сфере оборота и продажи запасных частей, дилерских центрах, в сфере перевозок ; транспортных компаниях ;</p>', '<p>Легко обучаем, трудолюбив, умение работать в команде, целеустремлен, честен, справедлив, энергичен, общителен. Желание совершенствовать свои навыки и знания для работы по специальности.</p>', 'Полная занятость', 'Нет', 'f8946530-ba34-11e7-aa28-736ab11edb0c', 'Готов к переобучению', '<p>Вредных привычек нет. Увлечения &ndash; автомобили , техника, автобусы и грузовики, спорт, музыка, строительство.</p>', 'Готов к командировкам', ' '),
