(1190, '0f45bd59-611e-11e5-8536-239645b044d5', 86, NULL, NULL, 'помощник бухгалтера', '2018-02-15', 'экономика и бух.учет', ' ', 'Российская Федерация', '2015-09-22', ' ', 2, 15000, '<p>Легко обучаема,целе устремленная,без вредных привычек</p>', '<p>Уверенный пользователь ПК, Word, Excel, Power point,1С.</p><p>Офисное оборудование (факс, модем, копировальные аппараты), работа в интернете, электронная почта.</p><p>&nbsp;</p><p>&nbsp;</p>', 'Полная занятость', 'Да', '35b5f110-4bb8-11e5-90a7-9370902ea73e', 'Готов к переобучению', '<p>Люблю заниматься спотром</p>', 'Готов к командировкам', '<p>Отучилась на мастера ногтевого сервиса,занимаюсь танцами</p>'),
