(1192, '93f810f4-38ba-11e7-94b6-0f468c90bfa7', 56, NULL, 101, 'Врач-рентгенолог', '2017-08-21', 'Педиатрический', '[B]', 'Российская Федерация', '2018-01-01', ' ', 0, 45000, 'Добросовестность, ответственность, пунктуальность, аккуратность, внимательность', ' ', 'Полная занятость', 'Да', '18afb3d0-38ba-11e7-94b6-0f468c90bfa7', ' ', ' ', ' ', ' '),
(1193, '26900ed9-8c47-11e5-8d54-833b590698f7', 36, NULL, 112, 'Кадровые службы, развивающие центры для детей, психологические службы.', '2016-10-16', '«Воронежский государственный аграрный университет имени императора Петра I»', ' ', 'Российская Федерация', '2016-10-16', ' ', 4, 15000, '<p>Владение различными методиками психодиагностики и&nbsp;психокорекции, проведение психологической диагностики, в&nbsp;том числе профориентации (профориентационное консультирование); психологическая диагностика (тестирование, обработка, анализ и интерпретация полученных результатов), психологическое консультирование, поддержание здорового психологического климата в коллективах. Умение составления и&nbsp;проведения тренинговых программ; знание основных направлений психологии и&nbsp;психотерапии; &nbsp;&nbsp;навыки проведения комплексных обследований. Составление тренингов по запросу, оказание помощи в решении конфликтных проблем, оказание помощи в решении проблем детско-родительских отношений, оказание помощи в решении семейных проблем.</p>', '<p>Хорошо развито воображение, креативность, гибкость идей, импровизация, организаторские &nbsp;способности, требовательность, умение анализировать ситуацию и обобщать полученную информацию, лёгкость в общении, умение разрядить конфликтную ситуацию, способность находить компромиссный вариант решения проблемы. Настойчива при выполнении поставленных задач. Целеустремленность, ответственность, &nbsp;восприимчивость, коммуникабельность, эмпатия, &nbsp;умение слушать&sbquo; интерес к людям, доброжелательная. Легко обучаема и организованна, дисциплинированна. Легко и с удовольствием нахожу контакт с детьми. Сторонник позитивного мышления.</p>', 'Полная занятость', ' ', 'b5340a00-8b71-11e5-a923-239645b044d5', ' ', ' ', ' ', ' ');
