(1195, '7fc49bfd-d58b-11e5-a4d4-037acc02728d', 38, NULL, 118, 'Станочник деревообрабатывающих станков', '2017-06-05', 'Механизации, технологии и информатизации', '[B, C]', 'Российская Федерация', '2016-02-19', ' ', 1, 20000, '<p style=\"text-align: center;\">Навыки владения компьютером</p><p style=\"text-align: left;\">Программы: ОС Windows XP; 7; 8; 10; Microsoft Office 2003-2007; Word, Excel; умение установки Windows; настройка и установка ПО; знание компьютерного железа, сборка, чистка, разборка ПК, настройка ЛВС, Роуторов, обжим витой пары. Уверенный пользователь ПК</p><p>&nbsp;</p>', '<p>Коммуникабельность, ответственность, внимательность, общение с клиентами, высокая работоспособность, без вредных привычек. Умение работать с электроинструментом. Не склонен к прогулам.</p><p>Готов изучить программы AutoCAD, Компас 3D, ГрандСмета и т.д на территории работодателя со своим ноутбуком с полным рабочим днем, без оплаты труда в течении 1-3 месяцев с дальнейшим трудоустройством. Опыта в знании этих программ нету.</p>', 'Полная занятость', 'Да', 'ddc5bfe0-b6d2-11e5-bcb9-0163a9ae3d01', 'Готов к переобучению', ' ', ' ', ' '),
