(1211, '1c4e2730-68fc-11e6-b094-037acc02728d', 77, NULL, 108, 'главный специалист проектного отдела', '2017-06-22', 'Технология машиностроения', '[B]', 'Российская Федерация', '2017-11-19', ' ', 14, 70000, 'Знание нормативно-технической базы в области пожарной безопасности, систем безопасности. Знание СПДС.Опыт работы с оборудованием наиболее популярных марок как российского, так и иностранного производств.Знание AutoCAD, уверенный пользователь PC.', ' ', 'Полная занятость', 'Нет', '922dfdf0-68f6-11e6-b094-037acc02728d', 'Готов к переобучению', 'Совершенствую знание английского языка. Уровень знаний - intermediate.', 'Готов к командировкам', ' '),
(1212, '11f86e59-9c75-11e7-9620-4376a32b3f45', 54, NULL, 121, 'инженер-программист', '2017-09-18', 'Московский технический институт', '[B]', 'Российская Федерация', '2017-09-20', ' ', 6, 30000, '<p>Умение создавать и поддерживать работоспособность процесса разработки программных и электронных изделий и продуктов. Навыки управления коллективом инженеров и разработчиков. Умение работать с заказчиками, поставщиками и аутсо́рсинг специалистами и компаниями. Навыки создания архитектуры локально-вычислительных сетей и телефонии предприятий, включая распределенные системы. Навыки программирования в среде Delphi/lazarus. Знание скриптовых языков Unix систем. Знание SQL. Знание операционных систем линейки Windows включая window 8 и windows server 2008 на уровне системного администратора. Знание Unix систем (linux, Solaris, FreeBSD) на уровне системного администратор. Знание операционной системы Linux на уровне разработчика дистрибутивов. Опыт внедрения DLP системы (системы предотвращения утечки конфиденциальной информации). Опыт работы с nmap и nessus (информационная безопасность). Опыт работы с системами видеонаблюдения и пожарно-охранной сигнализации.</p>', ' ', 'Полная занятость', 'Да', '93728ee0-9c73-11e7-9620-4376a32b3f45', 'Готов к переобучению', ' ', 'Готов к командировкам', ' '),
(1213, '866ac325-9607-11e6-af05-0f468c90bfa7', 74, NULL, 114, 'снабжение', '2016-10-20', ' ', '[A, B, C]', 'Российская Федерация', '2016-10-20', ' ', 0, 50000, ' ', ' ', 'Полная занятость', ' ', '28998a20-9606-11e6-af05-0f468c90bfa7', ' ', ' ', 'Готов к командировкам', ' '),
(1214, '9f399f48-7b60-11e7-ad9d-4376a32b3f45', 28, NULL, 112, 'Высокий уровень обучаемости,стремление к карьрному росту,дисциплинированность,высокое желание работать и развиваться', '2017-08-07', 'ПСИХОЛОГО-ПЕДАГОГИЧЕСКИЙ', '[B]', 'Российская Федерация', '2017-08-08', ' ', 0, 26000, '<p>Умение наладить контакт,умение работать в большом коллективе,стремление к рарьерному росту,гуманизм,,организованность,уважение к себе и людям</p>', '<p>Стрессоустойчивость,трудолюбие,дисциплинированность,целеустремленность,порядок во всем,порядочность,ответственность</p>', 'Полная занятость', ' ', '814b3830-2120-11e7-add5-ef76bd2a03c1', ' ', ' ', ' ', ' '),
(1215, '5d9feb19-6915-11e6-a2d0-4376a32b3f45', 35, NULL, 112, 'Документовед', '2017-02-02', 'Юридический', ' ', 'Российская Федерация', '2017-02-02', ' ', 3, 15000, '<p>Уверенный пользователь ПК и оргтехники.</p><p>Знание кассовой дисциплины</p><p>Опыт работы с 1С</p><p>знание основ делопроизводства</p>', '<p>Коммуникабельность, ответственность, стрессоустойчивость, быстрая обучаемость, трудолюбие.</p>', 'Полная занятость', ' ', '40295cb0-23c9-11e6-8a7d-037acc02728d', 'Готов к переобучению', '<p>без вредных привычек</p>', 'Готов к командировкам', ' '),
(1216, 'e4d77177-38ec-11e5-b22a-9370902ea73e', 61, NULL, 110, 'Машинист подъемника ПРС, КРС, ЗБС.', '2017-08-16', 'Новочеркасский гидромелиоративный техникум', '[B, C]', 'Российская Федерация', '2015-08-05', ' ', 22, 30000, '<p>Хорошее знание устройства и правил эксплуатации подъемных агрегатов для подземного и капитального ремонта скважин, а так же подъемных агрегатов и бурового оборудования для забурки боковых стволов.&nbsp;Грамотное и добросовестное применение полученых знаний на практике.</p>', '<p>Ответственность, добропорядочность, исполнительность, трудолюбие.</p>', 'Полная занятость', ' ', 'c8fd5280-346e-11e5-a8c4-239645b044d5', ' ', ' ', 'Готов к командировкам', ' '),
