(16, '33db4246-11aa-11e8-b17c-037acc02728d', 77, NULL, 127, NULL, '2018-02-14', '2018-02-14 15:38:41', 80000, 'Консультант в нотариальную контору (центр)', 'Полная занятость', 'Полный рабочий день', '<p>- Ведение приема, консультирование (юридические и физические лица),&nbsp;- Нотариальное делопроизводство,&nbsp;- Ведение и заполнение реестра,&nbsp;- Подготовка проектов документов (доверенности, завещания, заявления, согласия, договоры и т.д.)- Ведение наследственных дел,&nbsp;- Формирование нотариального архива,&nbsp;- Большой объем работы связан с недвижимостью,&nbsp;- Работа по сопровождению сделок с нотариусом на выезде.</p>', 'NONE', '<p>Работа в Нотариальной конторе в центре Москвы.- 5-ти дневная рабочая неделя с 11.00 до 21.00, 2 выходных в неделю,&nbsp;- Отпуск и больничные по ТК РФ,&nbsp;- Достойная заработная плата,&nbsp;- Повышение квалификации, профессиональный рост,&nbsp;- Небольшой дружный коллектив.</p>', '<p>Работа в Нотариальной конторе в центре Москвы.- 5-ти дневная рабочая неделя с 11.00 до 21.00, 2 выходных в неделю,&nbsp;- Отпуск и больничные по ТК РФ,&nbsp;- Достойная заработная плата,&nbsp;- Повышение квалификации, профессиональный рост,&nbsp;- Небольшой дружный коллектив.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/33db4246-11aa-11e8-b17c-037acc02728d'),
