(25, '8142dab6-3ee3-11e7-989c-736ab11edb0c', 74, NULL, 125, NULL, '2017-05-22', '2017-05-22 15:38:41', 15000, 'Логопед-дефектолог', 'Частичная занятость', 'Сменный график', 'Проведение коррекционных индивидуальных занятий с детьми по развитию связной речи, коррекции дизартрии, аллалии, ЗПР, ЗРР вызывание речи, работа по программам \" запуска\" речи.\r\nСоставление и корректировка программы занятий для ребенка, консультационное сопровождение родителей\r\nЗанятие 30 минут', 'NONE', '<p>В связи с расширением штата в Центр требуются педагоги: дефектолог, логопед, дефектолог-логопед.</p>\r\n<p>Дополнительное образование и опыт работы являются преимушеством.</p>\r\n<p>Официальное трудоустройство.</p>\r\n<p>Желательная занятость:пн, ср, пт, сб, вс.</p>\r\n<p>Возможна совмещение или подработка.</p>\r\n<p>Резюме отправлять на почту.</p>\r\n<p>Опыт работы логопедом.</p>', '<p>В связи с расширением штата в Центр требуются педагоги: дефектолог, логопед, дефектолог-логопед.</p>\r\n<p>Дополнительное образование и опыт работы являются преимушеством.</p>\r\n<p>Официальное трудоустройство.</p>\r\n<p>Желательная занятость:пн, ср, пт, сб, вс.</p>\r\n<p>Возможна совмещение или подработка.</p>\r\n<p>Резюме отправлять на почту.</p>\r\n<p>Опыт работы логопедом.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/316745600139952/8142dab6-3ee3-11e7-989c-736ab11edb0c'),
(26, 'daf437c6-d89e-11e7-85df-ef76bd2a03c1', 74, NULL, 125, NULL, '2017-12-04', '2017-12-04 15:38:41', 11000, 'Помощник воспитателя в частный детский сад', 'Полная занятость', 'Сменный график', '<p>&nbsp;</p>\r\n<ul>\r\n<li>Помощь воспитателю в присмотре за детьми от 1 до 3 лет, в группе до 10 человек</li>\r\n<li>Поддержание чистоты в группе</li>\r\n<li>График работы 10.00 - 18.00</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/316745600139952/daf437c6-d89e-11e7-85df-ef76bd2a03c1'),
(27, '408d99f6-c749-11e5-b14c-239645b044d5', 77, NULL, 127, NULL, '2016-01-30', '2016-01-30 15:38:41', 50000, 'Юрист в нотариальную контору', 'Полная занятость', 'Полный рабочий день', '<p>- Ведение приема, консультирование (юридические и физические лица), - Нотариальное делопроизводство, - Ведение и заполнение реестра, - Подготовка проектов документов (доверенности, завещания, заявления, согласия, договоры и т.д.)- Ведение наследственных дел, - Формирование нотариального архива, - Работа по сопровождению сделок с нотариусом на выезде.</p>\r\n\r\n\r\n\r\n\r\n&nbsp;\r\n\r\n\r\n\r\n\r\n<p>&nbsp;</p>', 'NONE', '<p>Адрес места работы: ул. Большая Дмитровка, дом 9</p>', '<p>Адрес места работы: ул. Большая Дмитровка, дом 9</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/408d99f6-c749-11e5-b14c-239645b044d5'),
(28, 'deaf1536-0385-11e8-b45c-037acc02728d', 77, NULL, 127, NULL, '2018-01-27', '2018-01-27 15:38:41', 200000, 'ВРИО Нотариуса', 'Полная занятость', 'Полный рабочий день', '<p>- замещение нотариуса в период его временного отсутствия по уважительным причинам (ежегодный отпуск, временная нетрудоспособность;</p>\r\n<p>- оказание физическим и юридическим лицам содействия в осуществлении их прав и защите законных интересов, разъяснять им права и обязанности, предупреждать о последствиях совершаемых нотариальных действий:</p>\r\n<p>- удостоверение сделок;</p>\r\n<p>- выдача свидетельств о правах собственности на доли в совместном имуществе супругов;</p>\r\n<p>- наложение и отмена отчуждения собственности;</p>\r\n<p>- подтверждение подлинности копий документов;</p>\r\n<p>- передача тем или иным людям заявления от физических и юридических лиц;</p>\r\n<p>- прием в депозиты ценные бумаги и деньги;</p>\r\n<p>- совершение исполнительной надписи;</p>\r\n<p>- прием документов для их дальнейшего хранения;</p>\r\n<p>- другое в соответствии с Законом о Нотариате.</p>', 'NONE', '<p>Уважаемые кандидаты, Нотариальная контора в центре Москвы (шаговая доступность от метро Пушкинская/Тверская/Чеховская) находится в поисках временно исполняющего обязанности нотариуса.</p>\r\n<p>Условия:</p>\r\n<p>- График работы &ndash; ненормированный,</p>\r\n<p>График работы нотариальной конторы &ndash; с 11.00 до 21.00;</p>\r\n<p>- Месторасположение: центр, шаговая доступность от метро;</p>\r\n<p>- Оформление официальное, полностью &laquo;белая&raquo; заработная плата, официальные больничные, отпуска и пр.;</p>\r\n<p>- Достойная &laquo;уровня&raquo; заработная плата &ndash; от 100&nbsp;000 и выше в зависимости от объемов замещения нотариуса. В среднем, 200&nbsp;000 руб. в месяц;</p>\r\n<p>- Небольшой и дружный коллектив.</p>', '<p>Уважаемые кандидаты, Нотариальная контора в центре Москвы (шаговая доступность от метро Пушкинская/Тверская/Чеховская) находится в поисках временно исполняющего обязанности нотариуса.</p>\r\n<p>Условия:</p>\r\n<p>- График работы &ndash; ненормированный,</p>\r\n<p>График работы нотариальной конторы &ndash; с 11.00 до 21.00;</p>\r\n<p>- Месторасположение: центр, шаговая доступность от метро;</p>\r\n<p>- Оформление официальное, полностью &laquo;белая&raquo; заработная плата, официальные больничные, отпуска и пр.;</p>\r\n<p>- Достойная &laquo;уровня&raquo; заработная плата &ndash; от 100&nbsp;000 и выше в зависимости от объемов замещения нотариуса. В среднем, 200&nbsp;000 руб. в месяц;</p>\r\n<p>- Небольшой и дружный коллектив.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/deaf1536-0385-11e8-b45c-037acc02728d'),
(29, '426c17b6-0374-11e8-b45c-037acc02728d', 77, NULL, 97, NULL, '2018-01-27', '2018-01-27 15:38:41', 100000, 'Менеджер интернет-продаж (сайт по заказу продуктов питания)', 'Полная занятость', 'Полный рабочий день', '<p>- Обработка входящих звонков, заявок от потенциальных клиентов;</p>\r\n<p>- Активные продажи по базе клиентов;</p>\r\n<p>- Консультирование клиентов о блюдах, продуктах; помощь в выборе в соответствии с пожеланиями;</p>\r\n<p>- Полная работа с клиентом по заказу от первого обращения до последней стадии заказа (доставка);</p>\r\n<p>- Развитие и поддержание отношений с клиентами, проявление заботы о клиентах;</p>\r\n<p>- Осуществление и развитие дополнительных продаж (дополнение заказа позициями, которых не было при первичном обращении);</p>\r\n<p>- Прием и работа с заявкой по возврату; работа с претензиями и возражениями;</p>\r\n<p>- Работа с поставщиками, компаниями-партнерами, курьерами, водителями;</p>\r\n<p>- Курирование сайта на предмет необходимости занесения или удаления товаров; предложения по совершенствованию сайта;</p>\r\n<p>- Построение воронок продаж;</p>\r\n<p>- Обеспечение выполнения плана продаж, контроль и улучшение показателей по всем воронкам;</p>\r\n<p>- Генерация повторных продаж.</p>', 'NONE', '<p>Уважаемые кандидаты!</p>\r\n<p>Самый веселый и креативный сайт в сфере заказов продуктов питания на дом по рецептам находится в поисках коллег-единомышленников!</p>\r\n<p>Нам срочно нужны креативные, энергичные, работящие и коммуникабельные менеджеры, которые с большим удовольствием будут общаться с нашими любимыми и постоянными клиентами и легко вольются в наш дружный и творческий коллектив!</p>\r\n<p>Условия:</p>\r\n<p>- Место работы: офис Рязанский проспект, дом 4, можно частично работать на дому;</p>\r\n<p>- График: с пн по птн: с 10.00 до 18.00, сб и вск - выходные;</p>\r\n<p>- Небольшой дружный коллектив;</p>\r\n<p>- Официальное оформление, отпуска, больничные - по ТК РФ;</p>\r\n<p>- Есть возможности карьерного и профессионального роста!</p>', '<p>Уважаемые кандидаты!</p>\r\n<p>Самый веселый и креативный сайт в сфере заказов продуктов питания на дом по рецептам находится в поисках коллег-единомышленников!</p>\r\n<p>Нам срочно нужны креативные, энергичные, работящие и коммуникабельные менеджеры, которые с большим удовольствием будут общаться с нашими любимыми и постоянными клиентами и легко вольются в наш дружный и творческий коллектив!</p>\r\n<p>Условия:</p>\r\n<p>- Место работы: офис Рязанский проспект, дом 4, можно частично работать на дому;</p>\r\n<p>- График: с пн по птн: с 10.00 до 18.00, сб и вск - выходные;</p>\r\n<p>- Небольшой дружный коллектив;</p>\r\n<p>- Официальное оформление, отпуска, больничные - по ТК РФ;</p>\r\n<p>- Есть возможности карьерного и профессионального роста!</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/426c17b6-0374-11e8-b45c-037acc02728d'),
(30, '29437716-7a6d-11e6-9973-736ab11edb0c', 50, NULL, 107, NULL, '2016-09-14', '2016-09-14 15:38:41', 35000, 'Бармен-кассир в Венскую кофейню', 'Полная занятость', 'Гибкий график', '<p>- Вежливое, качественное и быстрое обслуживание гостей, - Расчет гостей кофейни, - Помощь гостям в выборе блюд и напитков, - Приготовление кофейных напитков, в соответствии со стандартами компании, - Работа с кассой - наличный и безналичный расчет, - Поддержание чистоты рабочего места, оборудования</p>', 'NONE', '<p>Уважаемые кандидаты!В связи с открытием новой сети Венских кофеен Julius Meinl, мы рады сообщить об открытии вакансий бариста в Мега Химки!Ждем в свою команду энергичных и увлеченных людей, желающих развиваться и учиться новому в команде профессионалов!Условия:- Мы предлагаем работу в напряженном режиме, но очень творческую и интересную, - Рабочее место - г. Химки, ТЦ Мега Химки, - Возможны различные графики работв. Официальное трудоустройство, своевременная выплата заработной платы, оплата больничных, отпусков, - Бесплатное питание и обучение;- Заработная плата от 35 000 рублей, в зависимости от отработанных часов, возможны премии.</p>', '<p>Уважаемые кандидаты!В связи с открытием новой сети Венских кофеен Julius Meinl, мы рады сообщить об открытии вакансий бариста в Мега Химки!Ждем в свою команду энергичных и увлеченных людей, желающих развиваться и учиться новому в команде профессионалов!Условия:- Мы предлагаем работу в напряженном режиме, но очень творческую и интересную, - Рабочее место - г. Химки, ТЦ Мега Химки, - Возможны различные графики работв. Официальное трудоустройство, своевременная выплата заработной платы, оплата больничных, отпусков, - Бесплатное питание и обучение;- Заработная плата от 35 000 рублей, в зависимости от отработанных часов, возможны премии.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/29437716-7a6d-11e6-9973-736ab11edb0c'),
(31, 'b34c7a26-01a7-11e8-ab90-736ab11edb0c', 77, NULL, 107, NULL, '2018-01-25', '2018-01-25 15:38:41', 40000, 'Повар-универсал', 'Полная занятость', 'Полный рабочий день', '<p>- Приготовление блюд из меню (заготовки, холодный цех, суповой, горячий цех), ориентация больше на горячий цех- Снятие инвентаризации по остаткам на конец месяца;- Дополнительно к приготовлению блюд - уборка своего рабочего места (плита, оборудование, стол), - При необходимости - обслуживание банкетов (за дополнительную премию)</p>', 'NONE', '<p>Уважаемые кандидаты! Срочно идет набор на вакансию повара-универсала в столовую для врачей и посетителей Федерального научно-клинического центра. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 (8-ми часовой), с 10.00 до 19.00, с воскресенья по четверг, выходные: пятница и суббота, возможно привлечение на банкеты (подработка).Оформление - официальное.Отпуска, больничные - все по ТК РФ.Предусмотрены премии за переработки и обслуживание банкетов.</p>', '<p>Уважаемые кандидаты! Срочно идет набор на вакансию повара-универсала в столовую для врачей и посетителей Федерального научно-клинического центра. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 (8-ми часовой), с 10.00 до 19.00, с воскресенья по четверг, выходные: пятница и суббота, возможно привлечение на банкеты (подработка).Оформление - официальное.Отпуска, больничные - все по ТК РФ.Предусмотрены премии за переработки и обслуживание банкетов.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/b34c7a26-01a7-11e8-ab90-736ab11edb0c'),
(32, '8263d3e6-17a2-11e6-a555-037acc02728d', 77, NULL, 107, NULL, '2016-05-11', '2016-05-11 15:38:41', 35000, 'Повар холодного цеха', 'Полная занятость', 'Полный рабочий день', '<p>- Оформление блюд для бара (сэндвичи, чиабата, бутерброды, багеты, салаты и т.п.), - Распределение и расстановка ассортимента салатов и десертов на линию раздачи, - Работа с технологическими картами, - Приготовление блюд холодного цеха, - Оформление заказа по сырью, - уборка своего рабочего места (плита, оборудование, стол), - При необходимости - обслуживание банкетов.</p>', 'NONE', '<p>Уважаемые кандидаты! На базе Федерального научно-клинического центра (метро Красногвардейская) работает кафетерий и столовая. На сегодняшний день срочно требуются повара холодного цеха. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 с пн по птн, сб и вск - выходные (8-ми часовой). Рабочий день начинается в 7.00.Оформление - официальное;Отпуска, больничные - все по ТК РФ;Бесплатное питание;Возможность подработки</p>', '<p>Уважаемые кандидаты! На базе Федерального научно-клинического центра (метро Красногвардейская) работает кафетерий и столовая. На сегодняшний день срочно требуются повара холодного цеха. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 с пн по птн, сб и вск - выходные (8-ми часовой). Рабочий день начинается в 7.00.Оформление - официальное;Отпуска, больничные - все по ТК РФ;Бесплатное питание;Возможность подработки</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/8263d3e6-17a2-11e6-a555-037acc02728d'),
