(39, '8aa8ba06-8701-11e7-b45a-ef76bd2a03c1', 64, NULL, 111, NULL, '2017-08-22', '2017-08-22 15:38:41', 0, 'Пенсионер с опытом вахтера', 'Полная занятость', 'Полный рабочий день', '<p>Обязанности: Требуется человек для административной работы: прием звонков, осуществление пропускного режима, регистрация посетителей, контроль регламента работы офиса,ведение текущей документации.</p>', 'NONE', '<p>Работа в офисе, доход до 23000 р., хороший коллектив, бесплатная подготовка, возможность карьерного роста и гибкого графика. Обязанности: Требуется человек для административной работы: прием звонков, осуществление пропускного режима, регистрация посетителей, контроль регламента работы офиса,ведение текущей документации.Требования: Честность, ответственность, самостоятельность, доброжелательность, надежность.Тел.609-808</p>', '<p>Работа в офисе, доход до 23000 р., хороший коллектив, бесплатная подготовка, возможность карьерного роста и гибкого графика. Обязанности: Требуется человек для административной работы: прием звонков, осуществление пропускного режима, регистрация посетителей, контроль регламента работы офиса,ведение текущей документации.Требования: Честность, ответственность, самостоятельность, доброжелательность, надежность.Тел.609-808</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1147453004764/8aa8ba06-8701-11e7-b45a-ef76bd2a03c1'),
