(63, '6de66d96-e0c0-11e7-a0f9-037acc02728d', 74, NULL, 100, NULL, '2017-12-14', '2017-12-14 15:38:41', 0, 'Делопроизводитель - кадровик', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Ведение кадрового делопроизводства в полном объеме: прием&sbquo; увольнение&sbquo; отпуска&sbquo; табельный учет;  Работа с соискателями;  Составление и регистрация договоров с контрагентами;&nbsp;  Обработка корреспонденции;  Выполнение поручений руководителя</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/6de66d96-e0c0-11e7-a0f9-037acc02728d'),
(64, '9bba54c6-d8f0-11e7-8639-e37b4be0b9ed', 74, NULL, 126, 3818, '2017-12-04', '2017-12-04 15:38:41', 0, 'Инспектор по кадрам', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Подбор персонала на позиции специалистов (размещение информации в СМИ, проведение телефонных и личных собеседований, оценка профессиональных компетенций соискателей, координация собеседований с руководителями подразделений, формирование базы кандидатов), участие в проектах корпоративного обучения и мероприятиях по формированию корпоративной культуры, контроль соблюдения трудовой дисциплины.  Условия: оформление по ТК РФ, соц. пакет, рассмотрим без опыта, бесплатное обучение.  Требования: желание развиваться в сфере управления персоналом, ориентация на результат, коммуникабельность, умение планировать и грамотно организовывать свое время</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/9bba54c6-d8f0-11e7-8639-e37b4be0b9ed'),
(65, '1af41b56-fd17-11e7-a659-e37b4be0b9ed', 58, NULL, 99, NULL, '2018-01-19', '2018-01-19 15:38:41', 21000, 'Экономист-специалист по кадрам', 'Полная занятость', 'Полный рабочий день', '<span style=\"font-family: Courier New;\">На экономиста возлагаются следующие должностные обязанности:</span>\r\n<span style=\"font-family: Courier New;\">Выполнение работы по осуществлению экономической деятельности бюджетной организации.</span>\r\n<span style=\"font-family: Courier New;\">Подготовка исходных данных для составления проектов хозяйственно-финансовой деятельности бюджетной организации.</span>\r\n<span style=\"font-family: Courier New;\">Выполнение расчетов по необходимым материальным, трудовым и финансовым затратам.</span>\r\n<span style=\"font-family: Courier New;\">Разработка мероприятий по обеспечению режима экономии.</span>\r\n<span style=\"font-family: Courier New;\">Проведение тарификации работников бюджетной организации.</span>\r\n<span style=\"font-family: Courier New;\">Текущее и перспективное планирование финансовой деятельности бюджетной организации.</span>\r\n<span style=\"font-family: Courier New;\">Планирование бюджета.</span>\r\n<span style=\"font-family: Courier New;\">Отражение в бюджетном учете операций по санкционированию бюджетных расходов.</span>\r\n<span style=\"font-family: Courier New;\">Ведение учета сумм лимитов бюджетных обязательств, принятых бюджетных обязательств, бюджетных ассигнований.</span>\r\n<span style=\"font-family: Courier New;\">Отслеживание расходования бюджетных средств.</span>\r\n<span style=\"font-family: Courier New;\">Проведение финансово-экономического анализа, учет и оптимизация хозяйственной и экономической деятельности.</span>\r\n<span style=\"font-family: Courier New;\">Ведение переписки с вышестоящей организацией, администрацией, финансовым органом.</span>\r\n<span style=\"font-family: Courier New;\">Формирование структуры цены, определение цен на предоставление услуг.</span>\r\n<span style=\"font-family: Courier New;\">Оформление материалов для заключения договоров, осуществление контроля за сроками выполнения договорных обязательств.</span>\r\n<span style=\"font-family: Courier New;\">Осуществление контроля за исполнением обязательств по договорам, формирование актов выполненных работ.</span>\r\n<span style=\"font-family: Courier New;\">Подготовка периодической отчетности в установленные сроки.</span>\r\n<span style=\"font-family: Courier New;\">Выполнение работы по формированию, ведению и хранению базы данных экономической информации, внесение изменений в справочную и нормативную информацию, используемую при обработке данных.</span>\r\n\r\n<p>Специалист по&nbsp;кадрам:</p>\r\n<p>Контролирует своевременное оформление приема, перевода и&nbsp;увольнения работников, выдачу справок об&nbsp;их&nbsp;настоящей и&nbsp;прошлой трудовой деятельности, соблюдение правил хранения и&nbsp;заполнения трудовых книжек, подготовку документов для установления льгот и&nbsp;компенсаций, оформления пенсий работникам и&nbsp;другой установленной документации по&nbsp;кадрам, а&nbsp;также внесение соответствующей информации в&nbsp;банк данных о&nbsp;персонале предприятия.</p>\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'NONE', '<p>Требуется экономист со знанием работы по кадрам в бюджетной организации</p>', '<p>Требуется экономист со знанием работы по кадрам в бюджетной организации</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1025801359176/1af41b56-fd17-11e7-a659-e37b4be0b9ed'),
