(69, '8e8f8566-d506-11e7-bf93-037acc02728d', 74, NULL, 126, NULL, '2017-11-29', '2017-11-29 15:38:41', 0, 'Работа / подработка', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Работа за компьютером с выходом в интернет. Занимает не более 2-ух часов в день. В обязанности входит размещение объявлений на cайтах, форумах, работа с электронной почтой. Если Вы&nbsp;студент&nbsp;или просто ищите дополнительный заработок, то эта работа для Вас!  Усидчивость, нацеленность на результат. Без опыта.  Работа занимает не более 2-ух часов в день. График составляете сами. Можно на дому.</p>\r\n<p>&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/8e8f8566-d506-11e7-bf93-037acc02728d'),
