(74, 'a9e42576-d446-11e7-bf93-037acc02728d', 74, NULL, 126, NULL, '2017-11-28', '2017-11-28 15:38:41', 0, 'Архивовед', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Обязанности: прием звонков, но в основном работа с документацией: создание архива офиса. быстро ориентироваться в нем. (опыт работы с документацией приветствуется)&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/a9e42576-d446-11e7-bf93-037acc02728d'),
