(76, 'c6024476-d983-11e7-be91-736ab11edb0c', 74, NULL, 126, 5023, '2017-12-05', '2017-12-05 15:38:41', 0, 'Административный секретарь', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Условия: Работа на территории работодателя, бесплатное обучение, карьерный рост, оплата своевременная, рассмотрим без опыта работы, соц.пакет.</p>\r\n<p>Требования: Деловой внешний вид, исполнительность, коммуникабельность.</p>\r\n<p>Обязанности: Прием телефонных звонков и обработка корреспонденции, ведение делопроизводства.</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/c6024476-d983-11e7-be91-736ab11edb0c'),
(77, '729fc636-d989-11e7-be91-736ab11edb0c', 74, NULL, 115, NULL, '2017-12-05', '2017-12-05 15:38:41', 0, 'Торговый представитель (гиб / гр)', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> ОБЯЗАННОСТИ:&nbsp;  оформление заявок, переговоры с клиентами, заключение договоров и контрактов.&nbsp;  ТРЕБОВАНИЯ:&nbsp;  коммуникабельность, целеустремленность, умение работать в команде, исполнительность.  УСЛОВИЯ:&nbsp;  гибкий график, рассмотрим студентов, соц.пакет, рассмотрим без опыта работы, карьерный рост, дружный коллектив.</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/729fc636-d989-11e7-be91-736ab11edb0c'),
(78, 'aa8af1b0-d9b5-11e7-be91-736ab11edb0c', 74, NULL, 98, NULL, '2017-12-05', '2017-12-05 15:38:41', 0, 'Специалист по работе со СМИ', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Обязанности:  &ndash; мониторинг СМИ,  &ndash; организация публикаций,  &ndash; поддержка контактов с представителями СМИ,  &ndash; ведение архива публикаций.  Требования:  - коммуникабельность  - навыки ведения переговоров  - грамотная речь  - обучаемость  - уверенный пользователь ПК  - активность, мобильность  Условия:  - стабильная интересная работа в динамично развивающейся компании  - возможность профессионального развития и карьерного роста  - условия обсуждаются с успешными кандидатами (возможны индивидуальные условия)  - полная занятость (5 дней в неделю, с 09-00 до 17-00) либо частичная  - офис в центре города&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/aa8af1b0-d9b5-11e7-be91-736ab11edb0c'),
(79, '6f9ae8b6-f627-11e7-9133-e37b4be0b9ed', 74, NULL, 99, NULL, '2018-01-10', '2018-01-10 15:38:41', 0, 'Помощник бухгалтера обучение', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Обязанности:  - прием звонков, оформление заявок  - работа с деловой документацией  - отчетная и текущая документация  Условия:  - полное оформление по ТК  - гибкий график (4,6,8 &ndash; часовой день)  - карьерный и профессиональный рост  Требования:  - пользователь ПК  - рассмотрим студентов</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/6f9ae8b6-f627-11e7-9133-e37b4be0b9ed'),
