(84, 'd7cbdea0-c6d7-11e7-aa78-037acc02728d', 77, NULL, 128, NULL, '2017-11-11', '2017-11-11 15:38:41', 45000, 'охранник (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа на складских обьектах</p>\r\n<p>-работа в пром зоне</p>\r\n<p>-работа в производственном цеху</p>\r\n<p>-работа на строительных обьектах</p>', 'NONE', '<p>-работа вахтовым методом (общежитие предоставляется в день обращения)</p>\r\n<p>-оформление официальное в офисе в день обращения</p>\r\n<p>-питание предоставляется в рабочую смену</p>\r\n<p>-каждая последующая вахта оплачивается по большим ставкам</p>', '<p>-работа вахтовым методом (общежитие предоставляется в день обращения)</p>\r\n<p>-оформление официальное в офисе в день обращения</p>\r\n<p>-питание предоставляется в рабочую смену</p>\r\n<p>-каждая последующая вахта оплачивается по большим ставкам</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/d7cbdea0-c6d7-11e7-aa78-037acc02728d'),
