(86, '53639046-c222-11e7-808d-736ab11edb0c', 77, NULL, 124, NULL, '2017-11-05', '2017-11-05 15:38:41', 0, 'повар (холодный цех) вахта', 'Полная занятость', 'Полный рабочий день', '<p>-работа в холодном цеху</p>\r\n<p>-работа с полуфабрикатами</p>\r\n<p>-заготовки&nbsp;</p>\r\n<p>-поддержание чистоты на рабочем месте,соблюдение санитарных норм и правил</p>', 'NONE', '<p>рабочая смена 7-0 или 6-1 (9 часовая рабочая смена).Основные обязанности--работа в холодном цеху,соблюдение санитарных норм и правил,поддержание порядка в рабочей зоне.</p>', '<p>рабочая смена 7-0 или 6-1 (9 часовая рабочая смена).Основные обязанности--работа в холодном цеху,соблюдение санитарных норм и правил,поддержание порядка в рабочей зоне.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/53639046-c222-11e7-808d-736ab11edb0c'),
(87, '21bb7a90-c226-11e7-808d-736ab11edb0c', 77, NULL, 97, NULL, '2017-11-05', '2017-11-05 15:38:41', 45000, 'разнорабочий в теплицу', 'Полная занятость', 'Вахтовый метод', '<p>-работа в парниках и теплицах</p>\r\n<p>-уход,полив и обработка растений</p>', 'NONE', '<p>-работа на грядках(в теплицах)</p>\r\n<p>-окучивание,уход</p>\r\n<p>-полив,обработка</p>', '<p>-работа на грядках(в теплицах)</p>\r\n<p>-окучивание,уход</p>\r\n<p>-полив,обработка</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/21bb7a90-c226-11e7-808d-736ab11edb0c'),
(88, '5fce9c86-dd8e-11e7-b0b8-ef76bd2a03c1', 77, NULL, 128, NULL, '2017-12-10', '2017-12-10 15:38:41', 45000, 'подсобный рабочий на птицефабрику (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа на птицефабрике (подмосковье г.Сходня),подсобные рабочие и оператор линии</p>', 'NONE', '<p>оформление официальное по ТК(возможно и по трудовому договору),оформление в день обращения в офис,заселение в общежитие в день обращения и оформления.</p>', '<p>оформление официальное по ТК(возможно и по трудовому договору),оформление в день обращения в офис,заселение в общежитие в день обращения и оформления.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/5fce9c86-dd8e-11e7-b0b8-ef76bd2a03c1'),
(89, '878d3d56-c306-11e7-a62f-736ab11edb0c', 77, NULL, 97, NULL, '2017-11-06', '2017-11-06 15:38:41', 55000, 'продавец (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа в торговом зале</p>\r\n<p>-работа в складских помещениях</p>', 'NONE', '<p>-работа в торговрм зале</p>\r\n<p>-работа с продуктами питания (или в прмышленном отделе)</p>\r\n<p>-оформление в офисе в Москве в день обращения</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-предоставление спецодежды и питания</p>\r\n<p>-авансовые выплаты возможны еженедельно</p>\r\n<p>-обучение и переобучение за счет работодателя без потери в з.пл.</p>', '<p>-работа в торговрм зале</p>\r\n<p>-работа с продуктами питания (или в прмышленном отделе)</p>\r\n<p>-оформление в офисе в Москве в день обращения</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-предоставление спецодежды и питания</p>\r\n<p>-авансовые выплаты возможны еженедельно</p>\r\n<p>-обучение и переобучение за счет работодателя без потери в з.пл.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/878d3d56-c306-11e7-a62f-736ab11edb0c'),
(90, 'e8ed12a6-bf96-11e7-808d-736ab11edb0c', 77, NULL, 124, NULL, '2017-11-02', '2017-11-02 15:38:41', 50000, 'комплектовщик готовой продукции (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа со сканером</p>\r\n<p>-стикеровка готовой продукции</p>\r\n<p>-работа на линии готовой продукции</p>\r\n<p>-отправка сформированных заказов в складскую зону</p>', 'NONE', '<p>Работа вахтовым методом.Общежитие и питание--предоставляется.Оформление официальное с первого дня обращения в офис,заселение в общежитие в день обращения в офис.Питание и спецодежда-- предоставляются...График 6-1 или 7-0 (11 часовая рабочая смена)-140 р.час.Работа на &nbsp;складе готовой продукции,работа со стикером-комплектация заказов и отправка в складскую зону.Работа не сложная--не требующая квалификации и навыков--обучение в процессе работы (за счет работодателя).Наши бригадиры и координаторы всему научат и передадут вам свой опыт..</p>', '<p>Работа вахтовым методом.Общежитие и питание--предоставляется.Оформление официальное с первого дня обращения в офис,заселение в общежитие в день обращения в офис.Питание и спецодежда-- предоставляются...График 6-1 или 7-0 (11 часовая рабочая смена)-140 р.час.Работа на &nbsp;складе готовой продукции,работа со стикером-комплектация заказов и отправка в складскую зону.Работа не сложная--не требующая квалификации и навыков--обучение в процессе работы (за счет работодателя).Наши бригадиры и координаторы всему научат и передадут вам свой опыт..</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/e8ed12a6-bf96-11e7-808d-736ab11edb0c'),
(91, '15b67316-c309-11e7-a62f-736ab11edb0c', 77, NULL, 128, NULL, '2017-11-06', '2017-11-06 15:38:41', 55000, 'стикеровщица на кондитерское производство (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>стикеровка,упаковка,сборка</p>', 'NONE', '<p>-стикеровка готовой продукции (пирожных)</p>\r\n<p>-укладка и упаковка готовой продукции</p>\r\n<p>-сборка заказов</p>', '<p>-стикеровка готовой продукции (пирожных)</p>\r\n<p>-укладка и упаковка готовой продукции</p>\r\n<p>-сборка заказов</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/15b67316-c309-11e7-a62f-736ab11edb0c');
