(92, 'e1a65536-9d48-11e7-9620-4376a32b3f45', 50, NULL, 124, 460, '2017-09-19', '2017-09-19 15:38:41', 45000, 'грузчик', 'Полная занятость', 'Полный рабочий день', '<p>-погрузка и разгрузка на складе готовой продукции и на складе сырья.</p>', 'NONE', '<p>В компанию по производству соусов требуются сотрудники на вакансии грузчик &nbsp;и оператор линии.Работа вахтовым методом в Московской области г.Егорьевске--проживание в общежитии(хорошее,новое).Вахта от 40 дней.Оформление официальное &nbsp;с первого дня, в офисе в Москве при наличии всего пакета документов необходимых для работы в Москве и области.Денежные авансовые выплаты производятся на карту и возможны -еженедельно.На все вопросы отвечу по тел 89031999040 или почта.</p>', '<p>В компанию по производству соусов требуются сотрудники на вакансии грузчик &nbsp;и оператор линии.Работа вахтовым методом в Московской области г.Егорьевске--проживание в общежитии(хорошее,новое).Вахта от 40 дней.Оформление официальное &nbsp;с первого дня, в офисе в Москве при наличии всего пакета документов необходимых для работы в Москве и области.Денежные авансовые выплаты производятся на карту и возможны -еженедельно.На все вопросы отвечу по тел 89031999040 или почта.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/e1a65536-9d48-11e7-9620-4376a32b3f45'),
(93, '7ce9c576-f1fb-11e7-a860-736ab11edb0c', 77, NULL, 128, NULL, '2018-01-05', '2018-01-05 15:38:41', 55000, 'сборщик на производство косметики и парфюмерии (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-сборка товара и изделий(пластиковая упаковка)</p>\r\n<p>-комплектация товара</p>\r\n<p>-работа со стикером</p>\r\n<p>-сборка&nbsp; и упаковка</p>', 'NONE', '<p>-вахта 45-60 дней,</p>\r\n<p>-оформление (по ТК официальное) в день обращения в офис</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-каждая последующая вахта оплачивается дороже</p>', '<p>-вахта 45-60 дней,</p>\r\n<p>-оформление (по ТК официальное) в день обращения в офис</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-каждая последующая вахта оплачивается дороже</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/7ce9c576-f1fb-11e7-a860-736ab11edb0c'),
(94, '01351646-bf98-11e7-808d-736ab11edb0c', 77, NULL, 97, NULL, '2017-11-02', '2017-11-02 15:38:41', 55000, 'стикеровщик -комплектовщик (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа на складе готовой продукции</p>\r\n<p>-работа на линии производства</p>\r\n<p>-работа со сканером и стикером</p>\r\n<p>-сборка заказов(комплектация)</p>\r\n<p>-отправка заказов в складскую зону</p>', 'NONE', '<p>Работа вахтовым методом (вахта от 45 дней)</p>\r\n<p>-график работы 7-0 или 6-1 (11 часовая рабочая смена)</p>\r\n<p>-оформление официальное по ТК РФ (при наличии всех документов)</p>\r\n<p>-заселение в общежитие в день обращения (комнаты на 4-6 чел)для семейных пар тоже есть возможность заселиться</p>\r\n<p>-оплата по окончанию срока вахты(в день окончания)на карту любого банка(иметь при себе выписку--расчетный счет)</p>\r\n<p>-общежитие и питание предоставляется (почти на всех обьктах)</p>\r\n<p>-возможны еженедельные авансовые выплаты(2000 р. или 3000 р.)</p>\r\n<p>-работа не сложная ,не требующая профессиональных навыков и квалификации(всему научаи наши мастера и бригадиры)</p>', '<p>Работа вахтовым методом (вахта от 45 дней)</p>\r\n<p>-график работы 7-0 или 6-1 (11 часовая рабочая смена)</p>\r\n<p>-оформление официальное по ТК РФ (при наличии всех документов)</p>\r\n<p>-заселение в общежитие в день обращения (комнаты на 4-6 чел)для семейных пар тоже есть возможность заселиться</p>\r\n<p>-оплата по окончанию срока вахты(в день окончания)на карту любого банка(иметь при себе выписку--расчетный счет)</p>\r\n<p>-общежитие и питание предоставляется (почти на всех обьктах)</p>\r\n<p>-возможны еженедельные авансовые выплаты(2000 р. или 3000 р.)</p>\r\n<p>-работа не сложная ,не требующая профессиональных навыков и квалификации(всему научаи наши мастера и бригадиры)</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/01351646-bf98-11e7-808d-736ab11edb0c'),
(95, '2a96b106-c8a4-11e7-bbb7-736ab11edb0c', 77, NULL, 97, NULL, '2017-11-13', '2017-11-13 15:38:41', 45000, 'кассир (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа за кассой в торговом зале</p>', 'NONE', '<p>-работа вахтой (каждая последующая вахта оплачивается выше)</p>\r\n<p>-общежитие и питание предоставляется</p>\r\n<p>-проезд оплачивается</p>\r\n<p>-рабочие смены 7-0 или 6-1</p>', '<p>-работа вахтой (каждая последующая вахта оплачивается выше)</p>\r\n<p>-общежитие и питание предоставляется</p>\r\n<p>-проезд оплачивается</p>\r\n<p>-рабочие смены 7-0 или 6-1</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/2a96b106-c8a4-11e7-bbb7-736ab11edb0c'),
