(114, '94caafb6-b37b-11e7-8a04-037acc02728d', 61, NULL, 126, NULL, '2017-10-17', '2017-10-17 15:39:24', 15000, 'Помощник менеджера', 'Полная занятость', 'Полный рабочий день', '<p>Составление и рассылка писем, объявлений, организация скайп-консультаций, ведение отчетности и баз данных, подготовка материалов для создания презентаций. </p>', 'NONE', '<p>Работа удаленная. График работы устанавливается индивидуально по согласованию, возможность совмещения с другой работой или учебой, оплата на банковский счет, возможность роста по итогам работы, оформление согласно законодательству.</p>\r\n<p>Кандидатов по телефону не консультируем, просьба писать на эл.почту - \"откликнуться\".</p>', '<p>Работа удаленная. График работы устанавливается индивидуально по согласованию, возможность совмещения с другой работой или учебой, оплата на банковский счет, возможность роста по итогам работы, оформление согласно законодательству.</p>\r\n<p>Кандидатов по телефону не консультируем, просьба писать на эл.почту - \"откликнуться\".</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/311619004800026/94caafb6-b37b-11e7-8a04-037acc02728d'),
