(132, '8263d3e6-17a2-11e6-a555-037acc02728d', 77, NULL, 107, NULL, '2016-05-11', '2016-05-11 15:39:24', 35000, 'Повар холодного цеха', 'Полная занятость', 'Полный рабочий день', '<p>- Оформление блюд для бара (сэндвичи, чиабата, бутерброды, багеты, салаты и т.п.), - Распределение и расстановка ассортимента салатов и десертов на линию раздачи, - Работа с технологическими картами, - Приготовление блюд холодного цеха, - Оформление заказа по сырью, - уборка своего рабочего места (плита, оборудование, стол), - При необходимости - обслуживание банкетов.</p>', 'NONE', '<p>Уважаемые кандидаты! На базе Федерального научно-клинического центра (метро Красногвардейская) работает кафетерий и столовая. На сегодняшний день срочно требуются повара холодного цеха. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 с пн по птн, сб и вск - выходные (8-ми часовой). Рабочий день начинается в 7.00.Оформление - официальное;Отпуска, больничные - все по ТК РФ;Бесплатное питание;Возможность подработки</p>', '<p>Уважаемые кандидаты! На базе Федерального научно-клинического центра (метро Красногвардейская) работает кафетерий и столовая. На сегодняшний день срочно требуются повара холодного цеха. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 с пн по птн, сб и вск - выходные (8-ми часовой). Рабочий день начинается в 7.00.Оформление - официальное;Отпуска, больничные - все по ТК РФ;Бесплатное питание;Возможность подработки</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/8263d3e6-17a2-11e6-a555-037acc02728d'),
(133, 'c030d846-066c-11e6-9aa0-736ab11edb0c', 77, NULL, 107, NULL, '2016-04-19', '2016-04-19 15:39:24', 40000, 'Повар горячего цеха', 'Полная занятость', 'Полный рабочий день', '<p>- Приготовление блюд из меню (суповой, горячий цех, мясо-рыбный) с соблюдением технологических карт, - Размораживание и приготовление мяса и рыбы к кулинарной обработке, разделка, обвалка и чистка, - Приготовление мясных и рыбных полуфабрикатов;- Снятие инвентаризации по остаткам на конец месяца;- Дополнительно к приготовлению блюд - уборка своего рабочего места (плита, оборудование, стол), - При необходимости - обслуживание банкетов;- Соблюдение требований санитарии и безопасности труда, соблюдение товарного соседства;- Соблюдение стандартов сервиса компании.</p>', 'NONE', '<p>Уважаемые кандидаты! На базе Федерального научно-клинического центра (метро Красногвардейская) работает кафетерий и столовая. На сегодняшний день срочно требуются повара горячего цеха. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 (8-ми часовой). Рабочий день начинается в 7.00 с пн по птн, суббота и вск - выходные.Оформление - официальное в госучреждение Федерального научно-клинического центра.Отпуска, больничные - все по ТК РФ.</p>', '<p>Уважаемые кандидаты! На базе Федерального научно-клинического центра (метро Красногвардейская) работает кафетерий и столовая. На сегодняшний день срочно требуются повара горячего цеха. Будем рады принять в наш коллектив ответственных и перспективных сотрудников!График работы - 5/2 (8-ми часовой). Рабочий день начинается в 7.00 с пн по птн, суббота и вск - выходные.Оформление - официальное в госучреждение Федерального научно-клинического центра.Отпуска, больничные - все по ТК РФ.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/c030d846-066c-11e6-9aa0-736ab11edb0c'),
(134, '3e8a35c7-116e-11e8-8d7b-736ab11edb0c', 77, NULL, 127, 4493, '2018-02-14', '2018-02-14 15:39:24', 40000, 'ЮРИСТ', 'Полная занятость', 'Полный рабочий день', '<p>- ведение дел в судах и арбитражных судах;</p>\r\n<p>- правовое сопровождение деятельности предприятий;</p>\r\n<p>- консультирование граждан и представителей предприятий;</p>\r\n<p>- составление договоров, соглашений, жалоб, заявлений и проч.</p>\r\n<p>&nbsp;</p>', 'NONE', '<p>- стабильная и постоянная работа;</p>\r\n<p>- официальное оформление на работу (трудовой договор, запись в трудовую книжку);</p>\r\n<p>- рабочий день с 10.00 час. до 18.00 час.;</p>\r\n<p>- обед с 13.00 час. до 14.00 час.;</p>\r\n<p>- предоставление очередного ежегодного отпуска;</p>\r\n<p>- возможность совмещать обучение и работу;</p>\r\n<p>- оборудованное рабочее место (ПК, Интернет, Консультант Плюс)</p>', '<p>- стабильная и постоянная работа;</p>\r\n<p>- официальное оформление на работу (трудовой договор, запись в трудовую книжку);</p>\r\n<p>- рабочий день с 10.00 час. до 18.00 час.;</p>\r\n<p>- обед с 13.00 час. до 14.00 час.;</p>\r\n<p>- предоставление очередного ежегодного отпуска;</p>\r\n<p>- возможность совмещать обучение и работу;</p>\r\n<p>- оборудованное рабочее место (ПК, Интернет, Консультант Плюс)</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1087746833327/3e8a35c7-116e-11e8-8d7b-736ab11edb0c'),
