(171, '6c8144a6-d451-11e7-bf93-037acc02728d', 74, NULL, 109, NULL, '2017-11-28', '2017-11-28 15:39:24', 0, 'Ассистент руководителя', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Обязанности:  &bull; Ведение переговоров и заключение договоров  &bull; Прием звонков  &bull; Оформление документов  &bull; Ведение отчетности  &bull; организация мероприятий по повышению квалификации работников  &bull; контроль над работой сотрудников  &bull; планирование работы&nbsp;руководителя  &bull; выполнение поручений&nbsp;руководителя  Требования:  &bull; Ответственность  &bull; Обучаемость  &bull; Грамотность  &bull; Аккуратность  &bull; Креативность приветствуется  &bull; Знание ПК на уровне пользователя приветствуется  Условия:  &bull; График работы 5/2&nbsp;  &bull; Офис в центре города  &bull; Карьерный рост  &bull; Обучение за счет компании  &bull; Возможность личностного роста  &bull; Дружный коллектив</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/6c8144a6-d451-11e7-bf93-037acc02728d'),
