(175, 'a59e4526-d97a-11e7-be91-736ab11edb0c', 74, NULL, 127, NULL, '2017-12-05', '2017-12-05 15:39:24', 0, 'Помощник юриста', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Обязанности: Подготовка и заключение договоров&sbquo; контроль деловой документацией компании&sbquo; подготовка предложений для руководителя (юридическое сопровождение оформления и заключения договоров и контрактов )  Условия: работа от прямого работодателя&sbquo; предлагается полный корпоративный соцпакет&sbquo; график работы скользящий&sbquo; 5/2, рассматриваются студенты заочных отделений&sbquo; молодые пенсионеры&sbquo; карьера&sbquo; высокий доход, загранпоездки от компании</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/a59e4526-d97a-11e7-be91-736ab11edb0c'),
