(181, 'a723fbe6-f7a4-11e7-9699-037acc02728d', 74, NULL, 115, NULL, '2018-01-12', '2018-01-12 15:39:24', 0, 'Водителям - экспедиторам', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Условия  Гибкий график, официальное трудоустройство, полный соц. пакет.  Требования  ответственность,&nbsp;  пунктуальность,&nbsp;  исполнительность  Обязанности  Работа с документацией, товарами для дома  (накладные, счет - фактуры).</p>\r\n<p>&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/a723fbe6-f7a4-11e7-9699-037acc02728d'),
(182, '48611da6-f7a8-11e7-9699-037acc02728d', 74, NULL, 98, NULL, '2018-01-12', '2018-01-12 15:39:24', 0, 'Специалист по пиар', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Требования:  уверенный пользователь ПК&sbquo; умение проводить телефонные переговоры&sbquo; активная жизненная позиция&sbquo; исполнительность&sbquo; креативность.&nbsp;  Обязанности:  взаимодействие со СМИ&sbquo; написание статей и текстов.  Условия:  дружный коллектив&sbquo; корпоративные мероприятия.</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/48611da6-f7a8-11e7-9699-037acc02728d'),
(183, '7ed2cda6-04bb-11e8-a882-e37b4be0b9ed', 74, NULL, 125, NULL, '2018-01-29', '2018-01-29 15:39:24', 0, 'Педагог лектор', 'Полная занятость', 'Полный рабочий день', '<p> Разработка учебных курсов, подборка учебных групп, проведение учебных занятий семинаров и лекций, ведение документации.  Требования: внимательность, знание ПК на уровне пользователя, исполнительность  Условия: оформление по ТК полный соц.пакет, возможность совмещения, рассмотрим студентов, график работы 5\\2, 2\\2, своевременная оплата, финансовый и карьерный рост, загранпоездки (по желанию)</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/7ed2cda6-04bb-11e8-a882-e37b4be0b9ed'),
(184, 'd7cbdea0-c6d7-11e7-aa78-037acc02728d', 77, NULL, 128, NULL, '2017-11-11', '2017-11-11 15:39:24', 45000, 'охранник (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа на складских обьектах</p>\r\n<p>-работа в пром зоне</p>\r\n<p>-работа в производственном цеху</p>\r\n<p>-работа на строительных обьектах</p>', 'NONE', '<p>-работа вахтовым методом (общежитие предоставляется в день обращения)</p>\r\n<p>-оформление официальное в офисе в день обращения</p>\r\n<p>-питание предоставляется в рабочую смену</p>\r\n<p>-каждая последующая вахта оплачивается по большим ставкам</p>', '<p>-работа вахтовым методом (общежитие предоставляется в день обращения)</p>\r\n<p>-оформление официальное в офисе в день обращения</p>\r\n<p>-питание предоставляется в рабочую смену</p>\r\n<p>-каждая последующая вахта оплачивается по большим ставкам</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/d7cbdea0-c6d7-11e7-aa78-037acc02728d'),
(185, '08f50d86-d29f-11e7-bcaf-ef76bd2a03c1', 77, NULL, 97, NULL, '2017-11-26', '2017-11-26 15:39:24', 25000, 'работник торгового зала (не вахта)', 'Полная занятость', 'Полный рабочий день', '<p>работа в торговом зале--следить за наличием товара,следить за изменением цен(ценники),выкладка,соблюдение норм хранения на торговом прилавке(витрине)</p>', 'NONE', '<p>работа в торговом зале---с продовольственными товарами,выкладка с соблюдением режима хранения и продаж,следить за изминением цен,сортировка--отбраковка,пересортица,</p>', '<p>работа в торговом зале---с продовольственными товарами,выкладка с соблюдением режима хранения и продаж,следить за изминением цен,сортировка--отбраковка,пересортица,</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/08f50d86-d29f-11e7-bcaf-ef76bd2a03c1'),
(186, '53639046-c222-11e7-808d-736ab11edb0c', 77, NULL, 124, NULL, '2017-11-05', '2017-11-05 15:39:24', 0, 'повар (холодный цех) вахта', 'Полная занятость', 'Полный рабочий день', '<p>-работа в холодном цеху</p>\r\n<p>-работа с полуфабрикатами</p>\r\n<p>-заготовки&nbsp;</p>\r\n<p>-поддержание чистоты на рабочем месте,соблюдение санитарных норм и правил</p>', 'NONE', '<p>рабочая смена 7-0 или 6-1 (9 часовая рабочая смена).Основные обязанности--работа в холодном цеху,соблюдение санитарных норм и правил,поддержание порядка в рабочей зоне.</p>', '<p>рабочая смена 7-0 или 6-1 (9 часовая рабочая смена).Основные обязанности--работа в холодном цеху,соблюдение санитарных норм и правил,поддержание порядка в рабочей зоне.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/53639046-c222-11e7-808d-736ab11edb0c'),
(187, '21bb7a90-c226-11e7-808d-736ab11edb0c', 77, NULL, 97, NULL, '2017-11-05', '2017-11-05 15:39:24', 45000, 'разнорабочий в теплицу', 'Полная занятость', 'Вахтовый метод', '<p>-работа в парниках и теплицах</p>\r\n<p>-уход,полив и обработка растений</p>', 'NONE', '<p>-работа на грядках(в теплицах)</p>\r\n<p>-окучивание,уход</p>\r\n<p>-полив,обработка</p>', '<p>-работа на грядках(в теплицах)</p>\r\n<p>-окучивание,уход</p>\r\n<p>-полив,обработка</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/21bb7a90-c226-11e7-808d-736ab11edb0c'),
(188, '5fce9c86-dd8e-11e7-b0b8-ef76bd2a03c1', 77, NULL, 128, NULL, '2017-12-10', '2017-12-10 15:39:24', 45000, 'подсобный рабочий на птицефабрику (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа на птицефабрике (подмосковье г.Сходня),подсобные рабочие и оператор линии</p>', 'NONE', '<p>оформление официальное по ТК(возможно и по трудовому договору),оформление в день обращения в офис,заселение в общежитие в день обращения и оформления.</p>', '<p>оформление официальное по ТК(возможно и по трудовому договору),оформление в день обращения в офис,заселение в общежитие в день обращения и оформления.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/5fce9c86-dd8e-11e7-b0b8-ef76bd2a03c1'),
(189, '878d3d56-c306-11e7-a62f-736ab11edb0c', 77, NULL, 97, NULL, '2017-11-06', '2017-11-06 15:39:24', 55000, 'продавец (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа в торговом зале</p>\r\n<p>-работа в складских помещениях</p>', 'NONE', '<p>-работа в торговрм зале</p>\r\n<p>-работа с продуктами питания (или в прмышленном отделе)</p>\r\n<p>-оформление в офисе в Москве в день обращения</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-предоставление спецодежды и питания</p>\r\n<p>-авансовые выплаты возможны еженедельно</p>\r\n<p>-обучение и переобучение за счет работодателя без потери в з.пл.</p>', '<p>-работа в торговрм зале</p>\r\n<p>-работа с продуктами питания (или в прмышленном отделе)</p>\r\n<p>-оформление в офисе в Москве в день обращения</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-предоставление спецодежды и питания</p>\r\n<p>-авансовые выплаты возможны еженедельно</p>\r\n<p>-обучение и переобучение за счет работодателя без потери в з.пл.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/878d3d56-c306-11e7-a62f-736ab11edb0c'),
(190, 'e8ed12a6-bf96-11e7-808d-736ab11edb0c', 77, NULL, 124, NULL, '2017-11-02', '2017-11-02 15:39:24', 50000, 'комплектовщик готовой продукции (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-работа со сканером</p>\r\n<p>-стикеровка готовой продукции</p>\r\n<p>-работа на линии готовой продукции</p>\r\n<p>-отправка сформированных заказов в складскую зону</p>', 'NONE', '<p>Работа вахтовым методом.Общежитие и питание--предоставляется.Оформление официальное с первого дня обращения в офис,заселение в общежитие в день обращения в офис.Питание и спецодежда-- предоставляются...График 6-1 или 7-0 (11 часовая рабочая смена)-140 р.час.Работа на &nbsp;складе готовой продукции,работа со стикером-комплектация заказов и отправка в складскую зону.Работа не сложная--не требующая квалификации и навыков--обучение в процессе работы (за счет работодателя).Наши бригадиры и координаторы всему научат и передадут вам свой опыт..</p>', '<p>Работа вахтовым методом.Общежитие и питание--предоставляется.Оформление официальное с первого дня обращения в офис,заселение в общежитие в день обращения в офис.Питание и спецодежда-- предоставляются...График 6-1 или 7-0 (11 часовая рабочая смена)-140 р.час.Работа на &nbsp;складе готовой продукции,работа со стикером-комплектация заказов и отправка в складскую зону.Работа не сложная--не требующая квалификации и навыков--обучение в процессе работы (за счет работодателя).Наши бригадиры и координаторы всему научат и передадут вам свой опыт..</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/e8ed12a6-bf96-11e7-808d-736ab11edb0c'),
(191, '15b67316-c309-11e7-a62f-736ab11edb0c', 77, NULL, 128, NULL, '2017-11-06', '2017-11-06 15:39:24', 55000, 'стикеровщица на кондитерское производство (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>стикеровка,упаковка,сборка</p>', 'NONE', '<p>-стикеровка готовой продукции (пирожных)</p>\r\n<p>-укладка и упаковка готовой продукции</p>\r\n<p>-сборка заказов</p>', '<p>-стикеровка готовой продукции (пирожных)</p>\r\n<p>-укладка и упаковка готовой продукции</p>\r\n<p>-сборка заказов</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/15b67316-c309-11e7-a62f-736ab11edb0c'),
(192, 'e1a65536-9d48-11e7-9620-4376a32b3f45', 50, NULL, 124, 460, '2017-09-19', '2017-09-19 15:39:24', 45000, 'грузчик', 'Полная занятость', 'Полный рабочий день', '<p>-погрузка и разгрузка на складе готовой продукции и на складе сырья.</p>', 'NONE', '<p>В компанию по производству соусов требуются сотрудники на вакансии грузчик &nbsp;и оператор линии.Работа вахтовым методом в Московской области г.Егорьевске--проживание в общежитии(хорошее,новое).Вахта от 40 дней.Оформление официальное &nbsp;с первого дня, в офисе в Москве при наличии всего пакета документов необходимых для работы в Москве и области.Денежные авансовые выплаты производятся на карту и возможны -еженедельно.На все вопросы отвечу по тел 89031999040 или почта.</p>', '<p>В компанию по производству соусов требуются сотрудники на вакансии грузчик &nbsp;и оператор линии.Работа вахтовым методом в Московской области г.Егорьевске--проживание в общежитии(хорошее,новое).Вахта от 40 дней.Оформление официальное &nbsp;с первого дня, в офисе в Москве при наличии всего пакета документов необходимых для работы в Москве и области.Денежные авансовые выплаты производятся на карту и возможны -еженедельно.На все вопросы отвечу по тел 89031999040 или почта.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/e1a65536-9d48-11e7-9620-4376a32b3f45'),
(193, '7ce9c576-f1fb-11e7-a860-736ab11edb0c', 77, NULL, 128, NULL, '2018-01-05', '2018-01-05 15:39:24', 55000, 'сборщик на производство косметики и парфюмерии (вахта)', 'Полная занятость', 'Вахтовый метод', '<p>-сборка товара и изделий(пластиковая упаковка)</p>\r\n<p>-комплектация товара</p>\r\n<p>-работа со стикером</p>\r\n<p>-сборка&nbsp; и упаковка</p>', 'NONE', '<p>-вахта 45-60 дней,</p>\r\n<p>-оформление (по ТК официальное) в день обращения в офис</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-каждая последующая вахта оплачивается дороже</p>', '<p>-вахта 45-60 дней,</p>\r\n<p>-оформление (по ТК официальное) в день обращения в офис</p>\r\n<p>-заселение в общежитие в день обращения</p>\r\n<p>-каждая последующая вахта оплачивается дороже</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/7ce9c576-f1fb-11e7-a860-736ab11edb0c'),
