(200, '98cf16c6-87d2-11e7-9e02-736ab11edb0c', 29, NULL, 121, NULL, '2017-08-23', '2017-08-23 15:39:24', 20000, 'Back-end разработчик', 'Полная занятость', 'Полный рабочий день', '<p>Разработка новых проектов и сопровождение существующих.</p>', 'NONE', '<p><strong>Требования:</strong> Английский - чтение профессиональной литературы. Образование не имеет значения. Опыт работы в данной области 1-2 года. Знание языков программирования: php(5.6+), javascript(ES6+). Знание языков разметки: HTML5, CSS3. Умение пользоваться системой контроля версий git. Знание PSR, Шаблонов проектирования, REST. Умение разбираться в чужом коде. Понимание протокола http/http2 и технологии ajax (xmlhttprequest) Не обязательно: уверенное обращение с unix системами, знание инструментов сборки таких как gulp, webpack. <strong>Условия работы:</strong> ТК РФ, 6-часовой рабочий день, премии. <strong> Обязанности:</strong> Разработка новых проектов и сопровождение существующих.</p>', '<p><strong>Требования:</strong> Английский - чтение профессиональной литературы. Образование не имеет значения. Опыт работы в данной области 1-2 года. Знание языков программирования: php(5.6+), javascript(ES6+). Знание языков разметки: HTML5, CSS3. Умение пользоваться системой контроля версий git. Знание PSR, Шаблонов проектирования, REST. Умение разбираться в чужом коде. Понимание протокола http/http2 и технологии ajax (xmlhttprequest) Не обязательно: уверенное обращение с unix системами, знание инструментов сборки таких как gulp, webpack. <strong>Условия работы:</strong> ТК РФ, 6-часовой рабочий день, премии. <strong> Обязанности:</strong> Разработка новых проектов и сопровождение существующих.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1142901005059/98cf16c6-87d2-11e7-9e02-736ab11edb0c'),
(201, '106618b6-e782-11e6-9310-4376a32b3f45', 63, NULL, 128, NULL, '2017-01-31', '2017-01-31 15:39:58', 8000, 'Слесарь механосборочных работ', 'Полная занятость', 'Полный рабочий день', '<ul>\r\n<li>Механосборочные работы небольших станков;</li>\r\n<li>Подключение электро узлов станка;</li>\r\n<li>Слесарные работы;</li>\r\n<li>Проверка, наладка и упаковка оборудования;</li>\r\n<li>Выполнение прочих задач компании, связанных с производственным отделом;</li>\r\n</ul>', 'NONE', '<p><em><strong>АДЭМС</strong></em> - <strong>стабильная производственная компания</strong>, лидер в производстве заточного оборудования в РФ и странах СНГ, является поставщиком оборудования по всему миру.</p>\r\n<p>В связи с открытием новых направлений и расширением производства требуются Слесарь механосборочных работ.</p>', '<p><em><strong>АДЭМС</strong></em> - <strong>стабильная производственная компания</strong>, лидер в производстве заточного оборудования в РФ и странах СНГ, является поставщиком оборудования по всему миру.</p>\r\n<p>В связи с открытием новых направлений и расширением производства требуются Слесарь механосборочных работ.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1126320002797/106618b6-e782-11e6-9310-4376a32b3f45'),
(202, 'e9ef63a0-372f-11e7-8142-037acc02728d', 77, NULL, 99, 2724, '2017-05-12', '2017-05-12 15:39:58', 50000, 'Главный бухгалтер', 'Полная занятость', 'Полный рабочий день', '<p>- Бухгалтерский учет в полном объеме. Численность до 20 чел.</p>\r\n<p>&nbsp;</p>', 'NONE', '<p>В ООО \"ВАМПЕЛ\" требуется&nbsp;<strong>Главный бухгалтер</strong>&nbsp;(оптовая торговля систем пожарной сигнализации).</p>\r\n<p>Условия: График работы 5/2 с 8 до 17 или с 9 до 18.</p>\r\n<p>Оформление по ТК.РФ.</p>\r\n<p>з/п от 50000 руб.</p>\r\n<p>компенсация проезда на городском транспорте.</p>\r\n<ul>\r\n<li>Место работы - г. Москва - восточный округ, пос. Восточный, ул. 9 Мая, дом 12Б, проезд от м. Щелковская (5-ый км. МКАД Щелковского шоссе). Прямой работодатель. Трудоустройство бесплатно.</li>\r\n</ul>', '<p>В ООО \"ВАМПЕЛ\" требуется&nbsp;<strong>Главный бухгалтер</strong>&nbsp;(оптовая торговля систем пожарной сигнализации).</p>\r\n<p>Условия: График работы 5/2 с 8 до 17 или с 9 до 18.</p>\r\n<p>Оформление по ТК.РФ.</p>\r\n<p>з/п от 50000 руб.</p>\r\n<p>компенсация проезда на городском транспорте.</p>\r\n<ul>\r\n<li>Место работы - г. Москва - восточный округ, пос. Восточный, ул. 9 Мая, дом 12Б, проезд от м. Щелковская (5-ый км. МКАД Щелковского шоссе). Прямой работодатель. Трудоустройство бесплатно.</li>\r\n</ul>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/502770898824/e9ef63a0-372f-11e7-8142-037acc02728d'),
(203, 'e89e91d6-2ef9-11e7-b266-037acc02728d', 77, NULL, 115, NULL, '2017-05-02', '2017-05-02 15:39:58', 35000, 'Водитель кат. С на вахту 15/15', 'Полная занятость', 'Вахтовый метод', '<p>Компания по вывозу мусора и снега требуются ВОДИТЕЛИ на КАМАЗ, МАЗ (спецтехника: мусоровозы, бункеровозы). Выполняемая работа: вывоз мусора и снега по Москве. </p>', 'NONE', '<p>Полная занятость, Вахтовый метод, 15 через 15 дней, з/п сдельная, 35000 - 50000 руб. за 15 дней. Предоставляется временное жилье в ,благоустроенном общежитии на время вахты. Есть оборудованная комната для приема пищи, душ.Оформление по трудовой книжке. Необходимо гражданство РФ. Работа по Москве, Офис и база: метро Полежаевская, 1-ый Силикатный проезд, д. 9, строение 3. Прямой работодатель.</p>', '<p>Полная занятость, Вахтовый метод, 15 через 15 дней, з/п сдельная, 35000 - 50000 руб. за 15 дней. Предоставляется временное жилье в ,благоустроенном общежитии на время вахты. Есть оборудованная комната для приема пищи, душ.Оформление по трудовой книжке. Необходимо гражданство РФ. Работа по Москве, Офис и база: метро Полежаевская, 1-ый Силикатный проезд, д. 9, строение 3. Прямой работодатель.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/502770898824/e89e91d6-2ef9-11e7-b266-037acc02728d'),
(204, 'cb78a216-08df-11e8-ad4f-736ab11edb0c', 77, NULL, 128, NULL, '2018-02-03', '2018-02-03 15:39:58', 50000, 'Механик/ремонтник, наладчик.', 'Полная занятость', 'Полный рабочий день', '<ul>\r\n<li>Обеспечение исправного состояния оборудования, ремонт устройств и оборудования, своевременный ремонт техники.</li>\r\n</ul>', 'NONE', '<p>На производство колбасных изделий (мини производство)&nbsp;требуется <strong>МЕХАНИК/РЕМОНТНИК, НАЛАДЧИК</strong> по ремонту и обслуживанию пищевого оборудования.</p>\r\n<ul>\r\n<li>Оплата от 50000 руб. + б/пл. питание.</li>\r\n<li>График работы 5/2, 6/1 с 9.00 до 18.00.</li>\r\n<li>Москва Метро ЮГО-ЗАПАДНАЯ (далее автобусом 15 минут, район Внуково)</li>\r\n</ul>\r\n<p>Прямой работодатель!&nbsp;</p>', '<p>На производство колбасных изделий (мини производство)&nbsp;требуется <strong>МЕХАНИК/РЕМОНТНИК, НАЛАДЧИК</strong> по ремонту и обслуживанию пищевого оборудования.</p>\r\n<ul>\r\n<li>Оплата от 50000 руб. + б/пл. питание.</li>\r\n<li>График работы 5/2, 6/1 с 9.00 до 18.00.</li>\r\n<li>Москва Метро ЮГО-ЗАПАДНАЯ (далее автобусом 15 минут, район Внуково)</li>\r\n</ul>\r\n<p>Прямой работодатель!&nbsp;</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/502770898824/cb78a216-08df-11e8-ad4f-736ab11edb0c'),
(205, '0e50b3d6-1c54-11e7-aac5-736ab11edb0c', 77, NULL, 105, NULL, '2017-04-08', '2017-04-08 15:39:58', 30000, 'Охранник/контролер.', 'Полная занятость', 'Сменный график', '<p>Выполняемая работа: - охрана внутренних постов в ТД на Никольской. Два часа на ногах, два часа видеонаблюдение (сидя). Всегда можно отойти попить кофе, немного отдохнуть.</p>', 'NONE', '<p>ООО ЧОП \"Вымпел Морской транспорт\" приглашает на работу ОХРАННИКА-КОНТРОЛЕРА. Гр/работы сменный, суточный, 2/2 (двое суток через двое). ТД открыт для посетителей только днем. Ночью ТД не работает. Оплата - 2000 руб. /сутки. Трудоустройство по ТК РФ (оплачиваемый отпуск, больничный). Оформление зарплаты на карточку, без задержки 2 раза а м-ц (аванс с 17 по 20 и з/п с 1 по 5 каждого м-ца). Приветствуются уволенные в запас сотрудники МВД, УВД, военнообязанные, уволенные в запас. Возможна работа для трудоспособных пенсионеров.&nbsp;</p>\r\n<p>Прямой работодатель. Трудоустройство бесплатно!</p>', '<p>ООО ЧОП \"Вымпел Морской транспорт\" приглашает на работу ОХРАННИКА-КОНТРОЛЕРА. Гр/работы сменный, суточный, 2/2 (двое суток через двое). ТД открыт для посетителей только днем. Ночью ТД не работает. Оплата - 2000 руб. /сутки. Трудоустройство по ТК РФ (оплачиваемый отпуск, больничный). Оформление зарплаты на карточку, без задержки 2 раза а м-ц (аванс с 17 по 20 и з/п с 1 по 5 каждого м-ца). Приветствуются уволенные в запас сотрудники МВД, УВД, военнообязанные, уволенные в запас. Возможна работа для трудоспособных пенсионеров.&nbsp;</p>\r\n<p>Прямой работодатель. Трудоустройство бесплатно!</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/502770898824/0e50b3d6-1c54-11e7-aac5-736ab11edb0c'),
(206, '2e86cc56-08e1-11e8-ad4f-736ab11edb0c', 77, NULL, 124, NULL, '2018-02-03', '2018-02-03 15:39:58', 40000, 'Вязальщик, формовщик колбасных изделий.', 'Полная занятость', 'Полный рабочий день', '<p>Вязальщик - Ручная вязка колбасных изделий и деликатесов</p>\r\n<p>Формовщик - Наполнение оболочки фаршем.</p>\r\n<p>- Соблюдение норм санитарии на рабочем месте.</p>', 'NONE', '<p>На производство колбасных изделий требуются Рабочие в цех - на вакансии - ФОРМОВЩИК и ВЯЗАЛЬЩИК колбас, колбасных изделий и деликатесов.</p>\r\n<ul>\r\n<li>Оплата от 40000 руб. и выше (в зависимости от квалификации).</li>\r\n<li>График работы 6/1. с 8-00 до 17-00.</li>\r\n<li>Москва, р-н Внуково, проезд от м. ЮГО-ЗАПАДНАЯ, далее автобусом 15 минут или м. САЛАРЬЕВО далее автобусом 15 минут. Район Внуково.</li>\r\n</ul>\r\n<p>Прямой работодатель!</p>', '<p>На производство колбасных изделий требуются Рабочие в цех - на вакансии - ФОРМОВЩИК и ВЯЗАЛЬЩИК колбас, колбасных изделий и деликатесов.</p>\r\n<ul>\r\n<li>Оплата от 40000 руб. и выше (в зависимости от квалификации).</li>\r\n<li>График работы 6/1. с 8-00 до 17-00.</li>\r\n<li>Москва, р-н Внуково, проезд от м. ЮГО-ЗАПАДНАЯ, далее автобусом 15 минут или м. САЛАРЬЕВО далее автобусом 15 минут. Район Внуково.</li>\r\n</ul>\r\n<p>Прямой работодатель!</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/502770898824/2e86cc56-08e1-11e8-ad4f-736ab11edb0c'),
(207, 'a4b2b016-3764-11e6-9fcf-037acc02728d', 77, NULL, 115, NULL, '2016-06-21', '2016-06-21 15:39:58', 40000, 'Водитель с кат. С.', 'Полная занятость', 'Полный рабочий день', '<p>Выполняемая работа: адресная доставка ТНП (мебели, продуктов питания, строительных материалов, хоз. товаров клиентам компании, по Московскому региону (Москва).</p>\r\n<p>Стоянка автомобилей м. Фили.</p>', 'NONE', '<p>В транспортную компанию Москвы требуется ВОДИТЕЛЬ (в/у категории С на автомобиль Hyundai. Условия: Оплата сдельная, от&nbsp;35 000 до 50 000 руб. в месяц (без задержки выплат). График работы: Полная занятость,&nbsp;5/2. Оформление по ТК РФ. Вакансия прямого работодателя. Трудоустройство бесплатно!</p>', '<p>В транспортную компанию Москвы требуется ВОДИТЕЛЬ (в/у категории С на автомобиль Hyundai. Условия: Оплата сдельная, от&nbsp;35 000 до 50 000 руб. в месяц (без задержки выплат). График работы: Полная занятость,&nbsp;5/2. Оформление по ТК РФ. Вакансия прямого работодателя. Трудоустройство бесплатно!</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/502770898824/a4b2b016-3764-11e6-9fcf-037acc02728d'),
(208, '1f0bd1a6-bad8-11e7-abea-037acc02728d', 77, NULL, 128, NULL, '2017-10-27', '2017-10-27 15:39:58', 50000, 'Слесарь - ремонтник насосного оборудования.', 'Полная занятость', 'Полный рабочий день', '<p>Выполняемая работа:</p>\r\n<p>Ремонт и диагностика насосного оборудования; консультации клиентов по техническим вопросам; ведение отчетности по ремонту.</p>', 'NONE', '<p>На производство (работает с 1992г.) требуется <strong>Слесарь - ремонтник сервисной службы</strong> в стабильную фирму по производству высококачественного энергосберегающего насосного оборудования (насосы и автоматизированные насосные установки для систем водоснабжения, отопления, пожаротушения жилых домов, промышленных предприятий, нужд ЖКХ).</p>\r\n<p>График работы полная занятость, 5/2, кр. вых. с 8.00 до 17.00. Возможны командировки по России (оплачиваются дополнительно).</p>\r\n<p>Заработная плата оклад от 50 000 руб. (по итогам собеседования), премия по итогам года.</p>\r\n<p>Оформление по ТК РФ, соц. пакет.</p>', '<p>На производство (работает с 1992г.) требуется <strong>Слесарь - ремонтник сервисной службы</strong> в стабильную фирму по производству высококачественного энергосберегающего насосного оборудования (насосы и автоматизированные насосные установки для систем водоснабжения, отопления, пожаротушения жилых домов, промышленных предприятий, нужд ЖКХ).</p>\r\n<p>График работы полная занятость, 5/2, кр. вых. с 8.00 до 17.00. Возможны командировки по России (оплачиваются дополнительно).</p>\r\n<p>Заработная плата оклад от 50 000 руб. (по итогам собеседования), премия по итогам года.</p>\r\n<p>Оформление по ТК РФ, соц. пакет.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/502770898824/1f0bd1a6-bad8-11e7-abea-037acc02728d'),
(209, 'ebf59256-b830-11e7-aef1-e37b4be0b9ed', 63, NULL, 126, NULL, '2017-10-23', '2017-10-23 15:39:58', 12000, 'Менеджер по работе с клиентами', 'Удаленная', 'Гибкий график', '<p>- размещение объявлений, распространение рекламы (шаблоны предоставляются),- консультирование клиентов, переговоры с партнерами- ведение базы данных Excel,- обучение по корпоративной программе и развитие.</p>', 'NONE', '<p>занятость от 2-3 часов в день, удаленная работа, стаж, официальное оформление, возможен гибкий график, частичная занятость. Просьба: если вас заинтересовала наша вакансия, нажмите кнопку \"Откликнуться\" и наш менеджер свяжется с вами. </p>', '<p>занятость от 2-3 часов в день, удаленная работа, стаж, официальное оформление, возможен гибкий график, частичная занятость. Просьба: если вас заинтересовала наша вакансия, нажмите кнопку \"Откликнуться\" и наш менеджер свяжется с вами. </p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/304631528600092/ebf59256-b830-11e7-aef1-e37b4be0b9ed'),
