(215, '7e5497e6-b2b4-11e7-8d40-736ab11edb0c', 61, NULL, 98, NULL, '2017-10-16', '2017-10-16 15:39:58', 25000, 'Контент-менеджер', 'Частичная занятость', 'Гибкий график', '<p>создание и продвижение пабликов, групп, страниц в социальных сетях (обучение от компании), создание отчетов, ведение баз данных привлечение клиентов.</p>', 'NONE', '<p>работа удаленного характера, график работы индивидуальный (обговаривается на собеседовании), заработная плата зависит от объема работ.</p>', '<p>работа удаленного характера, график работы индивидуальный (обговаривается на собеседовании), заработная плата зависит от объема работ.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/311619325200084/7e5497e6-b2b4-11e7-8d40-736ab11edb0c'),
(216, '33db4246-11aa-11e8-b17c-037acc02728d', 77, NULL, 127, NULL, '2018-02-14', '2018-02-14 15:39:58', 80000, 'Консультант в нотариальную контору (центр)', 'Полная занятость', 'Полный рабочий день', '<p>- Ведение приема, консультирование (юридические и физические лица),&nbsp;- Нотариальное делопроизводство,&nbsp;- Ведение и заполнение реестра,&nbsp;- Подготовка проектов документов (доверенности, завещания, заявления, согласия, договоры и т.д.)- Ведение наследственных дел,&nbsp;- Формирование нотариального архива,&nbsp;- Большой объем работы связан с недвижимостью,&nbsp;- Работа по сопровождению сделок с нотариусом на выезде.</p>', 'NONE', '<p>Работа в Нотариальной конторе в центре Москвы.- 5-ти дневная рабочая неделя с 11.00 до 21.00, 2 выходных в неделю,&nbsp;- Отпуск и больничные по ТК РФ,&nbsp;- Достойная заработная плата,&nbsp;- Повышение квалификации, профессиональный рост,&nbsp;- Небольшой дружный коллектив.</p>', '<p>Работа в Нотариальной конторе в центре Москвы.- 5-ти дневная рабочая неделя с 11.00 до 21.00, 2 выходных в неделю,&nbsp;- Отпуск и больничные по ТК РФ,&nbsp;- Достойная заработная плата,&nbsp;- Повышение квалификации, профессиональный рост,&nbsp;- Небольшой дружный коллектив.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1037739313303/33db4246-11aa-11e8-b17c-037acc02728d'),
(217, '52323496-0c02-11e8-b1da-037acc02728d', 77, NULL, 116, NULL, '2018-02-07', '2018-02-07 15:39:58', 35000, 'Разнорабочий', 'Полная занятость', 'Вахтовый метод', '<p>Сбор автомобильных жгутов из разноцветных проводов</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/e38f6b00-0bea-11e8-b1da-037acc02728d/52323496-0c02-11e8-b1da-037acc02728d'),
(218, '992299d6-118e-11e8-b17c-037acc02728d', 77, NULL, 116, NULL, '2018-02-14', '2018-02-14 15:39:58', 50000, 'Радиомонтажник', 'Полная занятость', 'Вахтовый метод', '<p>&nbsp;</p>\r\n<p>&nbsp;Работа вахтовым методом работы 30/60, график работы 6/1, работа на Приборостроительном заводе в г. Курган.</p>\r\n<p>&nbsp;Умение работать с измерительными приборами (осциллограф, вольтметр, амперметр, частотомер и др.) Умение работать на контрольных стендах; с технической документацией. Умение читать схемы, технологические чертежи. Настройка плат и приборов</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/e38f6b00-0bea-11e8-b1da-037acc02728d/992299d6-118e-11e8-b17c-037acc02728d'),
(219, '2287ac40-119b-11e8-b17c-037acc02728d', 77, NULL, 128, NULL, '2018-02-14', '2018-02-14 15:39:58', 55000, 'Регулировщик радиоаппаратуры в г. Курган Вахта!!!', 'Полная занятость', 'Вахтовый метод', '<p>Умение работать с измерительными приборами (осциллограф, вольтметр, амперметр, частотометр и др.) Умение работать на контрольных стендах; с технической документацией. Умение читать схемы, технологические чертежи. Настройка плат и приборов</p>', 'NONE', '<p>Работа вахтовым методом 2/1</p>\r\n<p>г. Курган</p>\r\n<p>&nbsp;</p>', '<p>Работа вахтовым методом 2/1</p>\r\n<p>г. Курган</p>\r\n<p>&nbsp;</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/e38f6b00-0bea-11e8-b1da-037acc02728d/2287ac40-119b-11e8-b17c-037acc02728d'),
