(234, '3e8a35c7-116e-11e8-8d7b-736ab11edb0c', 77, NULL, 127, 4493, '2018-02-14', '2018-02-14 15:39:58', 40000, 'ЮРИСТ', 'Полная занятость', 'Полный рабочий день', '<p>- ведение дел в судах и арбитражных судах;</p>\r\n<p>- правовое сопровождение деятельности предприятий;</p>\r\n<p>- консультирование граждан и представителей предприятий;</p>\r\n<p>- составление договоров, соглашений, жалоб, заявлений и проч.</p>\r\n<p>&nbsp;</p>', 'NONE', '<p>- стабильная и постоянная работа;</p>\r\n<p>- официальное оформление на работу (трудовой договор, запись в трудовую книжку);</p>\r\n<p>- рабочий день с 10.00 час. до 18.00 час.;</p>\r\n<p>- обед с 13.00 час. до 14.00 час.;</p>\r\n<p>- предоставление очередного ежегодного отпуска;</p>\r\n<p>- возможность совмещать обучение и работу;</p>\r\n<p>- оборудованное рабочее место (ПК, Интернет, Консультант Плюс)</p>', '<p>- стабильная и постоянная работа;</p>\r\n<p>- официальное оформление на работу (трудовой договор, запись в трудовую книжку);</p>\r\n<p>- рабочий день с 10.00 час. до 18.00 час.;</p>\r\n<p>- обед с 13.00 час. до 14.00 час.;</p>\r\n<p>- предоставление очередного ежегодного отпуска;</p>\r\n<p>- возможность совмещать обучение и работу;</p>\r\n<p>- оборудованное рабочее место (ПК, Интернет, Консультант Плюс)</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1087746833327/3e8a35c7-116e-11e8-8d7b-736ab11edb0c'),
