(261, '48576e50-e70d-11e7-88b9-ef76bd2a03c1', 74, NULL, 126, NULL, '2017-12-22', '2017-12-22 15:39:58', 0, 'Администратор на ресепшн', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> В офис. График 5/2 с 8 до 17, карьера, обучение, рассмотрим без о/р.  Требования: коммуникабельность, активность, оптимизм, приятный вн. вид  Обязанности: встреча посетителей, консультирование, ведение заявок и пропусков, прием тел. звонков.</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/48576e50-e70d-11e7-88b9-ef76bd2a03c1'),
