(269, '8e8f8566-d506-11e7-bf93-037acc02728d', 74, NULL, 126, NULL, '2017-11-29', '2017-11-29 15:39:58', 0, 'Работа / подработка', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Работа за компьютером с выходом в интернет. Занимает не более 2-ух часов в день. В обязанности входит размещение объявлений на cайтах, форумах, работа с электронной почтой. Если Вы&nbsp;студент&nbsp;или просто ищите дополнительный заработок, то эта работа для Вас!  Усидчивость, нацеленность на результат. Без опыта.  Работа занимает не более 2-ух часов в день. График составляете сами. Можно на дому.</p>\r\n<p>&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/8e8f8566-d506-11e7-bf93-037acc02728d'),
(270, '40d1a066-d4f7-11e7-bf93-037acc02728d', 74, NULL, 126, NULL, '2017-11-29', '2017-11-29 15:39:58', 0, 'Администратор-ресепшионист', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<ul>\r\n<li> Работа на ресепшен, прием/регистрация корреспонденции;  &bull; регистрация /отправка корреспонденции;  &bull; прием/отправка факсов, ведение адресной книги;  &bull; прием/выдача документов членам партнерства, прием входящих звонков.</li>\r\n</ul>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/40d1a066-d4f7-11e7-bf93-037acc02728d'),
(271, '6c8144a6-d451-11e7-bf93-037acc02728d', 74, NULL, 109, NULL, '2017-11-28', '2017-11-28 15:39:58', 0, 'Ассистент руководителя', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Обязанности:  &bull; Ведение переговоров и заключение договоров  &bull; Прием звонков  &bull; Оформление документов  &bull; Ведение отчетности  &bull; организация мероприятий по повышению квалификации работников  &bull; контроль над работой сотрудников  &bull; планирование работы&nbsp;руководителя  &bull; выполнение поручений&nbsp;руководителя  Требования:  &bull; Ответственность  &bull; Обучаемость  &bull; Грамотность  &bull; Аккуратность  &bull; Креативность приветствуется  &bull; Знание ПК на уровне пользователя приветствуется  Условия:  &bull; График работы 5/2&nbsp;  &bull; Офис в центре города  &bull; Карьерный рост  &bull; Обучение за счет компании  &bull; Возможность личностного роста  &bull; Дружный коллектив</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/6c8144a6-d451-11e7-bf93-037acc02728d'),
(272, '318bfe76-d4ca-11e7-bf93-037acc02728d', 74, NULL, 97, NULL, '2017-11-29', '2017-11-29 15:39:58', 0, 'Сотрудник с опытом кладовщика', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Работа по договору, с 9 до 17, опыт приветствуется. Бытовая химия и мелкая быт. техника  Требуется спокойный, внимательный человек, знать ПК  Работа изначально в офисе, с заявками, накладными.</p>\r\n<p>&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/318bfe76-d4ca-11e7-bf93-037acc02728d'),
(273, '7ccc52d6-d435-11e7-bf93-037acc02728d', 74, NULL, 121, NULL, '2017-11-28', '2017-11-28 15:39:58', 0, 'Администратор-оператор ввод данных', 'Полная занятость', 'Полный рабочий день', '<p>*************</p>', 'NONE', '<p>&nbsp;</p>\r\n<p> Обязанности:  - Корректировка информации;  - Расчет и выпуск платежных документов;&nbsp;  - регистрация и оформление первичной документации для&nbsp;бухгалтерии и поставщика.  Требования:  - Базовые основы работы на&nbsp;пк  - Исполнительность  - Внимательность  Условия:  график с 9-17 часов  Рассмотрим всех кандидатов (включая без опыта)  Обучение  Стабильные выплаты</p>', '<p>&nbsp;</p>\r\n<p> Обязанности:  - Корректировка информации;  - Расчет и выпуск платежных документов;&nbsp;  - регистрация и оформление первичной документации для&nbsp;бухгалтерии и поставщика.  Требования:  - Базовые основы работы на&nbsp;пк  - Исполнительность  - Внимательность  Условия:  график с 9-17 часов  Рассмотрим всех кандидатов (включая без опыта)  Обучение  Стабильные выплаты</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/7ccc52d6-d435-11e7-bf93-037acc02728d'),
(274, 'a9e42576-d446-11e7-bf93-037acc02728d', 74, NULL, 126, NULL, '2017-11-28', '2017-11-28 15:39:58', 0, 'Архивовед', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Обязанности: прием звонков, но в основном работа с документацией: создание архива офиса. быстро ориентироваться в нем. (опыт работы с документацией приветствуется)&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/a9e42576-d446-11e7-bf93-037acc02728d'),
(275, 'a59e4526-d97a-11e7-be91-736ab11edb0c', 74, NULL, 127, NULL, '2017-12-05', '2017-12-05 15:39:58', 0, 'Помощник юриста', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Обязанности: Подготовка и заключение договоров&sbquo; контроль деловой документацией компании&sbquo; подготовка предложений для руководителя (юридическое сопровождение оформления и заключения договоров и контрактов )  Условия: работа от прямого работодателя&sbquo; предлагается полный корпоративный соцпакет&sbquo; график работы скользящий&sbquo; 5/2, рассматриваются студенты заочных отделений&sbquo; молодые пенсионеры&sbquo; карьера&sbquo; высокий доход, загранпоездки от компании</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/a59e4526-d97a-11e7-be91-736ab11edb0c'),
(276, 'c6024476-d983-11e7-be91-736ab11edb0c', 74, NULL, 126, 5023, '2017-12-05', '2017-12-05 15:39:58', 0, 'Административный секретарь', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Условия: Работа на территории работодателя, бесплатное обучение, карьерный рост, оплата своевременная, рассмотрим без опыта работы, соц.пакет.</p>\r\n<p>Требования: Деловой внешний вид, исполнительность, коммуникабельность.</p>\r\n<p>Обязанности: Прием телефонных звонков и обработка корреспонденции, ведение делопроизводства.</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/c6024476-d983-11e7-be91-736ab11edb0c'),
(277, '729fc636-d989-11e7-be91-736ab11edb0c', 74, NULL, 115, NULL, '2017-12-05', '2017-12-05 15:39:58', 0, 'Торговый представитель (гиб / гр)', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> ОБЯЗАННОСТИ:&nbsp;  оформление заявок, переговоры с клиентами, заключение договоров и контрактов.&nbsp;  ТРЕБОВАНИЯ:&nbsp;  коммуникабельность, целеустремленность, умение работать в команде, исполнительность.  УСЛОВИЯ:&nbsp;  гибкий график, рассмотрим студентов, соц.пакет, рассмотрим без опыта работы, карьерный рост, дружный коллектив.</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/729fc636-d989-11e7-be91-736ab11edb0c'),
(278, 'aa8af1b0-d9b5-11e7-be91-736ab11edb0c', 74, NULL, 98, NULL, '2017-12-05', '2017-12-05 15:39:58', 0, 'Специалист по работе со СМИ', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Обязанности:  &ndash; мониторинг СМИ,  &ndash; организация публикаций,  &ndash; поддержка контактов с представителями СМИ,  &ndash; ведение архива публикаций.  Требования:  - коммуникабельность  - навыки ведения переговоров  - грамотная речь  - обучаемость  - уверенный пользователь ПК  - активность, мобильность  Условия:  - стабильная интересная работа в динамично развивающейся компании  - возможность профессионального развития и карьерного роста  - условия обсуждаются с успешными кандидатами (возможны индивидуальные условия)  - полная занятость (5 дней в неделю, с 09-00 до 17-00) либо частичная  - офис в центре города&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/aa8af1b0-d9b5-11e7-be91-736ab11edb0c'),
(279, '6f9ae8b6-f627-11e7-9133-e37b4be0b9ed', 74, NULL, 99, NULL, '2018-01-10', '2018-01-10 15:39:58', 0, 'Помощник бухгалтера обучение', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Обязанности:  - прием звонков, оформление заявок  - работа с деловой документацией  - отчетная и текущая документация  Условия:  - полное оформление по ТК  - гибкий график (4,6,8 &ndash; часовой день)  - карьерный и профессиональный рост  Требования:  - пользователь ПК  - рассмотрим студентов</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/6f9ae8b6-f627-11e7-9133-e37b4be0b9ed'),
(280, '315594d6-f7ab-11e7-9699-037acc02728d', 74, NULL, 105, NULL, '2018-01-12', '2018-01-12 15:39:58', 0, 'Почти вахтер', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Обязанности: проверка пропусков, встреча и консультирование&nbsp;клиентов, работа на телефоне.  Требование: трудолюбие, отсутствие вредных привычек, порядочность.&nbsp;  Условия: официальное трудоустройство, соц.пакет, дружный коллектив, гибкий&nbsp;график, рассмотрим студентов, бесплатное обучение.&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/315594d6-f7ab-11e7-9699-037acc02728d'),
(281, 'a723fbe6-f7a4-11e7-9699-037acc02728d', 74, NULL, 115, NULL, '2018-01-12', '2018-01-12 15:39:58', 0, 'Водителям - экспедиторам', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p> Условия  Гибкий график, официальное трудоустройство, полный соц. пакет.  Требования  ответственность,&nbsp;  пунктуальность,&nbsp;  исполнительность  Обязанности  Работа с документацией, товарами для дома  (накладные, счет - фактуры).</p>\r\n<p>&nbsp;</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/a723fbe6-f7a4-11e7-9699-037acc02728d'),
(282, '48611da6-f7a8-11e7-9699-037acc02728d', 74, NULL, 98, NULL, '2018-01-12', '2018-01-12 15:39:58', 0, 'Специалист по пиар', 'Полная занятость', 'Полный рабочий день', '<p>&nbsp;</p>\r\n<p>Требования:  уверенный пользователь ПК&sbquo; умение проводить телефонные переговоры&sbquo; активная жизненная позиция&sbquo; исполнительность&sbquo; креативность.&nbsp;  Обязанности:  взаимодействие со СМИ&sbquo; написание статей и текстов.  Условия:  дружный коллектив&sbquo; корпоративные мероприятия.</p>', 'NONE', ' ', ' ', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/313491012200050/48611da6-f7a8-11e7-9699-037acc02728d'),
