(292, 'e1a65536-9d48-11e7-9620-4376a32b3f45', 50, NULL, 124, 460, '2017-09-19', '2017-09-19 15:39:58', 45000, 'грузчик', 'Полная занятость', 'Полный рабочий день', '<p>-погрузка и разгрузка на складе готовой продукции и на складе сырья.</p>', 'NONE', '<p>В компанию по производству соусов требуются сотрудники на вакансии грузчик &nbsp;и оператор линии.Работа вахтовым методом в Московской области г.Егорьевске--проживание в общежитии(хорошее,новое).Вахта от 40 дней.Оформление официальное &nbsp;с первого дня, в офисе в Москве при наличии всего пакета документов необходимых для работы в Москве и области.Денежные авансовые выплаты производятся на карту и возможны -еженедельно.На все вопросы отвечу по тел 89031999040 или почта.</p>', '<p>В компанию по производству соусов требуются сотрудники на вакансии грузчик &nbsp;и оператор линии.Работа вахтовым методом в Московской области г.Егорьевске--проживание в общежитии(хорошее,новое).Вахта от 40 дней.Оформление официальное &nbsp;с первого дня, в офисе в Москве при наличии всего пакета документов необходимых для работы в Москве и области.Денежные авансовые выплаты производятся на карту и возможны -еженедельно.На все вопросы отвечу по тел 89031999040 или почта.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/5147746176001/e1a65536-9d48-11e7-9620-4376a32b3f45'),
