(300, '98cf16c6-87d2-11e7-9e02-736ab11edb0c', 29, NULL, 121, NULL, '2017-08-23', '2017-08-23 15:39:58', 20000, 'Back-end разработчик', 'Полная занятость', 'Полный рабочий день', '<p>Разработка новых проектов и сопровождение существующих.</p>', 'NONE', '<p><strong>Требования:</strong> Английский - чтение профессиональной литературы. Образование не имеет значения. Опыт работы в данной области 1-2 года. Знание языков программирования: php(5.6+), javascript(ES6+). Знание языков разметки: HTML5, CSS3. Умение пользоваться системой контроля версий git. Знание PSR, Шаблонов проектирования, REST. Умение разбираться в чужом коде. Понимание протокола http/http2 и технологии ajax (xmlhttprequest) Не обязательно: уверенное обращение с unix системами, знание инструментов сборки таких как gulp, webpack. <strong>Условия работы:</strong> ТК РФ, 6-часовой рабочий день, премии. <strong> Обязанности:</strong> Разработка новых проектов и сопровождение существующих.</p>', '<p><strong>Требования:</strong> Английский - чтение профессиональной литературы. Образование не имеет значения. Опыт работы в данной области 1-2 года. Знание языков программирования: php(5.6+), javascript(ES6+). Знание языков разметки: HTML5, CSS3. Умение пользоваться системой контроля версий git. Знание PSR, Шаблонов проектирования, REST. Умение разбираться в чужом коде. Понимание протокола http/http2 и технологии ajax (xmlhttprequest) Не обязательно: уверенное обращение с unix системами, знание инструментов сборки таких как gulp, webpack. <strong>Условия работы:</strong> ТК РФ, 6-часовой рабочий день, премии. <strong> Обязанности:</strong> Разработка новых проектов и сопровождение существующих.</p>', 'EMPLOYMENT_SERVICE', 1, ' ', 0, 'https://trudvsem.ru/vacancy/card/1142901005059/98cf16c6-87d2-11e7-9e02-736ab11edb0c');
